INSERT INTO `project_descriptions` (`id`, `description`, `project_id`, `created_at`, `updated_at`) VALUES
(1, '<p>This program has the following Four (4) components which aim to Institutionalized the National Soil Monitoring and Rejuvenation Program, Monitor Soil Health Through Mobile Soils Laboratory cum Community Farm Clinic, Strengthening Partnership of BSWM, RSL, LGUs, ATI and Rural Based Institutions and Local Cooperatives for the National Soil Health Program through Doorstep Soil Analytical Services and Production and Improvement in Soil Analysis through the Enhancement of STK (ESTK) for Macro and Micronutrients. \"The goal of this program is to have a systematic and holistic approach in addressing soil health to ensure sustainable use and management of soil resources and enhanced productivity and income in line with the Department’s twin objectives of sustainable production and profitability. Ani at Kita Mantra\"</p>', 15, '2021-06-09 11:41:29', '2021-06-22 16:56:45'),
(2, '<p>This project will serve as the Phase 2 of the Phase 1 implementation of BFAR\'s Vessel Monitoring System (VMS) and integration of various databases including fishing vessel registry, ocean and weather data, stock assessment data, IUUF records and other regulatory information. The IMEMS project is dedicated to set up an integrated operational fisheries and marine environment monitoring center in the Philippines. Through this project, we will be able to monitor fishing vessels and combat illegal fisheries in order to protect the maritime resource in a sustainable way, support the national fishing industry, and promote seafood products for export. The Project is in accordance to the thrusts and program of the government under the Philippine Development Plan 2017-2022 on Expanding Economic Opportunities in Agriculture, Forestry and Fisheries specifically to pursue an ecosystems approach to fisheries management including the conduct of regular nationwide fish stock inventory and assessment and strengthening measures against illegal, unreported and unregulated fishing and implement boat, vessel and gear registration and licensing, and monitoring of compliance with catch documentation among municipal and commercial fishing boats. Also, the implementation of the PHILO Project is in line with the implementation of a Monitoring Control and Surveillance System under RA 8550 as amended by RA 10654 to ensure a rational and sustainable development, management and conservation of the marine and aquatic resources. The project aims to significantly improve and extend the existing capabilities of the BFAR Vessel Monitoring System (VMS) and operationalize a Single Integrated National Marine Environment Monitoring System that is financially viable and scalable over the long term.</p>', 19, '2021-06-09 11:41:29', '2021-06-10 13:19:06'),
(3, '<p>General Objective: Increase productivity and income of fishers in Guimaras, Province Specific Objective: 1. Build and operate fully functional high-tech smart hatchery facility for producing quality fries of high value species 2. Demonstrate grow-out of high-value species at pilot mariculture facilities 3. Restore damaged fisheries habitats through reforestation of seagrass meadows and collecting marine litters 4. Build and enhance capacity of Guimaras fishers, officials and other stakeholders on aquaculture, conservation of marine ecosystem and eco-tourism</p>', 16, '2021-06-09 11:41:29', '2021-06-11 12:03:00'),
(4, '<p>In line with the DA’s program, the Bureau of Fisheries and Aquatic Resources (BFAR) targets to address the challenges to uplift the small-scale/municipal fisheries’ sector economic conditions. Initially, the BFAR has already developed the program to equip and modernize municipal fisherfolk which proposed to provide by 2021 allocation of 49 units small to medium scale commercial fishing vessels to improve efficiency and increase production. This is in consideration that the fishing capacity of the municipal fishing boats may be considered relatively inadequate, with its operations mainly in coastal waters and with limited capacity and efficiency of applied fishing technologies. In complementation, the BFAR also implements the National Payao Program though the Tuna Conservation and Management Zone (TCMZ) project. The program is implemented by the provisions of fish aggregating devices or payao to tuna handliners as livelihood assistance to improve their efficiencies and productivity. This is on top of the TCMZ’s main objective to reduce incidence of juvenile tuna catches by designating exclusive areas for tuna handline only.</p>', 17, '2021-06-09 11:41:29', '2021-06-11 12:01:50'),
(6, '<p>Aquaculture addresses the production shortfall in capture fisheries that has been on the decline for the past several years. It is the fastest growing food producing sector in the world. Aquaculture production is more or less assured since it is generally under controlled conditions. Advances in technology provide efficient schemes for climate proofing, optimum productivity and economic resiliency of communities. The approval of this project will ensure that existing facilities are rehabilitated and improved so they will be able to operate fully. It will also mean the installation of more facilities such as the establishment of additional submersible fish cages, seaweed and shellfish farms to increase fisheries production and attain fish sufficiency. The project will also establish a toll processing facility that is GMP-SSOP and HACCP compliant. This will serve fisherfolk associations composed mostly of women who do not have their own processing areas so that their products conform to food safety protocols. The project will also invest in state of the art environmental monitoring equipment to guarantee the integrity of the production areas and its sustainability. Last but not least, it will seek to continually upgrade the capabilities of its most important resource – the manpower composed of fisherfolk and other technical personnel from the BFAR and the LGUs so that the Project is properly managed and operated.</p>', 18, '2021-06-09 11:41:29', '2021-06-11 12:02:23'),
(7, '<p>Vegetables are valuable sources of vitamins A and C, iron, calcium, folic acid, and dietary fiber. It is also a profitable business for farmers since leafy vegetables are fast growing crops that are usually harvested within four to six weeks. However, vegetables are highly perishable crops that shall be sold in the market within a few hours of harvest. Therefore, vegetables are usually grown in peri-urban production areas (Talekar et. al, 2003). Aside from perishability, vegetable production is also threatened by climate related risks since the Philippines experiences extreme climatic conditions. The climate in the country are classified into four based on rainfall distribution identified by the Philippine Atmospheric, Geophysical, and Astronomical Services Administration (PAG-ASA). Under this classification, the Laguna province is under the Type I climate with two pronounced seasons. However, the region is prone to climate viability such as typhoons, torrential rains and flooding, and drought resulting to low agricultural incomes, high production risk, and market disruption. The lack of innovative production systems, resource-efficient technologies and climate-resilient varieties are some of the constraints in the development of the vegetable industry in the country. One of the solutions for this problem is by adapting the use of protected structures. Use of protected structures is an important innovation that allows year-round production of vegetables, thus growers can enjoy higher returns per unit area. Moreover, it could reduce yield losses caused by insect pests, diseases and heavy rain, which results in higher productivity. Growers who cannot afford the high initial construction costs of net houses or plastic houses can grow vegetables under temporary net tunnels. The net tunnels are constructed with U-shaped iron or aluminium bars, which are covered with nylon netting over each bed (Talekar et al., 2003). Moreover, greenhouse technology is an important innovation that allows year-round production of domesticated plants including vegetables, less exposed to environmental constraints, and higher yield potentials with better quality. However, further research, development, training and new norms are required because of the differences in climatic characteristics, cultivar-specific management requirements, and identification of new crops or varieties that will guarantee economic returns, cope with rapid changes in market trends, and consumer preferences including climate change.</p>', 42, '2021-06-09 11:41:29', '2021-06-24 08:27:41'),
(8, '<p>As part of BFAR\'s initiative in improving and strengthening the current MCS program, it aims to provide services which allow the applications of standard vessel operating procedure process across its restrictions using appropriate monitoring and management controls to delegate more responsibility to the vessel operators. The proper implementation of standard processes and controls will improve the work efficiency and will augment progressive times by providing the vessels as core equipment in operating within the Philippine waters</p>', 20, '2021-06-09 11:41:29', '2021-06-25 08:39:45'),
(9, '<p>Component 1: Fisheries Coastal Areas Resiliency Planning (FishCARP) -supports spatial planning and developmental policies and guidelines. These may include activities relevant to integrated coastal zone planning focusing on Fisheries Management Areas (FMAs) using Ecosystem Approach to Fisheries Management (EAFM), vulnerable areas of the coast including fishing communities, and nearshore areas using the results of Fisheries Vulnerability/Suitability Assessment Tool (FishVOOL) conducted by NFRDI Component 2: Fisheries and Coastal-Resilient Resource Management (FishCRRM) - supports management of coastal and marine resources to promote resiliency and sustainable fisheries. Activities under consideration include institutional and procedural strengthening of Marine Protected Areas and coastal habitats; management of fish stocks using modern technologies; development of coastal vegetation, and co-management of municipal waters with coastal communities, law enforcement and certification on fisheries sustainability and traceability Component 3: Modern and Resilient Fisheries and Aquaculture Enterprises, Infrastructure and Support Facilities - supports modernization of fisheries and aquaculture enterprises throughout the value supply chain including investments on climate-resilient infrastructure, support facilities, system development, credit and insurance access, and logistics. Activities under consideration include development, management and modernization of aquaculture and capture fisheries; adoption of climate-smart production technologies, enhanced entrepreneurial support along with investment in post-harvest facilities, logistics, and improved compliance with manufacturing and food safety and quality standards Component 4: Project Management and Coordination The Project Management and Coordination will be set up in the BFAR will be responsible for the everyday activity for this program. It will also coordinate with various implementing agencies and NGOs, and liaise with the funding agency. There will also be an establishment of Project Implementation Units (PIU) at the Regional Fisheries Office that will oversee and be responsible in the field implementation of the activities. As the contribution of the recipient communities and LGUs, FMA Units will be created to coordinate activities with the PMC and the PIU. As a result, the effective and sustainable implementation of the project will be sustained.</p>', 21, '2021-06-09 11:41:29', '2021-06-10 09:57:38'),
(10, 'The project will undertake desilting activities in brackishwater fishponds irrigation systems (rivers, creeks, major and secondary canals)with severe siltation which cannot provide the required water volume due to shallowness caused by erosion, including the desilting activities of organic waste deposited at the sea bottom within the mariculture areas.\r\n\r\nThe main purpose of the proposed project is to clean the aquaculture irrigation systems (rivers, creeks, primary and secondary canals) and clear the fish sewage or organic waste deposited in sea bottom within mariculture areas through the procurement of cleaning equipment.', 22, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(11, '<p>\"Component 3 of ABC is the establishment of Water Hyacinth Treatment and Composting Facility aims to adopt measures to address water pollution through gathering, treatment and processing of water hyacinth to compost. The agro-waste treatment facility is an integrated solution which is composed of high-speed equipment, concoction, and a mixture of proprietary biological inoculants and deodorizers designed to improve efficiencies in agro-wastes (water hyacinth) treatment and composting. Component 5 on the other hand is the engagement of community participation in sustainable resources management through the planting of 20,000 bamboo seedlings along the 16-km shoreline of Taguig lakeshore. \" \"Component 3 of this ABC aims to (1) introduce sustainable measures in reducing the volume of floating water hyacinth in Laguna lake; (2) establish a water hyacinth treatment facility to produce raw compost for rejuvenating shorelands; (3) provide an additional source of income for fisherfolks and communities; and (4) comply with local ordinances on waste management and cleaner environment. Component 5 aims to engage the participation of stakeholders in lake development and sustainable resources management through the planting of 20,000 high-yielding and virus-free bamboos alongside the 16-km lakeshore in Taguig to address soil erosion. \"</p>', 23, '2021-06-09 11:41:29', '2021-06-22 16:58:42'),
(12, '<p>This project contributes to address key aspects of the market forces that drive overfishing. The project will add to the transformation of the seafood market by mainstreaming sustainability in the value chain of important commodities platforms, and fisheries improvement projects (FIP), developing national capacities, and generating learning to be shared worldwide. The project will allocate GEF resources strategically to 1) engage major seafood buyers in the main world markets (EU, Japan, US) into responsible sourcing, providing tools to prepare and implement sustainable seafood sourcing policies, 2) adapt the concept of green commodities platforms in Costa Rica, Ecuador, Indonesia and Philippines to generate experience that could be used in other countries, 3) support stakeholders of these platforms to develop practical experience with fisheries improvement projects and upgrade existing tools for FIP implementation and monitoring, and 4) upgrade existing information platforms to facilitate access to reliable materials to value chain stakeholders in support of sound decision making, and capturing documenting and disseminating the learnings of the project. The project target fisheries include tuna fisheries in the Pacific Ocean, Mahi-mahi and large pelagic fish in the Eastern Pacific Ocean, Indonesian snapper, Octopus and blue swimming crab fisheries in Philippines. The project is an inter-regional intervention. Market engagement and knowledge management are global components. The sustainable marine commodities platforms and FIPs will be implemented, using a participatory approach in Costa Rica, Ecuador, Indonesia and Philippines.</p>', 24, '2021-06-09 11:41:29', '2021-06-10 15:06:24'),
(13, '<p>The project will address key issues that contribute to the high incidence of poverty among fishermen through the adoption of sustainable management of fishery and coastal resources in fishing communities and promote the engagement of fisherfolk in diversified livelihood activities to augment and diversify sources of income among fishing households in target communities. This aims for coastal communities be able to sustainably manage their fishery and coastal resources to generate livelihood benefits for the targeted households.</p>', 25, '2021-06-09 11:41:29', '2021-07-06 09:31:46'),
(14, '<p>One of the strategies and interventions of the Rice Roadmap is to raise productivity and competitiveness through accelerating the expansion of irrigation services. The objective is to generate irrigated rice areas to meet production targets by boosting investments in large-scale and small-scale irrigation projects (LSIPs and SSIPs), maximizing cost-effectiveness of irrigation spending, and raising the efficiency of existing irrigation systems. Irrigation is a major area of investment and is thus expected to contribute a substantial share of projected incremental production.</p>', 26, '2021-06-09 11:41:29', '2021-06-22 17:00:09'),
(15, 'Special Area for Agricultural Development (SAAD) which means \"promise\" in local dialect, which will be focusing on the poorest provinces of the Philippines. This program will focus on livelihood programs proven to be sure formula in addressing poverty in coastal communities. The program aims to increase the fisherfolk income and uplift their living conditions.\r\n\r\nThe project aims to improve household food security by increasing food production and increase income by providing appropriate fishery-based livelihood.', 27, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(16, '<p>The SDGCoco project is set to work with 500 smallholder coconut farmers in Regions IV-A and V of Luzon, focusing on the three pillars of sustainable development – environment, society, and economy. The project has five work packages (WP) in carrying out its objective:&nbsp;</p><p>- Work Package 1: Capacity Development for Farmers&nbsp;</p><p>- Work Package 2: Farm Upgrading for Enhanced Productivity</p><p>- Work Package 3: Enhance Sustainability of the Farming System through SAI-FSA standard</p><p>&nbsp;- Work Package 4: Strengthen Farmer Groups and Enhance Market Opportunities&nbsp;</p><p>- Work Package 5: Monitoring and Evaluation, Knowledge Management, and Communications</p>', 261, '2021-06-09 11:41:29', '2021-06-24 08:03:35'),
(17, '<p>Rehabilitation/ improvement of the existing post-harvest facilities of the Lucena Fish Port Complex. It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 114, '2021-06-09 11:41:29', '2021-06-10 14:01:41'),
(18, '<p>The Bureau of Fisheries and Aquatic Resources of the Department of Agriculture, through its National Fisheries Program implements different projects and programs that helps to improve the lives of the fisherfolks, prevent, deter and eliminate all forms of illegal, unregulated and unreported fishing and ensure the management and sustainability of fisheries resources. Its sub-programs include: A. Fisheries Development Program, which includes aquaculture (provision of fingerlings/broodstocks, cages, and seaweed propagules and farming implements); capture fisheries (provision of fiberglass boats and fishing gear and paraphernalia); post-harvest; and marketing development; B. Fisheries Regulatory and law Enforcement Program; C. Fisheries Extension Program, which includes extension, support, education and training services; establishment of technodemo farms; information support services; and stakeholders collaboration and partnership; D. Fisheries Policy Program</p>', 29, '2021-06-09 11:41:29', '2021-06-17 10:22:24'),
(19, '<p>These are services focused on the provision/facilitation of activities and services that support or promote the entry, sale, or consumption of agricultural and fishery products and by-products in domestic and international markets.</p>', 259, '2021-06-09 11:41:29', '2021-06-17 10:29:23'),
(20, '<p>These are services for providing training, information, advisory and other extension support services provided by the department, to improve the technical, business and social capabilities of farmers and fisherfolk and other clients along the value chain.</p>', 260, '2021-06-09 11:41:29', '2021-07-05 10:45:40'),
(21, '<p>Agricultural Enterprises Development for Food Sustainability Project, Bohol</p>', 248, '2021-06-09 11:41:29', '2021-06-24 09:43:32'),
(22, '<p>This Project will be conducted for 3 years to determine and evaluate the adaptability of the different local and Korean garlic cultivars to different weather conditions, to determine and evaluate the adaptability trials in technology demonstration farm in BPI-LBNCRDPSC, and to produce clean planting materials through the use of bulbil/propagals. The project aims to showcase feasibility of garlic production to other areas not previously utilized for garlic.to determine adaptability of local garlic and Korean cultivars to different weather conditions, to produce clean planting materials and to increase farmers income to at least 10 to 20%. Component 1- Capacity Building. Component 2 – Cultivation and multiplication of clean planting material using bulbil/propagals Component 3- Cultural Study: The effect of the application of microbial inoculants and organic compost in the growth and bulb development of garlic var. Ilocos white Component 4- (1) Communication and coordination of the BPI-LBNCRDPSC with the Regional Offices/LGUs of CALABARZON, BPI- BAGUIO ,Region 5 AND Region 6; (2) Showcasing of the Technology Demonstration Farms Component 5- Cost and Return Analysis OBJECTIVES To determine the adaptability of Philippine and Korean cultivars of garlic/bulbils to the different environmental conditions of the Philippines through year-round evaluation at technology demonstration farms of Bureau of Plant Industry – Los Baños National Crop Research, Development and Production Support Center (BPI-LBNCRDPSC). To produce disease-free planting materials; by using bulbils/propogals from Korea and the Philippines; To multiply bulbils for dissemination to identified cooperator in Laguna, Batangas BPI -La Granja (San Carlos, Negros occidental) in Region 6 and BPI-Baguio (Benguet). To establish technology demonstration area for farmer’s adoption; Component 2 To evaluate and determine the feasibility and economic viability of the production technologies through cost-benefit analysis; To produce and distribute disease-free planting materials, production guides and other IEC materials to farmers and other stakeholders. Component 1- Capacity Building. Component 2 – Cultivation and multiplication of clean planting material using bulbil/propagals Component 3- Cultural Study: The effect of the application of microbial inoculants and organic compost in the growth and bulb development of garlic var. Ilocos white Component 4- (1) Communication and coordination of the BPI-LBNCRDPSC with the Regional Offices/LGUs of CALABARZON, BPI- BAGUIO , AND Region 6; (2) Showcasing of the Technology Demonstration Farms Component 5- Cost and Return Analysis OBJECTIVES To determine the adaptability of Philippine and Korean cultivars of garlic/bulbils to the different environmental conditions of the Philippines through year-round evaluation at technology demonstration farms of Bureau of Plant Industry – Los Baños National Crop Research, Development and Production Support Center (BPI-LBNCRDPSC). To produce disease-free planting materials; by using bulbils/propogals from Korea and the Philippines; To multiply bulbils for dissemination to identified cooperator in Laguna, Batangas BPI -La Granja (San Carlos, Negros occidental) in Region 6 and BPI-Baguio (Benguet). To establish technology demonstration area for farmer’s adoption; Component 2 To evaluate and determine the feasibility and economic viability of the production technologies through cost-benefit analysis; To produce and distribute disease-free planting materials, production guides and other IEC materials to farmers and other stakeholders.</p>', 30, '2021-06-09 11:41:29', '2021-06-25 15:27:44'),
(23, 'The Department of Agriculture is one of the core National Government Agencies in Halal Industry Development Program as stipulated on the Republic Act 10817 \"Philippine Halal Export Development and Promotion Act\". the following sections are stated on the said law, below are the following:  \r\n1. Section 10, Philippine National Standards for Halal - The DA- BAFS will play a vital role in primary and post-harvest foods standards; 2. Section 12, Export Promotion - The DA is one of the agencies that will support the DTI on the enhancement of the exports promotion;  3. Section 13, Infrastructure Support and Incentives - The DA also mandated to enhance the growth of Halal industries and assist farmers and producers in complying with the relevant standards on halal, the government DA also mandated to provide and/or upgrade necessary common facilities such as slaughterhouses, warehouses, refrigeration facilities and laboratories and equipment, in strategic production, processing and manufacting areas. 4. Section 14, Institutional and Human Resource Development - the DA will also a part on the development of Human Resource for farmers and fisherfolks such as Capacity Building, Skills training, scholarship program and the likes.  5. Section 15, Research, Development and Extension (RDE) -  The DA also assigned on the development on formulation and implementation of the Researches and Extension program.', 274, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(24, '<p>The project was conducted to showcase the management strategies of mungbean using Borax (Solubor borax) as foliar fertilizer. It was applied to National Seed Industry Council (NSIC) varieties, mainly NSIC Mg 18, NSIC Mg 14, and NSIC Mg 19) and traditional variety (farmer’s variety that varies from each area). The varieties subjected to borax application was sprayed three times (vegetative stage, prior to flowering, and flowering to pod formation stage) with two weeks interval, three days after its planting. The project was conducted in three agencies; Bureau of Plant Industry – Los Baños National Crop Research Development, and Production Support Center (BPI-LBNCRDPSC), Department of Agriculture – Central Luzon Integrated Agricultural Research Center (DA-CLIARC), and Bureau of Plant Industry – La Granja National Crop Research Development, and Production Support Center (BPI-LGNCRDPSC). The NSIC and farmer\'s mungbean varieties were showcased in techno demo areas and field day was set up to identify the preferred variety per location using identified questionnaires. The identidied preferred varieties were then seed produced and multiplied for distribution to interested stakeholders. The project aims to showcase mungbean production technologies through technology demonstration and adaptability to increase farmers productivity. 150 Farmer’s education (No. of Person) 700 kgs Seed production for distribution 500 kgs of Seed distribution 5% Farmers income increase</p>', 32, '2021-06-09 11:41:29', '2021-06-25 16:02:54'),
(25, 'The project which will involve dairy herd build-up and establishment of milk processing centers. Through these herd build-up strategies, the existing underutilized government stock farms will be able to house more dairy animals. Also, more stock farms will be established to accommodate more dairy animals. Latest technology in animal breeding and milk collection will be made available in these farms/centers. \r\n\r\nThe project moves along the programs of rural industrialization and industry dispersal as provided for in Republic Act 8435, also known as the Agriculture and Fisheries Modernization Act (AFMA). The establishment of milk processing centers and engagement in dairy farming will give opportunities for employment to residents in rural areas near the centers and farms and will reduce propensity to migrate to urban areas.\r\n\r\nThe project aims to contribute in the dairy industry development in the country, specifically:\r\n  - Contribute 95% of the national milk target (or 40% of the milk deficiency3) through sustainable production and processing of 125 tons of local milk daily by increasing the number of dairy animals by at least one (1) boatload (1,200 head) every year through importation and upgrade of local dairy cattle;\r\n  - To create livelihood and employment opportunities in accordance to the rural industrialization and dispersal programs provided for in the AFMA.', 268, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(26, '<p>Solar Power System Design and Development for Milk Collection Centers and Milking Parlors A. Milk Collection Centers - Five (5) existing milk collection centers owned by different cooperatives collecting at least 5,000 liters of milk per day will be selected. - A solar power system will be developed to power each of the five (5) selected collection centers based on an 80 kilowatt consumption of the center per day. B. Milking Parlors - Five (5) existing dairy farms owned by different cooperatives with at least 50 heads on the milk line shall be selected. - A solar power system will be developed to power each of the five (5) selected collection centers based on a 40 kilowatt consumption of the milking parlor per day. In both units, France will tap the services of a solar power company to design, install and maintain the said solar power generator. To pay for the maintenance of the solar power system, the recipients shall pay corresponding fees to the NDA for maintenance cost of the system. It is projected that with the solar power, the cooperative shall pay at a lower cost per/kwh used for the corresponding amount of energy using electric power.</p>', 269, '2021-06-09 11:41:29', '2021-06-24 14:47:06'),
(27, '<p>The project is funded by the Asian Food and Agriculture Cooperation Initiative (AFACI), wherein Philippines is one of the member countries. It includes the disease resistance evaluation trial of tomato breeding lines from the World Vegetable Center. Also included in the trials are breeding lines from different research institutions in the Philippines. Moreover, NSIC-approved varieties were also included in the trial for comparison and assessment towards disease resistance. Also part of the project is characterization of all breeding lines.</p>', 35, '2021-06-09 11:41:29', '2021-06-23 15:35:05'),
(28, '<p>A. Installation of Remote Microscopy System in selected NPQSD Stations Six (6) sets of Remote Microscopy System (RMS) will be installed to six (6) NPQSD stations in Pampanga, South Harbor Port, Batangas, Cebu, Cagayan De Oro and Davao. RMS will be used for identification of insect pests intercepted during routine inspection. Initial identification will be carried out by PQ officers and through the aid of remote imaging system, local and international entomology experts will be tapped/engaged to confirm initial identification or to provide technical assistance for a more reliable and accurate identification of the specimen. This may be done real time or through use of software to capture and store the information. This technology is vital for biosecurity purposes in terms of the applicable management and containment of biosecurity risks associated with the incoming plant commodities. B. Capacity Building of PQ officers on the Use of Remote Microscopy System and Identification of Insect Pest Two (2) participants from each identified six (6) Plant Quarantine Stations and Plant Quarantine Officers from the Central Office and Post Entry Quarantine Station, a total of (20) PQ personnel, will be trained for Remote Microscopy System and Insect Pest Identification. The training will be conducted in Manila with experts coming from Korea and PH Plant Quarantine personnel trained in Korea, will serve as trainors. This will be a five-day training wherein first day will be devoted on Public Investment Program 2017-2022 &amp; Three-Year Rolling Infrastructure Program 2022-2024 2 the familiarization and use of RMS. Second day onwards will be utilized on insect pest identification depending on the program which Korean experts will provide. This is applicable to the initial training that would be conducted. The three (3) succeeding trainings would depend on the insect groups that will be identified later. Same number of participants would attend the said trainings. General Objective: 1. To strengthen the capability of the National Plant Quarantine Services Division (NPQSD) on efficient approach for insect pest identification Specific Objectives: 1. To equip six (6) NPQSD stations with remote microscopy system for monitoring and identification of insect pests of regulatory significance. 2. To enhance capacity and increase capability of 20 PQ personnel on the identification of insect pest of regulatory significance.</p>', 36, '2021-06-09 11:41:29', '2021-06-22 15:13:45'),
(29, 'The project will support the government’s NAP Ag and long-term sectoral national agriculture and fisheries modernization and industrialization plan (NAFMIP), providing a systemic approach to climate change adaptation (CCA) in agriculture for the entire country, from national, regional to local.  In terms of direction action in supporting farmers, the project will be focused in at least 9 provinces that have been identified as the most vulnerable climate change hot spots, based on climate change projections. The project aims to increase the resilience of rural men and women in agriculture areas vulnerable to climate change, through their effective use of improved climate information services, knowledge and practices to adapt to climate change in agriculture.', 270, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(30, '<p>The project/ structure to be established at the Davao Regional Government Center as part of the Development plan will significantly contribute in strengthening the R and D activities, production of high planting material and conservation of diseased free foundation stocks of fruit trees , vegetables and other crops.</p>', 39, '2021-06-09 11:41:29', '2021-06-22 14:29:08'),
(31, '<p>The project/ structure to be established at the Davao regional Government Center as part of the development plan will serve as a showcase of organically produced different fruits and vegetables which will serve as food banks of fresh, healthy and nutritious food readily available for consumption and distribution and for R and D purposes</p>', 40, '2021-06-09 11:41:29', '2021-06-22 15:28:02'),
(32, '<p>The leasing of vessel shall be part of an initiative to enhance the preventive and deterrent approach of the current MCS program. Aside from providing the Bureau with an accurate and effective monitoring, efficiency, productivity and surveillance activities of the fishing vessels, this will also allow the transmission of catch report and effort data from the fishing vessel to a monitoring agency in near real time. In acquiring responsive and well-capacitated floating assets will improve the current mechanism of the Bureau in battling against illegal, unreported, and unregulated fishing (IUUF). Advancement in line with the monitoring and surveillance of the vessels will provide beneficial means to the Bureau in giving actual output in the state of the Philippine waters. Processes such as data gathering, mapping, and other relevant activity being conducted by the BFAR will be monitored and catered by using another floating asset that is capable.</p>', 271, '2021-06-09 11:41:29', '2021-06-10 13:20:39'),
(33, '<p>The activity involves the formulation of Philippine National Standards for primary and post-harvest agriculture and fishery products, and agri-fishery machineries, tools and equipments.</p>', 272, '2021-06-09 11:41:29', '2021-06-23 09:51:47'),
(34, '<p>The project intends to establish Solar-Powered Fertigation System (SPFS) nationwide to dramatically increase crop yields while significantly cutting farmers\' costs. The project involves the installation/construction of two types of SPFS, namely, SPFS-8 and SPFS-32 which can irrigate/fertigate a land area of 8 and 32 hectares, respectively. The proposed Project aims to: a. Increase income of farmer beneficiaries through the establishment of Solar-Powered Fertigation Systems (SPFS); b. Increase productivity of rainfed areas and shallow tube well (STW)-serviced production areas; c. Minimize seasonal yield fluctuations through the stabilization of production volume at five to five and half metric tons (MT) per hectare every cropping season; d. Reduce production cost for farmers; and, e. Reduce greenhouse gas (GHG) emissions of agricultural production.</p>', 44, '2021-06-09 11:41:29', '2021-06-22 17:07:13'),
(36, '<p>The agency conducts research and development programs, activities and projects (PAPs) to develop and/or adapt mechanization and postharvest technologies and processes expected to improve production, reduce quantitative and qualitative losses, with the ultimate goal of contributing to increased productivity and profitability for farmers and industry stakeholders. Science- and needs-based researches underpin the generation, development and commercialization of agriculture and fisheries mechanization and postharvest technologies and other interventions To design and develop technologies that will address mechanization and postharvest technology needs of the farmers and other stakeholders in the agriculture sector</p>', 46, '2021-06-09 11:41:29', '2021-06-22 17:06:27'),
(37, '<p>An interactive, flexible, and adaptable computer based information system on level of mechanization, suitability and sufficiency analysis that utilizes decision rules, models, and model based coupled with comprehensive database that can help decision makers use data and models to solve structured, unstructured or semi-structured problems and help planners, project implementer, and decision-makers at the national and sub-national level come up with well informed decision in positioning mechanization interventions. Develop a useful and sustainable decision support system that can be used by planners and decision makers at national and sub-national levels to support the agriculture and fisheries mechanization</p>', 47, '2021-06-09 11:41:29', '2021-06-22 17:08:04'),
(38, '<p>The PHilMech Agricultural Mechanization Design and Prototyping Center will be established where its capability to develop good quality agricultural machineries to be manufactured by local agricultural machinery manufacturers and the capability of local manufacturers to manufacture good quality agricultural machineries will be enhanced. To accelerate the mechanization of Philippine agriculture and provide men and women farmers and farmers’ organizations better access to good quality locally manufactured agricultural machineries in order to increase farm productivity and income and reduce postharvest losses through the enhancement of local capability to develop and manufacture agricultural machineries with the establishment of Agricultural Mechanization Design and Prototyping Center (AMDPC).</p>', 48, '2021-06-09 11:41:29', '2021-06-22 17:08:55'),
(39, 'Achieving significant increase in milk sufficiency levels, reduce malnutrition and provide employment opportunities for rural families through modern smart dairy farming technologies. The Project will  establish a smart and climate resilient dairy cattle farm and processing center in Isabela in support to the 2020-2025 Dairy Roadmap; establish a Philippine Tropical Dairy Institute (Philippine-Korean Tropical Dairy Cattle, Training, Research, Extension, Entrepreneurship and Biotechnology Academy), for the efficient utilization of Dairy Biotechnologies, Pasture and Corn Silage Technologies, and Business Innovation and Incubation Concepts in ASEAN; and will also provide support to the proposed National Dairy Cattle Breeding and Artificial Insemination Center in Isabela State University in Echague, Isabela for the production of local straws of frozen semen with a 90% female specific performance using the sexed-semen and fixed time artificial insemination technology', 199, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(40, 'To establish an agricultural technology research and demonstration center focus on Hybrid Rice breeding technology to realize rice sufficiency of the Philippine, with three major breeding focuses, namely: super hybrid rice, pest-resistant and high grain quality rice hybrids and technology demonstration with capability training on AxR  seed production utilizing the six hybrid rice varieties, namely: P8, P9, P12, M38, LP937 (M78) and LP 331 to major hybrid rice producing provinces/regions: Ilocos Norte, Central Luzon, Oriental Mindoro and Davao Oriental', 198, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(41, '<p>Level of mechanization of the Philippines continues to lag behind its Asian neighbors. Having a sound estimate of the level of mechanization allows the government to better plan for its interventions, resulting in better allocation and utilization of resources. As a commitment to the PDP 2017-2022 per agreement during the Mid-term Updating, PHilMech is expected to update the current level of mechanization for rice, corn and other crops on a regular basis which starts 2020 onwards</p>', 50, '2021-06-09 11:41:29', '2021-06-22 17:10:11'),
(42, '<p>The PHilMech implements aggressive Extension Support, Education and Training Services for the promotion of appropriate and improved technologies among the various intermediaries, end-users and other stakeholders. Specifically the agency undertakes technology transfer, training and extension of research results to primarily, the intermediaries, e.g. RFOs, LGUs, as well as direct beneficiaries/clients on a limited basis and other stakeholders (manufacturers, policy makers, etc.) of the industry. To extend and commercialize the technologies developed through R&amp;D to address mechanization and postharvest technology needs of the farmers and other stakeholders in the agriculture sector</p>', 51, '2021-06-09 11:41:29', '2021-06-22 17:11:10'),
(43, '<p>The Buri Development Project aim to improved the lives of buri farmers and other stakeholders involved in raffia and buntal industry. It shall establish processing centers, buri plantation expansion and strengthening the capability of farmers in terms of production, processing and marketing.</p>', 52, '2021-06-09 11:41:29', '2021-06-22 17:12:23'),
(44, 'The cotton development project primary purpose is to revitalize the local cotton industry. It aims to supply the requirement for raw materials of local weavers and textile industry. The project shall establish processing centers, ginning and spinning facilities, and cotton plantation expansion particularly in Regions I, IV, VI, VII, IX, and XII. Livelihood and technology trainings shall also be conducted to enhance the capability of our farmers, technicians, weavers and other stakeholders of the industry. Clustering of farmers/weavers into cooperative is one of the strategy to be implemented for a sustainable cotton industry that will uplift the lives of the targeted beneficiaries.', 53, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(45, '<p>The project aims to enhance the economic opportunity on pineapple (red spanish variety) fiber production as high quality materials for weaving and textile. The project components are: 1) establishment of processing centers, 2) expansion of red spanish variety pineapple, 3) provision of trainings and other technical assistance; 4) establishment of nurseries, 5) establishment of extraction facility and 6) marketing assistance.</p>', 54, '2021-06-09 11:41:29', '2021-09-01 13:13:13'),
(46, 'The abaca development project general objective is to sustain the Philippines present status as No. 1 producer and supplier of abaca fiber and manufactures worldwide. Its specific objectives are: to increase the supply of quality abaca fiber to meet the current supply deficit of abaca fiber; to empower abaca farmers through corporative approach by clustering abaca farmers into cooperative; to control the abaca diseases infestation; to improve abaca variety resistant to abaca diseases and high yielding; develop value adding technology, and others. The projects component are: expansion and rehabilitation of abaca areas; disease management; provision of planting materials; provision of technology and livelihood trainings.', 55, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(48, '<p>FMR projects include the construction and upgrading/improvement of existing farm-to-market roads located within key production areas, marginal lands or new lands under convergence initiatives which link these areas to higher road class systems; primary assembly areas and major markets/trading posts, fishlanding sites, fishing ports, fishpond/fishcage areas and mariculture zones, post- harvest facilities and processing zones/industries.</p>', 57, '2021-06-09 11:41:29', '2021-06-25 15:42:09'),
(49, '<p>High Value Crops Development Program (HVCDP) is in line with the Republic Act 7900 (High Value Crops Development Act of 1995). This is an act to promote the production, processing, marketing and distribution of high value crops. HVCDP is a priority program of the Department of Agriculture created to help address food security, poverty alleviation and sustainable growth through increased farm income and productivity. The target service areas include convergence areas, strategic production zones and farm households. These areas need the interventions from the government in terms of production, extension, processing, marketing and regulatory support. The program is implemented yearly with a coverage of implementation down to barangay levels. The budgetary allocation for the implementation of PAP for the HVCDP is taken from the GAA with a cost sharing arrangement scheme. A specific guidelines in the PAPs implementation is being followed by the DA RFUs together with partner implementers. Components of the Program include: i. Production Support Services (PSS); ii. Market Development Services (MDS); iii. Extension Support, Education and Training Support Services (ESETS); iv. Research and Development (R&amp;D) for the National High Value Crops Program; v. Irrigation Network Planning and Contract Management Services for the National High Value Crops Program; and vi. Provision of Agricultural Equipment and Facilities (PAEF) for the National High Value Crops Program. The objectives of the project/programs are as follow: - Delivery of appropriate development support services - Facilitate and harmonize development interventions in the strategic production areas/zones - Facilitate and promote access to local and international market - Proactive management actions on demand and supply situation The Thrusts and Priorities include: - Advancement of efficiency level of farm operation and management - Enhance productivity and production of priority commodities - Advancement of efficiency level of farm operation and management - Compliance with export protocol and product standards - Support for the processing and value adding of high value crops - High value crops linked to local and international markets - Steady supply and prices of priority commodities - Promotion of food security in schools and communities by introducing the values of basic food production Strategic Directions: - Provide quality planting materials for priority commodities to enhance productivity and production - Improve commodity competitiveness in order to reduce importation of various vegetables - Employ value chain analysis approach as tool for value adding and product development - Productivity enhancement through the conduct of technology demonstration on the proper management of old trees (rejuvenation and rehabilitation program) - Establish production facilities and postharvest equipment and machineries - Establish school gardens and household gardens as source of vegetables for consumption and marketing - Support the full utilization of local and traditional crop species with net potential - Research, development and extension services - Coordinate and support to food safety and consumerâ€™s welfare - Build stronger coordination and partnership with LGUs, POs and stakeholders</p>', 58, '2021-06-09 11:41:29', '2021-07-13 15:26:51'),
(50, '<p>The project involves the rehabilitation of fruit bearing trees less than 50 years old oconut trees, with relatively high chances of increased commercial value of production, thru the application of appropriate inorganic fertilizers.</p>', 59, '2021-06-09 11:41:29', '2021-06-25 08:42:54'),
(51, 'The general objective of the project is to contribute to the attainment of more durable peace and development and inclusive growth in conflict-affected areas in Mindanao, through support to the restoration of agri-based livelihoods , and accelerated agriculture-based enterprises.\r\n\r\nThe specific objective is to improve agriculture-based livelihoods of smallholder farmers, increase their productivity, improve food security and nutrition through the provision of agricultural inputs, appropriate training and technical assistance on improved agricultural and diversified farming system.', 256, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(52, '<p>The Coconut Hybridization Project aims to sustain and expand the operations of five (5) PCA-managed seed gardens and to mass produce high quality coconut hybrids for distribution to farmers and industry stakeholders through the Accelerated Planting and Replanting Project (ACPRP). Hybrids have the potential to produce 4-6 tons copra/ha/year and are found to be very good for the production of high value products like coconut sap sugar, virgin coconut oil, young tender coconut and fiber.</p>', 60, '2021-06-09 11:41:29', '2021-06-25 08:26:38');
INSERT INTO `project_descriptions` (`id`, `description`, `project_id`, `created_at`, `updated_at`) VALUES
(53, '<p>The project is implemented to enhance potential sources and supply of good quality seednuts and seedlings to be made available for coconut planting and replanting.</p>', 61, '2021-06-09 11:41:29', '2021-06-22 15:56:06'),
(54, '<p>Development of other natural fibercrops should be sustained. In support to the environment concerns of the whole world, natural fibercrops and some are endemic to us. Considering the green economy, the first world countries are now making it the priority in addressing the environment concerns. Having our endemic natural fibers would be an opportunity to boost our economy by promoting biodegradable products.</p><p>This project will benefit primarily the farmers of other fibercrop for their sustainable source of income.</p>', 263, '2021-06-09 11:41:29', '2021-06-24 09:52:26'),
(55, '<p>The Accelerated Coconut Planting and Replanting Project (ACPRP) involves planting and/or replanting of good quality coconut seedlings either Open-Pollinated Variety (OPV) Tall or Dwarf to replace senile coconut trees or those that were totally destroyed by typhoons or other natural calamities. The ACPRP has three components, viz: Participatory Coconut Planting Project (PCPP), Coconut Seedling Dispersal Project (CSDP) and Indigenous People Outreach Program (IPOP). The PCPP is a participatory and incentive-based systems approach to encourage coconut farmers and would be coconut farmers to plant more coconut trees. Each participating farmer was provided cash incentive of 40.00 per transplanted and duly stabilized seedlings. CSDP involves negotiated procurement of seedlings including nursery operations through the participation of local communities for project sustainability. The IPOP prioritize beneficiaries from the Indigenous Peoples and minority groups in the country.</p>', 62, '2021-06-09 11:41:29', '2021-06-22 16:15:01'),
(56, '<p>The project seeks to promote and institutionalize coconut-based enterprises through an integrated resource-service convergence approach to increase farm productivity and incomes of the small coconut farming communities. Components: 1. Coconut Intercropping Project (Crop Diversification) - the project seeks to promote and institutionalize coconut-based enterprises through an integrated resource-service convergence approach to increase farm productivity and incomes of the small coconut farming communities. This involves planting of high-value crops such as cacao, coffee, banana, corn, pineapple, and vegetables, among others in between spaces under the coconut trees. This is expected to generate additional income for the coconut farmers. 2. Coconut Intercropping Project (Animal Integration and Dispersal) - Livestock raising and poultry farming under coconut is also encouraged to augment the income of the coconut farmers and to enhance the nutrition of the coconut farming households. The Authority will work with the Bureau of Animal Industry to improve animal selection and distribution to project beneficiaries.</p>', 63, '2021-06-09 11:41:29', '2021-06-21 20:48:42'),
(57, '<p>PCA has sought the help of FAO to provide technical assistance (through a TCP) on crop diversification and pest and disease management through Climate Resilient Coconut based-Farming Systems (CR-CBFS) including Integrated Pest Management (IPM) through Climate Resilient Farmer Field School (CR-FFS) to address low productivity of coconut farms due to natural hazards including pest and diseases. FAO has the technical expertise and experience in implementing diversified coconut-based farming systems with climate smart agriculture and IPM under the National Coconut-based Farming Systems Programme under the Haiyan Response Programme (2014-2015) in Regions IV-B, VI, and VIII.</p>', 64, '2021-06-09 11:41:29', '2021-06-21 21:10:15'),
(58, '<p>The Smallholders Oil Palm Plantation Development Project aims to develop highly suitable idle lands into oil palm plantation and/or undertake replanting of existing oil palm plantation using high yield F1 hybrids to increase areas allotted to oil palm and improve the current oil palm populations. It also involves the identification of farmers with existing oil palm plantation especially those with outgrowership arrangement with the oil palm mills and providing them with appropriate fertilizers to rehabilitate the palm to increase production. Components: 1. Oil Palm Planting/Replanting - involves planting of oil palm in open and highly suitable areas and/or replanting of existing oil palm plantations using high yielding F1 hybrids along with the provision of fertilizer support for the first few months from planting. 2. Fertilizer Support - involves the provision of appropriate fertilizer to farmers with existing oil palm plantations particularly those with outgrowership arrangements with oil millers. The farms that should be covered by this project are those with oil palm trees aged 4-20 years old and the average production is below 10 MT Fresh Fruit Bunch (FFB) per hectare.</p>', 67, '2021-06-09 11:41:29', '2021-06-23 14:23:04'),
(59, 'Construction/Rehabilitation/Improvement of fish ports and other fishery post-harvest facilities across different sites within the country.', 262, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(60, 'Provides the overall support to the ICT requirements of the Department across all programs.', 265, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(61, '<p>The Fiber Industry Regulatory Program objectives are enforcement of quality standards and trade regulations set forth by PhilFIDA for abaca and other fibercrops. The componets of the project are: Quality Control and Inspection; and Licensing and Regulation.</p>', 69, '2021-06-09 11:41:29', '2021-06-22 17:22:27'),
(62, '<p>The project aims to increase the supply of salago fiber which is with high demand for pulp processors. Expansion of salago plantation will be established in Negros Oriental and Siquijor.</p>', 84, '2021-06-09 11:41:29', '2021-06-22 17:26:27'),
(63, '<p>The project aims to keep the PCA abreast with the advancement in the agricultural, industrial, and ICT sector through facilitating communication and information exchange in PCA and likewise provide information and other online services to PCA and its clientele.</p>', 70, '2021-06-09 11:41:29', '2021-06-24 07:34:54'),
(64, '<p>Coconut R &amp; D Subprogram generally aimed at establishing and implementing sustainable programs that will address issues and concerns of the industry on coconut production and productivity, pests and disease management, coconut products and by-products, and to provide support system to the PCA banner programs for the development of the industry.</p>', 71, '2021-06-09 11:41:29', '2021-06-25 15:18:29'),
(65, '<p>Establishment of facilities for genetic evaluation and selection as well as performance and progeny testing for cows and sires. The performance testing station will serve as an avenue to evaluate the performance of live animals as a result of breed development.</p>', 73, '2021-06-09 11:41:29', '2021-06-18 11:01:10'),
(66, '<p>[Also the Revitalized and Incentivized Carabao Herd Build Up]<br><br>The Dairy Herd Improvement Program (DHIP) is sometimes referred to as DHI, DHIA, or DHIR specifically for large animals. This valuable tool helps evaluate the progress of the herd’s milk production while addressing the improvement of the different production management system including breeding, health and nutrition. Through the DHIP, the breeding program of the carabaos at the local level will have a clear direction and its progress is measured over time to ensure that the animals are improving in terms of breeding performance. The DHIP is fairly inexpensive, useful and exciting activity that only requires constant monitoring and evaluation including documentation of activities. In addition, the dairy herd improvement (DHI) system has a played a critical role in the advancement of the dairy industry. Even today, it remains an important link in the industry. However, dairy industry changes, such as animal number decreases and shifts, dairy management advances, and on-farm economics, pose significant challenges to DHI. The nature of the dairy market, changing technology, and competitive pressures indicate the need for strategic planning and implementation among DHI participants, players and stakeholders. The project is expected to benefit some 150,000 dairy farmers and 200 organized groups.</p>', 74, '2021-06-09 11:41:29', '2021-06-23 15:11:41'),
(67, '<p>Establishment of the laboratory that will hasten breed development and improvement through the application of molecular genetics and other reproductive biotechniques. Also, a laboratory that will create milk and milk based products standards This facility will enhance the delivery of production support services to clients in the following: a) Breed Development - supports the long-term data collection and analysis that will enhance the selection of animals towards the development of the breed (dairy and/or meat) b) Genetic Traceability - will enhance the parentage identification of breeding stocks and will prevent in-breeding that leads to lower animal productivity c) Carabao Museum - to further educate the clients to the importance and contribution of carabao to the society d) Additional Milk Laboratories - will increase the number of samples tested in compliance to the implementation of the Food Safety Act.</p>', 75, '2021-06-09 11:41:29', '2021-06-25 08:09:17'),
(68, '<p>Establishment of IT-based Disease Surveillance System, Mobile Animal Diagnostic &amp; Screening Lab. The mobile laboratory equipped with technical instruments that can reach the clients.</p>', 76, '2021-06-09 11:41:29', '2021-06-18 09:24:58'),
(69, '<p>Establishment of a facility that will showcase/demonstrate the benefits of Halal Production System.</p>', 77, '2021-06-09 11:41:29', '2021-06-18 10:42:01'),
(70, '<p>Training for second liners in carabao-based enterprises across the value chain</p>', 78, '2021-06-09 11:41:29', '2021-06-21 15:15:08'),
(71, '<p>Intensification of the implementation of the CDP in Bicol Region that has 10.14% share of the carabao population. Intensification of the implementation of CDP is also needed in Isabela, Bicol Region, Cebu and Antique.</p>', 83, '2021-06-09 11:41:29', '2021-06-21 15:00:35'),
(72, '<p>The main components of the project are establishment of sisal processing center, sisal nurseries for the production and distribution of planting materials, expansion of sisal plantation, provision of technology and livelihood trainings. The main purpose of this project is to uplift the quality of life of our people in the countryside through increased productivity of sisal farmers and other stakeholders.</p>', 85, '2021-06-09 11:41:29', '2021-06-22 17:29:05'),
(73, '<p>The objective of the project is to increase the production of silk yarn as one of the important raw materials by the local weaving industry. This will increase the income of sericulture farmers particularly in Benguet, Nueva Vizcaya, Iloilo and Negros oriental. The construction of filature facility, rearing houses, expansion of mulberry plantation, livelihood training are some of the components of the project.</p>', 86, '2021-06-09 11:41:29', '2021-06-23 15:04:02'),
(75, '<p>The primary of objective of the project is to enhance the capability of research and development personnel, facilities and its operations. The components of the project are: to conduct agricultural, utilization and processing technologies researches; renovation of R and D facilities, upgrading of laboratory equipment; and strengthening the capacity of R and D personnel.</p>', 88, '2021-06-09 11:41:29', '2021-06-23 15:15:53'),
(76, '<p>The main objective of the project is the full mechanization of the fiber industry to improved production yield and increased fiber production. It shall provide post harvest equipment such as drying facilities, stripping and decorticating machines,, processing centers, harvesting tools and other facilities.</p>', 89, '2021-06-09 11:41:29', '2021-06-23 15:17:26'),
(77, '<p>The primary objective of the project is the establishment of more jute plantation in the country to supply raw materials for the production of jute sack with high demand in the local market. Its component are expansion of jute plantation and development of extraction machines.</p>', 92, '2021-06-09 11:41:29', '2021-06-23 15:18:11'),
(78, '<p>The project objective is revitalize the kozo industry in the country which is a very good source of fiber as raw material for pulp industry. The project shall expand the present kozo farm in Isabela, establish nursery and develop fiber extraction machines.</p>', 93, '2021-06-09 11:41:29', '2021-06-23 15:37:31'),
(79, '<p>The purpose of the project is to support the development of tikog industry in Samar through provision of livelihood training, establishment of processing centers.</p>', 94, '2021-06-09 11:41:29', '2021-06-23 15:43:48'),
(80, '<p>The production of bamboo pulp used for specialty handmade papers can provide livelihood opportunities to a group of rural dwellers in areas where there are abundant bamboo plants. Two man labor can already earn a profit margin of P15,032 monthly out of 2,160 handmade sheets. However, if extraction of fiber is done manually, this not may be attained. Thus, the objective of this project is to develop an extraction machine for bamboo fiber extraction. The project will assist three (3) cooperatives involved bamboo fiber production.</p>', 95, '2021-06-09 11:41:29', '2021-06-23 15:46:07'),
(82, '<p>Continue the promotion, propagation, and strengthening the organic agriculture sector in the Philippines towards a competitive, and sustainable organic industry able to participate in the national, regional, and international trade. Components of the program include: i. Production Support Services (PSS) for the promotion and development of Organic Agriculture; ii. Market Development Services (MDS) for the promotion and development of Organic Agriculture; iii. Extension Support, Education and Training Support Services (ESETS) for the promotion and development of Organic Agriculture; iv. Research and Development (R&amp;D) for the promotion and development of Organic Agriculture; v. Irrigation Network Planning and Contract Management Services for the promotion and development of Organic Agriculture; and vi. Provision of Agricultural Equipment and Facilities (PAEF) for the promotion and development of Organic Agriculture.</p>', 97, '2021-06-09 11:41:29', '2021-06-23 15:48:06'),
(83, '<p>In support to the thrust of President Duterte to increase food production and reduce poverty, the DA’s SAAD was conceptualized. It intends to contribute in alleviating poverty through increased food production and establishment of community enterprises in the target areas by providing the appropriate technology, marketing, and other support services in order to make the farmers and fisherfolk productive and profitable. Generally, the Program hopes to help alleviate poverty in the areas where it operates through the provision of agricultural and related interventions to the farming and fisheries sector. Specifically, it aims to: 1. Complement the DA regular programs in terms of beneficiaries and interventions; 2. Improve food production for household consumption and commercial purpose in areas of operation; and 3. Assist beneficiaries establish communal agricultural enterprises</p>', 98, '2021-06-09 11:41:29', '2021-06-23 15:50:07'),
(84, '<p>Employment of mechanized inputs into cultural management of cane farms through the distribution of farm equipment such as hauling trucks and high-powered tractors.</p>', 99, '2021-06-09 11:41:29', '2021-06-24 08:53:03'),
(85, '<p>Consolidation of small farms, including farms of agrarian reform beneficiaries, as one larger farm with a minimum area of thirty hectares within a two-kilometer radius in order to take advantage of the economies of scale</p>', 100, '2021-06-09 11:41:29', '2021-06-24 21:54:17'),
(86, '<p>Created and funded under the Sugarcane Industry Development Act (SIDA), the Bridge Construction and Repair program involves the construction/rehabilitation of bridges in various mill districts around the country. The program aims to connect sugarcane farms to processing facilities (mills, refineries, distilleries). The program is allocated Php 100 million per year. This program addresses issue of accessibility of the farms to postharvest and processing facilities. Bridges in the sugarcane areas can help reduce postharvest losses and production costs as well as help preserve the quality of canes by enabling their timely delivery to the processing facilities; thereby increasing farmer\'s income</p>', 101, '2021-06-09 11:41:29', '2021-06-24 14:31:58'),
(87, '<p>Construction/Rehabilitation of Farm-to-Mill Roads in Various Mill Districts</p>', 102, '2021-06-09 11:41:29', '2021-06-24 09:16:12'),
(88, '<p>The SRA, in coordination with state universities and government research and development institutions and the private sector, shall intensify researches on sugarcane high yielding or flood resistant varieties; pest control and prevention; latest farming, milling, refining and biomass co-generation technologies; soil analysis and fertility mapping of sugarcane areas; weather monitoring and climate change adaptation measures; sugar and sweetener consumption; and other viable products that can be derived from sugarcane. The program aims to strengthen and empower the research and development activities of the sugarcane industry.</p>', 103, '2021-06-09 11:41:29', '2021-06-25 14:27:49'),
(89, '<p>The scholarship program given to dependents of sugarcane industry farmers and workers is geared towards producing the necessary expertise in relevant fields of discipline that the SRA and the industry need for the attainment of its goals and targets under the sugarcane roadmap.</p>', 104, '2021-06-09 11:41:29', '2021-06-24 22:12:29'),
(90, '<p>Credit program for the sugarcane farmers for the acquisition of production inputs, farm machineries and implements necessary for the continuous production of sugarcane</p>', 105, '2021-06-09 11:41:29', '2021-06-24 22:03:28'),
(91, '<p>The Mindanao Inclusive Agricultural Development Project (MIADP) covers six (6) Regions in Mindanao including Bangsamoro Autonomous Region in Muslim Mindanao (BARMM) for the period FY 2021-2027 with an estimated project cost of PhP 6.8 Billion. MIADP intends to provide various agri.-fishery interventions appropriate for the Indigenous Cultural Communities/Indigenous Peoples (ICCs/IPs) in Mindanao. These interventions are geared towards improving the income of farmers and fisherfolk tailored to the Indigenous Knowledge System and Practices (IKSPs) in Mindanao Regions through the implementation of sustainable rural development strategies relative to poverty reduction program of the Government. Objective: The project aims to increase income of farmers and fisherfolk in the ICCs/IPs through the development of sustainable agri.-fishery-based economic activities. 1. To organize and strengthen the ICCs/IPs through capability building in planning, implementing and monitoring the interventions provided by the project. 2. To increase agricultural production of ICCs/IPs. 3. To increase volume of sales of targeted agri.-fishery commodities of participating ICCs/IPs. 4. To improve accessibility to transport agriculture and fishery-based products to the market. 5. To increase employment opportunities in the ICCs/IPs.</p>', 106, '2021-06-09 11:41:29', '2021-06-10 11:42:36'),
(92, '<p>The project will conserve globally important agro-biodiversity (of rice, mungbean, taro, yam, banana, Manila hemp and others) in traditional agro-ecosystems. It will have an agro-ecosystem and landscape perspective, maintaining the provision of ecosystem services on which ABD conservation depends, and addressing threats originating in the broader landscape. It will help ensure favorable policy conditions; consolidate community-based governance; strengthen technical and organizational capacities at individual and community levels; promote market-based incentives for ABD conservation; and create condition for further nationwide replication.</p>', 107, '2021-06-09 11:41:29', '2021-06-23 10:23:03'),
(93, '<p>1. Provision of capacity building to (i) small farmers and fisherfolk (SFF) (e.g., financial literacy, entrepreneurship, access to and management of loans and repayments), and (ii) SFF organizations (e.g., strategic planning, internal control systems, project identification and business planning, organizational and business management), geared towards strengthened participation in the value chain; 2. Conduct of policy studies and program/project monitoring and evaluation, advocacy and information campaign; and 3. Establishment of small farmer/fisher client database, and purchase of software/hardware requirement</p>', 108, '2021-06-09 11:41:29', '2021-07-08 10:20:33'),
(94, '<p>The Young Farmers Challenge Fund is a competitive financial grant assistance program for the youth who will engage in agri-fishery based enterprises. The Program will be open to all interested youth with proposed business ventures with profitability potential and generate income higher than skilled worker wage. The grants amounting to Php50,000 per qualified beneficiary, shall serve as startup and/or scaling up capital for the planned agri-based micro-enterprise. Projects (micro business ventures), owned and operated by an individual or as joint venture between two or more individuals.</p>', 273, '2021-06-09 11:41:29', '2021-06-25 19:12:32'),
(95, '<p>Credit for (i) production of crops, poultry, livestock and fisheries, (ii) finance requirements in rehabilitating farming, fishing, livelihood activities affected by calamities, etc. (iii) working capital requirements of trading, marketing, processing of agri-fisheries products, (iv) acquisition of machinery, equipment and/or facilities from production, harvesting to post harvest</p>', 109, '2021-06-09 11:41:29', '2021-06-25 09:37:03'),
(96, '<p>1. To provide insurance protection to farmer\'s and fisherfolk\'s farm investments and provide them with a risk management tool in view of the climate change phenomenon; and 2. To encourage the flow of rural credit, specially to non-collateral-owning small farmers and fisherfolk.</p>', 110, '2021-06-09 11:41:29', '2021-06-25 09:00:08'),
(97, '<p>The Project aims to help reduce poverty in selected highland barangays in the Cordillera within the Chico River Basin through the provision of Agri-Infra Support.The Project is a ADB-GOP funded Project with Financing Agreement signed last 13 March 2013 and will be completed by end of 2020. DA shall implement the US$10 million portion for the Cordillera for rural infrastructure. However, the LP cost was reduced to US$4.6 million by ADB and DENR.</p>', 111, '2021-06-09 11:41:29', '2021-06-23 09:17:19'),
(98, '<p>The Project aims to help reduce poverty in selected 18 highland poor barangays in the Cordillera. The Project is an IFAD-GOP funded with counterpart coming from LGUs for rural infrastructure subprojects.</p>', 112, '2021-06-09 11:41:29', '2021-06-23 09:18:09'),
(99, '<p>The livestock program is a continuing program of the department that would make food available and affordable; increase income of livestock farmers; increase resilience to climate change risks. Program objectives includes: increase production efficiency and productivity of livestock (meat, dairy &amp; draft) and poultry(meat, egg &amp; day old chicks); maintain disease free condition; increase export of livestock and poultry and their products; intensify support to research and development Components of the program include: i. Production Support Services (PSS); ii. Market Development Services (MDS); iii. Extension Support, Education and Training Support Services (ESETS); iv. Research and Development (R&amp;D); and v. Provision of Agricultural Equipment and Facilities (PAEF). Program objectives include: increase production efficiency and productivity of livestock (meat, dairy &amp; draft) and poultry(meat, egg &amp; day old chicks); maintain disease free condition; increase export of livestock and poultry and their products; intensify support to research and development.</p>', 113, '2021-06-09 11:41:29', '2021-07-05 10:39:46'),
(100, '<p>Rehabilitation/ improvement of the existing post-harvest facilities of the Davao Fish Port Complex. It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 115, '2021-06-09 11:41:29', '2021-06-10 13:58:14'),
(101, 'Rehabilitation/ improvement of the existing post-harvest facilities of the Iloilo Fish Port Complex. It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.', 116, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(102, '<p>Rehabilitation/ improvement of the existing post-harvest facilities in the Zamboanga Fish Port Complex (ZFPC). It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 117, '2021-06-09 11:41:29', '2021-06-10 14:15:20'),
(103, '<p>The Regional Fish Port project for the Greater Capital Region (formerly Upgrading/Rehabilitation of Navotas Fish Port Complex) include basic and functional port facilities such as landing quays, berthing and service piers, market and auction halls, gear sheds and boat repair. Fish port back-up area shall also be provided. Elevation of port’s road network system including drainage shall also be done. It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; allow integration of fishery and fishery-related facilities; and combat the rising tidal altitude in the area.</p>', 118, '2021-06-09 11:41:29', '2021-06-10 14:19:24'),
(104, '<p>Continue to perform NFA\'s role in ensuring food security by maintaining sufficient rice buffer stocks sourced solely from local farmers.</p>', 119, '2021-06-09 11:41:29', '2021-06-09 17:18:57'),
(105, '<p>Rehabilitation/Improvement of existing post-harvest facilities and construction of new facilities for the Camaligan Fish Port (CFP). It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 120, '2021-06-09 11:41:29', '2021-06-10 14:34:17'),
(106, '<p>Rehabilitation/Improvement of existing post-harvest facilities and construction of new facilities for the Sual Fish Port (SFP). It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 121, '2021-06-09 11:41:29', '2021-06-10 14:05:14'),
(107, '<p>Expansion and Improvement of existing post-harvest facilities and construction of new facilities for the General Santos Fish Port Complex (GSFPC). It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.</p>', 122, '2021-06-09 11:41:29', '2021-06-10 14:10:50'),
(108, '<p>Republic Act 11203 has created the Rice Competitiveness Enhancement Fund (RCEF) or “Rice Fund” for the purpose of improving the competitiveness of rice farmers and increasing their income amidst liberalization of the Philippine rice trade policy including, among other provisions, the lifting of quantitative restrictions on rice imports and replacing it with tariff. This creates the RCEF-Seed, Farm Mechanization, Extension, and Credit Programs which aim to complement and supplement the existing Department of Agriculture-National Rice Program (NRP). The RCEF has four key components: 1) rice farm mechanization; 2) inbred rice seed development, propagation, and promotion; 3) expanded rice credit assistance; and 4) rice extension services. These components shall be implemented in an integrated manner, consistent with the existing DA interventions.</p>', 123, '2021-06-09 11:41:29', '2021-06-09 19:42:43'),
(109, '<p>This project is the second phase where ROK and FAO has considered the Philippines as one of the recipient countries. Through the project, target countries will receive assistance to strengthen the capacities of experts, national research and training institutes in order to disseminate knowledge to local stakeholders such as famers, officers, and millers (with adequate participation of women), and exchange key technology that could be used in different stages of the rice value chain (i.e. rice cultivation, seed, mechanization, post-harvest), and ensure policy support between the Republic of Korea and target countries.</p>', 124, '2021-06-09 11:41:29', '2021-06-25 16:02:18'),
(110, '<p>Ensure that meat establishments are structurally and operationally conforming to standards set by the national government or international standard setting bodies to produce and distribute safe and quality meats; Local and international trading or marketing of meat are regulated.</p>', 125, '2021-06-09 11:41:29', '2021-06-25 16:04:56'),
(111, '<p>Ensure that meat establishments are structurally and operationally conforming to standards set by the national government or international standard setting bodies to produce and distribute safe and quality meats; Local and international trading or marketing of meat are regulated.</p>', 126, '2021-06-09 11:41:29', '2021-06-25 16:05:38'),
(112, '<p>Ensure the safety and quality of meat from all licensed meat establishments through in-line inspection, quality assurance audits, and laboratory tests for the protection and welfare of consumers.</p>', 127, '2021-06-09 11:41:29', '2021-06-25 16:06:21'),
(113, '<p>Ensure safety and quality of meat from all licensed meat establishments through in-line inspection, quality assurance audits, enforcement activities and deputation of LGU Meat Inspection Officers for the protection and welfare of consumers.</p>', 128, '2021-06-09 11:41:29', '2021-06-25 16:07:10'),
(115, '<p>With the current outbreak of the African Swine Fever (ASF), a transboundary animal disease that is highly threatening to the livestock industry and economy, strengthening the existing regulatory is imperative.A fully established Agricultural Commodity Examination Area (ACEA), its complementary integrated laboratory and crematorium as the facilities for the First Border Inspection will enable 100% thorough examination of all imported agricultural animal, plant, fisheries and aquatic resources products and by-products. The examination area aims to provide a temperature- controlled facility to enable inspection of all agricultural products in a subjected reefer van, observing food safety and biosecurity. The integrated laboratory complements the inspection with rapid testing of questionable or suspected commodity identified to be contaminated and or in violation with the national standards and regulations shall be subjected to proper disposal through the crematorium. The ACEA will be operated and manned by the Bureau of Animal Industry (BAI), Bureau of Fisheries and Aquatic Resources (BFAR), and Bureau of Plant Industry (BPI)</p>', 130, '2021-06-09 11:41:29', '2021-06-09 17:23:25'),
(117, '<p>After it was first reported in 2019, African Swine Fever (ASF) has devastated the swine industry in the highly swine dense provinces in Regions III and IVA, spread to nearby regions in North and South of Luzon, with an incursion in Region XI. The outbreak that started in Rizal, Bulacan and now in some parts of Luzon and Mindanao area continue to pose significant threat to the swine industry. To date a total of 250,000 hogs have been killed to abate the spread of the disease. There is no effective vaccine or treatment and outbreaks can be devastating with the most virulent forms and can be lethal in 100% of infected animals. With the ongoing disease situation, there is a need to augment and strengthen government capacity in disease monitoring and surveillance, quick response and disease control, laboratory testing, veterinary quarantine, information, education and communication of stakeholders for African Swine Fever. This progamme will be implemented with the development and execution of a National ASF Prevention and Control Programme with the following components: 1) Public Awareness 2) Disease Monitoring and Surveillance, and 3) Border Control and Movement Management. The programme also aims to support and guide Regional, Provincial and Local Government Unit counterparts by providing necessary technical support to overall efforts in respective localities, as well as operational and logistic support to local veterinary offices. There is also a great need to further enhance and equip the national and more so the 15 Regional Animal Disease Laboratories’ (RADDLs’) diagnostic capabilities for early disease detection and thereby preventing the occurrence or rapid spread in the country. Indirectly, the ASF testing services will be made available in the regions for the producers/raisers to submit samples for assay. Samples need not be sent to the ADDRL for testing. This way, results can be had the shortest possible time so that control measures be implemented outright. This strategy will aide in controlling the spread of the virus rather than waiting for the results and letting the virus spread further. In controlling the spread, the farmers can still save their animals and have them sold rather than having the pigs indemnified. This project aims to enhance activities on disease monitoring and surveillance, quick response and disease control, veterinary quarantine, information, education and communication of stakeholders for African Swine Fever through the implementation of a National ASF Prevention and Control Programme. To equip the 15 Regional Animal Disease Diagnostic Laboratories (RADDLs) and ADDRL (National Lab) in ASF disease diagnosis through training of diagnosticians on basic and advance PCR testing procedures, provision of new equipment, sufficient supplies and materials for early and rapid detection of the disease.</p>', 132, '2021-06-09 11:41:29', '2021-06-09 14:30:25'),
(118, '<p>The Bureau of Animal Industry, through Animal Facilities Regulations Section of the Animal Health and Welfare Division, is mandated by different laws, such as the Animal Welfare Act and the Food Safety Act, to register and inspect animal facilities before operation. This is to ensure animal welfare, disease prevention and control, among others. Currently, the AHWD has four different inspection systems for animal facilities, and has only registered approximately 3,000 animal facilities nationwide. The need to identify, register, and map animal facilities is ever growing, especially with the advent of disease outbreaks such as the Avian Influenza outbreak in 2017 and the African Swine Fever outbreak in 2019. There is also a growing clamor from the animal industry stakeholders for real time data in the number of animal facilities nationwide as well as increasing effort from the government to create database and systems for storage of these data to support creation of legislations. This project will seek to identify, register and map animal facilities in Region III and Region IVA, which are considered as areas with dense farms, as well as Region NCR which contains many clinics and hospitals. The project will therefore gather these data to be the baseline data for future projects and programs of the Bureau. This proposal aims for the following: • To survey animal facilities in Region III, Region IVA and NCR in collaboration with the different LGUs and DA Regional Field Offices; • To gather and create a baseline database of animal facilities in the selected regions that will be uploaded to the PhilAHIS system; and • To present a draft population map that could be used by decision makers as well as basis for future projects and programs of the Bureau.</p>', 133, '2021-06-09 11:41:29', '2021-06-09 17:20:07'),
(119, '<p>The Bureau of Animal Industry currently has four (4) different inspection systems for farms: the Animal Facility Registration as required under the Republic Act 8485 or the Animal Welfare Act, wherein all facilities are required to be registered; the Farm Accreditation as a requirement for transport, wherein all farms that would be transporting animals should be required a farm inspection and sample collection of animals to know the disease status of the farm and to facilitate safe transport of animals from one region to another; the Good Animal Husbandry Practices Certification Program, wherein farms are certified if they are in compliance with Food Safety Standards as required by the Department of Agriculture and therefore farms produces safe and quality food products; and the Breeder Farm accreditation, wherein farms are ensured to produce healthy and quality breeder animals. The current system has become burdensome not only for farmers but for implementers as it requires multiple farm visits that presents biosecurity risks and loss of time for inspectors. Also, the different inspection systems have overlapping and redundant requirements. The procedure for application is also burdensome for the applicants which require multiple visits to the implementers’ office. Database of the Bureau is also inadequate in the delivering of up to date data for the proper implementation of regulatory functions and services to the animal industry. This proposal consists of three solutions to address the current problem of the Bureau: • Harmonization of the different regulatory systems for farms of the Bureau of Animal Industry; • Creation of the farm online registration system; • Use of technological solutions (i.e. cameras, radio, computers) for the ease of registration and inspection of farms; This proposal aims for the following: • To better facilitate the regulation of farms in the country with streamlined and harmonized requirements; • To comply with the provisions of the Republic Act 11032 or the Ease of Doing Business and Efficient Government Service Delivery Act of 2018; • To adapt the ISO/IEC 17020 or the “General Criteria for the Operation of Various Type of Bodies Performing Inspection” in order to be up to par with international standards; • To ease the burden of application through the online registration system; and • To start the traceability system for animals as part of disease control and surveillance.</p>', 134, '2021-06-09 11:41:29', '2021-06-09 17:21:11'),
(122, '<p>B. Overall Objective This project aims to improvethe country’s capacity to control and prevent occurrence of animal diseases. SpecificObjectives The specific objectives of the project are the following: 1. To create and improve databases of the animal industry of the Philippines; 2. To upgrade animal related registrations and permitting into online systems; 3. To integrate data from different databases that will provide valuable information to decision makers and stakeholders; 4. To create enabling policies in the use of the PhilAHIS; and 5. To advancethe capability of the Philippine government on animal disease prevention, forecast, quarantine, control and post management. C. Major Components and Strategies 1. Improvement of the PhilAHIS Data Center infrastructure and equipment Thecurrent data warehousing facility of PhilAHIS has adequate functional capacity at this point to run the current version of the system. The proposed upgrade of the system, however, would need further improvement and modernization of thePhilAHIS Data Center’s infrastructure and equipment. This should increase its capacity in order to house all the information that will be gathered from the project collaborators, counterparts and end-users, and to accommodate data management and traceability objectives of the proposed project. The strategies proposed for this component are as follows: • Construction of an extension and renovation of the existing PhilAHIS building inside the BAI compound that will serve as the modernized Animal Data Center of the PhilAHIS. The facility shall include: o Server rooms with adequate servers installed to run the upgraded PhilAHIS; o Expanded office, living and storage space that will accommodate PhilAHIS staff and its additional functions; and o Improved centralized command center for emergency animal disease responses. • Procurement of adequate Information and Communication Technology (ICT) equipment and software and other related Information Technology (IT) components; and • Recruitment and hiring of technical and IT personnel. 2. System development and enhancement of PhilAHIS The project aims to upgrade the current PhilAHIS to be a developed and integrated information system for all animal related data in the Philippines. This is envisioned to result in the significant improvement the veterinary services in the country. It will also elevate quality of industry reporting and government services of the DA and its livestock agencies. The creation of databases, information systems, applications and other technological solutions are proposed to achieve this aim.A technical working group (TWG) will be established that will guide the project proponents in the concept design and development of the information systems. The name PhilAHIS will be retained for branding purposes, as this name has been known locally to all partner agencies and LGUs, including international partners such as OIE and the Food And Agriculture Organization(FAO) because of its use during the eradication program of FMD. This brand is also known to other ASEAN Member States (AMS). The development of the PhilAHIS will contain the following strategies: • Creation ofdatabasesand development of online systems in several regulations of the Animal Industry o Development of an online registration and application system of all animal facilities (e.g. farms), local animal transport vehicles, animal traders, meat establishments, meat transport vehicles and feed, drugs and biologics establishment; o Improvement, design enhancement and upgrading of system features of the local shipping permit issuance system and the certificate of meat inspection issuance system; and o Integration of all databases into a monitoring system of animal population, and movement of animals, animal products and by-products. • Upgrading of Disease Control and Surveillance information systems o Expansion and modification of the existing PhilAHIS Field Monitoring System (desktop and web application) that records services of LGU personnel to farmers; o Creation of an online animal disease reporting system through a web and mobile application for farmers, animal health workers, veterinarians, etc. that will facilitate ease of reporting and that will follow specific guidelines and protocols (e.g. all reports to be furnished to the BAI, DA Regional Field Offices (DA-RFO) and LGU); o Development of a Surveillance and Vaccination usage system that will incorporate all epidemiologic surveillance services of different animal health programs of the government; and o Inception of the Laboratory Information System that will provide results for all testing need doneby the government. • Improvement of Disease Response and Resolution capabilities of the government Improvement of the PhilAHIS system that shall integrate data from baseline databases and results from disease control and surveillance to: o Allow forecasting and risk analysis of disease outbreak; o Enable use of data analysis and data visualizations such as charts and maps; o Allow immediate communication from decision makers to ground personnel for disease response and quarantine measures; and o Allow real time notice to livestock industry of outbreaks through technical bulletins passed thru different mediums. • Expand and link PhilAHIS to other existing livestock information system from NMIS, PCC and NDA. • Mirroring of data to the DA ICTS Data Center 3. System Deployment The development of the upgraded PhilAHIS will be in close coordination with the TWG. Upon drafting the final system, the PhilAHIS team and the TWG shall conduct the pilot testing of the upgrade PhilAHIS with the following respective order: a. BAI and NMIS Central Offices; b. Selected DARFOs, PCC and NDA; and c. Selected PVOs, MVOs and CVOs. Once pilot testing conducted is successful, and upon the approval and support of the steering committee, the team will move to deploy the system to the end users in geographical clusters with the following respective order: a. North Luzon Cluster; b. South Luzon Cluster; c. Visayas Cluster; and d. Mindanao Cluster In a geographical cluster, the team will deploy the system and install all necessary equipment to all end users within the cluster, such as BAI – Veterinary Quarantine Offices, NMIS Regional Offices, DARFOs, and PVOs. The cluster deployment is strategized so as to minimize financial costs and time spent. A skeletal team will remain in the data center so as to resolve any issues relating to system deployment. After deployment, the team will conduct quarterly or biannual assessment, as determined necessary, of the success of the deployment and of the system. 4. Policy and Legislation Formulation The data collection and utility of the proposed PhilAHIS improvement will not be only for the BAI but with the different stakeholders of the livestock industry such as national government offices such as the DA and its attached agencies (e.g. NMIS, PCC, NDA, DA RFO), LGU (e.g. Provincial, City and Municipal Veterinary Offices), academe, and the private sector. Formulation of policies in support of the system will be created with strategies as follows: • Creation of a steering committee that will spearhead the implementation of the project; • Review of existing policies and legislations on the collection of data for the system; • Creation of policies and legislations to strengthen the use of PhilAHIS such as the assigning of rules and responsibilities on data collection to different government agencies and creation of respective technical working groups; and • Consultation, and awareness campaign with different stakeholders that will utilize the system. 5. Capacity Building The programming team of the project will be sent to Korea through this project in order to be trained on the best practices in the implementation of KAHIS for several months. This will be vital in the enhancement and expansion of the system in the Philippines through the PhilAHIS. Technical Veterinary team from the BAI and from collaborating agencies will be trained on disease prevention, forecast, quarantine, control and post-management in order to fully understand the KAHIS and to guide in the creation of the PhilAHIS. The animal industry stakeholders such as LGUs and the possible users of the system will be trained in the use of the system in order to fully input correct data into the database and to fully utilize the system in their respective areas of jurisdiction.</p>', 137, '2021-06-09 11:41:29', '2021-06-09 17:16:36'),
(123, '<p>Self-reliant LGUs that are able to implement the rules and regulations of NMIS pertaining to meat safety and hygiene and assist in the improvement of LGU meat facilities to comply with national standards in a co-sharing scheme</p>', 138, '2021-06-09 11:41:29', '2021-06-25 16:08:19'),
(124, '<p>The project’s overall objective is to increase access to agricultural technology for farmers in Western Visayas by introducing the ICT-based smart agriculture system anchored to the policies of new eight paradigms and the Agriculture, Forestry, and Fisheries (AFF) Sector in the Philippine Development Plan (PDP). Based on the program framework on smart agriculture suggested by KOICA, DA proposes emphasizing the smart agriculture model in Western Visayas by introducing relevant policies and strategies, strengthening the capacity to apply ICT-based agricultural technology, and stimulating the value chain with ICT solutions. This project will be regarded as a bridgehead of the agriculture sector in the Philippines to achieving the Sustainable Development Goals (SDGs) in its Goal 2 (Zero Hunger), Goal 8 (Decent Work and Economic Growth), and Goal 9 (Industry, Innovation, and Infrastructure)</p>', 139, '2021-06-09 11:41:29', '2021-06-25 16:16:14');
INSERT INTO `project_descriptions` (`id`, `description`, `project_id`, `created_at`, `updated_at`) VALUES
(126, '<p>This project is intended to address gaps related to laboratory biosafety and biosecurity identified during laboratory assessments (i.e.FAO-Laboratory Mapping Tool and OIE-PVS Evaluation)conducted by laboratory experts from international agencies. As product of trainings and assessments, there were recommendations that are critical in the implementation of biosafety and biosecurity in the national laboratories. In this project, the laboratories of the Veterinary Laboratory Division (VLD) premises and facilities will beimproved to mitigate the potential threat of intentional or unintentional introduction of pathogenic microorganisms and other hazardous implements to the environment, to the individuals working and availing the diagnostic services offered by the laboratories. The VLD is compose of five (5) laboratories; the Animal Disease Diagnosis and Reference Lab. (ADDRL), the Veterinary Biologics Assay Lab. (VBAL), the Veterinary Biologics Production Lab. (VBPL), the Chemical Feed Analysis Lab. (CFAL) and the Veterinary DrugProduction and Assay Lab. (VDPAL). The ADDRL is the national laboratory for animal disease diagnosis that serves as the model for the facilities in promotion and practice of biosafety to other laboratories complying to prescribed safety level standards. One that is acceptable with international counterparts with similar responsibilities that may translate to increased trust and confidence from its stakeholders. The VBAL, VBPL, CFAL and VDPAL are the laboratories responsible for the quality testing of imported/locally-produced vet. biologics, vet. biologics production, feed analysis and vet. drug production/assay respectively. At present, the laboratories have their own disposal processes that are not within the acceptable standards but are likewise amenable. There is no designated area for the Material Recovery Facility (MRF) which is mandated by law. There is only one crematorium donated by USDTRA still for repair but spare parts unavailable. Chemical wastes are neutralized and are poured into empty bottles and allowed to decay for sometime prior to disposal in the sewage. Howerver, for chemicals that cannot be neutralized are decanted in bottles and are placed in isolated areas prior to disposal by a third-party waste management service. Among the activities covered in this project are the installation of the liquid waste treatment, composting facilities for solid wastes and CCTV, procurement of laboratory storage cabinets, thermal and sterilization equipment and repair of various laboratory-associated fixtures. The laboratories are a probable source of disease-causing organisms that can harm the laboratory staff, clients, the whole community and livestock industries. The risk of intentional or unintentional release of infectious microorganisms to the environment are very high. Hazardous chemicals can also be released to the environment if not treated. It is the aim of this project to improve the laboratories’ capacity to mitigate or eliminate risks associated to laboratory biosafety and biosecurity. Within the year’s implementation, it hopes to secure the laboratories and protect our livestock industry and the general public from possible harm of contracting infectious diseases or inhalation of hazardous chemicals. With the facilities to be installed and measures implemented, the risks shall be minimized and assurance of a safe workplace is achieved. The measures adapted will be evidenced by less absences, less incidents of sickness among workers and most importantly safety practices within the laboratory workplaces is achieved.</p>', 141, '2021-06-09 11:41:29', '2021-06-09 19:24:40'),
(129, '<p>To be utilized in the procurment of palay and maintain the good quality of rice buffer stocks.</p>', 144, '2021-06-09 11:41:29', '2021-07-06 14:49:04'),
(130, '<p>Acquisition of additional rice mills to mill / convert palay stocks into rice</p>', 145, '2021-06-09 11:41:29', '2021-06-21 15:03:46'),
(133, 'This project has 2 components (1) infrastructure development and (2) strengthening the capacities of the Integrated laboratory Division (ILD)of the DA Regional Field Offices. These components are directed towards levelling up the laboratory services of the agriculture sector.  \r\n\r\nSpecifically, the Project aims to:\r\n1.	Ensure that laboratory facilities are efficient and capable of promptly responding to disease outbreak emergencies;\r\n2.	Strengthen and enhance the capability of laboratories in supporting agricultural productivity;\r\n3.	Ensure quality management system implementation in ILDs and their compliance with regulatory requirements for laboratory operation', 169, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(134, 'PRDP is a national government platform for a modern and climate-smart agriculture to be pursued through partnerships with local government units and agri-fishery stakeholders. It will take-off from the gains and lessons of various DA programs such as project tracking by geo-tagging and building capacity of LGUs and farming and fishing communities to manage and sustain agri-fishery support infrastructure and services, among others.\r\nThe Project will operationalize the national and regional Agriculture and Fishery Modernization Plans (AFMPs) through integration of plans at the provincial level. Also, the Project will be guided by the vulnerability and suitability assessment framework, which was initially used for the Central Philippines Rural Development Project (CPRDP) preparation. Also, it will develop value chain roadmaps that will serve as an input in the selection and prioritization of investments in the target areas.\r\n\r\nThe Project is aligned with the goals and priorities of the Philippine Development Plans (2011-2016) for a competitive and sustainable agriculture and fisheries sectors, will provide program-level support for the Agriculture and Fisheries Modernization Act of 1997 (RA 8435) and advances the principles of Agrikulturang Pinoy (AgriPinoy) of sustainable resource management, local development and full service delivery from farm to table.\r\n\r\nLocal Planning: this component aims to enhance the Agricultural and Fisheries Modernization Plan through science-based tools and to harmonize regional and provincial Agriculture and Fisheries Modernization Plan through the formulation of the Provincial Commodity Investment Plan using value chain approach.\r\n\r\nInfrastructure Development: this component aims to improve the links from production areas to markets to enhance the efficiency of transporting agricultural products. It also aims for higher productivity as a result of increased cropping intensity and yields, food security and improved health from readily available potable water and lower post harvest losses resulting in higher volume of outputs and more efficient support facilities.\r\n\r\nEnterprise Development: this component aims to engage broad sections of the sector in the production of marketable surplus through investments in strategic segments of priority commodity value chains and strengthening collaboration between DA and the Local Government Units. It shall strengthen and develop viable agri-fishery based enterprises through efficient value chain of key regional agri-fishery product.\r\n\r\nProject Support: this component aims to provide efficient and effective project management and implementation, establish a standard on services and technical assistance and effective mode of engagement with LGUs.', 149, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(135, 'The proposed expansion of the PRDP with additional financing from the World Bank is critical to maintain the institutional momentum for implementing the reforms and new ways of doing business under PRDP.  It is also vital to sustain the unprecedented level of LGU support that has come through the devolved partnership arrangements under the PRDP.  \r\n\r\nGiven the fast turnout for infrastructure investments, the proposal to avail of USD 450 Million additional loan proceeds from the World Bank will mainly to cater to the excess demand and the prospective proposals for rural infrastructures.\r\n\r\nInfrastructure Development -- this component aims to improve the links from production areas to markets to enhance the efficiency of transporting agricultural products. It also aims for higher productivity as a result of increased cropping intensity and yields, food security and improved health from readily available potable water and lower post harvest losses resulting in higher volume of outputs and more efficient support facilities.\r\n\r\n\r\nProject Support -- this component aims to provide efficient and effective project management and implementation, establish a standard on services and technical assistance and effective mode of engagement with LGUs.', 150, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(136, '<p>The general objective of the RCEF-Extension Program is to conduct strategic extension services the capability of Rice Fund beneficiaries in modern rice and seed production and other relevant skills for improved competitiveness and income. Specifically, the Program shall aim to: 1. Improve knowledge, attitudes, and skills of Rice Fund beneficiaries in producing more rice at reduced production cost through training programs, enterprise development assistance, and communication support services; 2. Increase access to modern, science-based farming techniques and other relevant skills by developing farm schools and strengthening their capacities on rice knowledge/technology transfer; and 3. Enable availment of training programs under the Rice Fund through a scholarship scheme.</p>', 151, '2021-06-09 11:41:29', '2021-06-11 12:00:55'),
(137, 'One of the strategies to promote local production of semen straws is the Establishment of the National Dairy Cattle Breeding and Artificial Insemination Center (NDCBAIC) in Isabela State University (ISU), Echague, Isabela. The Philippines has seen the effectiveness of such facility through the Bureau of Animal Industry’s National Artificial Breeding Center (BAI-NABC) located in Bukidnon. Since BAI NABC prioritizes in processing semen for beef production, it would be plausible to establish a center dedicated to dairy cattle. This proposal aims to replicate the success of the Bukidnon breeding center in Northern Luzon. This is in anticipation of the growing dairy industry in the country and the infusion of more dairy stocks. The establishment of NDCBAIC in ISU in Echangue, Isabela will be one of the breakthroughs in the strengthening of the implementation of the NDA’s breeding and upgrading programs in Luzon. \n\nThe cost to locally produce one straw of regular semen is cheaper at about P83.00 as compared to the cost of imported semen straws at about P750.00. At twice a week collection, the center will be able to produce some 49,920 semen straws annually costing about P4.14 million as compared to importing the same number which will amount to P37.44 million. \nISU is a very suitable host for the project since it has the following:\n• Existing Administration Building\n• Existing Bull Shed\n• Pasture/Forage Development Area\n• Showroom of Technologies and Products\n• Training and IEC Center\n\nAs the project will also serve as a training center for its undergraduate and graduate agricultural and veterinary students including dairy farmers, ISU will not only vital in breeding dairy animals but also in “breeding” the next generations of dairy technicians, dairy veterinarians and dairy farmers. \n\nHaving the project in ISU, NDA will strongly supports the bid of Echague LGU to become the Science and Ecological City of the North by 20222. Not far from the future, Echague could also be North Luzon’s Dairy City (Dairy Hub). NDCBAIC will surely enhance and enrich ISU’s mandates and functions along with its instruction, research, development, production and resources generation.\n \nOverall, the project is necessary to strengthen nation’s war against malnutrition and poverty mitigation by creating more livelihood and opportunities through modern dairy agriculture. The project will be instrumental in increasing the national milk output by 24% and growing the Philippines Dairy Cattle Herd by 31% while training 200 undergraduate and graduate agricultural and veterinary students and serving 2,056 dairy farmers annually.', 153, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(138, '<p>Construction and rehabilitation efforts for existing structures will enhance efficiency in designing and implementing PPAs of PHilMech, as well as ensure compliance to its IMS certification, specifically in the environment and health and safety management systems. As an example, concreting of the driveways will allow for better access to the different buildings and facilitate movement within the area. There will be proper connecting roads of appropriate width and thickness to accommodate bigger and heavier machinery and equipment, as well as to ensure smooth coming in and out of raw materials from the processing areas.On the other hand, the construction of a Material Recovery Facility, rehabilitation of electricals and drainage system, would ensure safety inside the PHilMech compound as well as in the vicinity.</p>', 154, '2021-06-09 11:41:29', '2021-06-23 15:54:06'),
(140, '<p>The PHilMech in collaboration with DA-RFOs, LGUs, ATI, TESDA will provide and deploy rice farm machinery and equipment to eligible farmers\' associations, registered rice cooperatives and LGUs, extension support, education and training services to the beneficiaries. 1. Make accessible to rice farmers the appropriate rice production and postharvest machinery and equipment through the farmer cooperatives, associations (FCA) 2. Promote among Filipino rice farmers the use of efficient and cost reducing rice mechanization interventions 3. Strengthen local agricultural machinery manufacturing industry through aggressive technology development, fabrication and manufacturing</p>', 156, '2021-06-09 11:41:29', '2021-06-23 16:04:41'),
(141, '<p>Due to its highly perishable characteristics, postharvest losses from fruits and vegetables are one of the highest source of losses incurred among agricultural crops. Postproduction loss assessment of selected fruits and vegetables was done in late 2009. Thus, measurement of abovementioned losses has to be updated and estimate new figures for other crops that will serve as baseline. As a commitment to the PDP 2017-2022 per agreement during the Mid-term Updating, PHilMech is expected to update and determine the magnitude of postharvest losses of selected fruits and vegetables on a regular basis which starts 2020 onwards.</p>', 157, '2021-06-09 11:41:29', '2021-06-23 17:40:03'),
(142, 'Rice Program consists of 6 components/activities:\r\n1. Production Support Services (PSS) - involves promoting and ensuring availability of modern, high yielding and climate resilient rice varieties in respect with the appropriate ecosystem/area of domain to improve productivity and sustainably boost local rice production. And, maintenance of seed buffer stocking intervention to enhance preparedness for rehabilitation due to disastrous climate change events;\r\n2. Market Development Services (MDS) - activities are Support to Market-related Activities, Product Development, Support to Export of Aromatic Rice/ Specialty Rice, Operationalization of One-Stop-Agribusiness Center (OSAC); \r\n3. Extension Support, Education and Training Support Services (ESETS) - capability building and information dissemination to Farmers and Agriculture Extension Workers;\r\n4. Research and Development (R&D) - for the development of rice technologies to increase productivity and reduce production costs;\r\n5. Irrigation Network Planning and Contract Management Services - distribution/ construction/ rehabilitation of small-scale irrigation projects (SSIPs) to primarily improve cropping intensity and productivity; and\r\n6. Provision of Agricultural Equipment and Facilities (PAEF) - provision of facility and farm machinery assistance to reduce postharvest losses and labor cost, and to increase farmers\' income and level of competitiveness.', 158, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(143, 'Corn Program consist of 6 components/activities:\r\n1. Production Support Services (PSS) - to ensure availability of quality seeds and planting materials that can be accessed by farmers, establishment of storage facilities of bufferstock to be used as storage facility of seeds to maintain quality and ensure its availability in times of calamities;\r\n2. Market Development Services (MDS) - facilitation of market matching activities to encourage marketing tie-ups and contract growing arrangements in the farm clusters;\r\n3. Extension Support, Education and Training Support Services (ESETS) - conduct of trainings and information dissemination that would empower farmers and extension workers; \r\n4. Research and Development (R&D) - conduct of researches on corn and cassava technologies through the Bureau of Agricultural Research (BAR) and DA-RFOs ;\r\n5. Irrigation Network Planning and Contract Management Services - provision of appropriate irrigation technology for corn production; and\r\n6. Provision of Agricultural Equipment and Facilities (PAEF) - provision of farm mechanization and postharvest machinery, equipment and facilities to corn and cassava farmers to increase productivity, competitiveness of local production and to minimize reduction from postharvest losses.', 159, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(144, 'PRRI is responsible for managing rubber plantation that needs a recent and up to date information of the plantation area and smallholders for more efficient and organized approach purposes particularly on rubber programs, research and development using Information Technology. The development of technologies to support decision making towards increased production of rubber stakeholders small, private owned, and medium is paramount important for the Philippine Rubber Research Institute (PRRI) for taking appropriate decision regarding production, pricing, good agricultural practices, market, pest and diseases management.	\r\n\r\nThis project aims to have a reliable source of rubber data in taking decision for government research, development and programs used by way of information technology using Philippine Rubber Information Management System.', 164, '2021-06-09 11:41:29', '2021-06-09 11:41:29'),
(145, 'The station aims to create awareness on agri-tourism and attract visitors, students, farmers, community members, LGU\'s and entrepreneurs on agri-ecotourism and availing of opportunities for the station to have an additional income through a sustainable eco friendly approach using the locally available resources. Through this facility, transfer of technology generated in the station will be hastened, thus improving the income of the clients through its adoption and utilization.\r\n\r\nProject Components:\r\nLand Development \r\nTourism Zone\r\nAgricultural Zone', 175, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(146, '<p>The facility will be used by Carabao Cassava Cluster in Abra de Ilog, Occidental Mindoro and Calategas Farmers Marketing Cooperative in Narra, Palawan, groups of beneficiaries for processing of cassava and corn into food grade starch intended for institutional market (e.g., Nestle Food Corporation). The project will address the problem in MiMaRoPa in terms of its post harvest losses and logistic cost, which highly contributed to the disadvantage of cassava and corn farmer-producers.</p>', 176, '2021-06-09 11:41:30', '2021-06-09 15:38:54'),
(147, 'Establishment of Smart Greenhouse to enhance production competitiveness of small and mid-sized farmers through Smart Greenhouse Technology for high-value added agri-product and mitigate the effect of climate change.  The project is a Grant aid from the Ministry of Agriculture, Food and Rural Affairs of the Republic of Korea {MAFRA} and the project fund will be managed by Korea Agency of Education, Promotion and Information Service in Food, Agriculture, Forestry and Fisheries [EPIS]', 177, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(148, '<p>The existing BAI-NSPRDC will be expanded to become the PNAC as the central coordinating center for the implementation of plans and programs in the conservation, improvement and utilization of native animals. This is located at Km 101 Daang Maharlika Brgy. Lagalag, Tiaong, Quezon. This will support the program of the DA on: 1) Food Security –The program of increasing food production by utilizing native animals; 2). Livelihood to Filipinos- increasing production of native animals in remote far-flung barangays provide livelihood to small farmers 3) Climate Change Adaptations - resiliency of native animals, native pigs, native chicken, native ducks are tested to adopt in extreme weather condition thus can be source of food for the changing weather condition To act as the breeder and multiplier farm for distribution of quality stocks, promotion of technologies and other related projects on native animal production to Local Government Units and livestock raisers.</p>', 178, '2021-06-09 11:41:30', '2021-06-09 15:01:32'),
(150, 'Improvement of BAI Buildings and Equipment facilities will serve as preventive maintenance program of BAI to establish consistent practices designed to get better the performance of facilities, improved safety and quality conditions of everyone,  maintain a safer and disaster resilient workplace in compliance with the disaster and emergency preparedness plan of the agency.\r\n\r\nTo improve existing workplace that promotes productivity, efficiency, safety and convenient to clients and customers towards meeting government mandates.\r\n\r\nComponents: Construction of Property Warehouse/Bodega; Construction of BAI Multipurpose Building; Rehabilitation of BAI Drainage; Equipment; Upgrading of electrical System of BAI; Improvement of LRDD Building with waterproofing; Improvement of Motorpool Facilities;  and Repair of other BAI structures.', 180, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(151, '<p>The project will rehabilitate and protect the affected animals from disease threats and ensure food security during outbreaks and calamities. It will also address the conduct of inspection of farms for the presence of notifiable diseases and declare areas under quarantine to prevent and control the outbreak of animal diseases. It also aims to safeguard the animal industry by protecting the borders, implement mitigating measures during emergencies and respond to animal disease emergencies.</p>', 181, '2021-06-09 11:41:30', '2021-06-09 19:30:29'),
(154, '<p>This project aims to: a. Improve government farms and centers as areas of production and learning in terms of sustainable livestock farming; b. Provide equal opportunity for men and women in the agriculture sector to be trained and educated on sustainable livestock farming; c. Contribute in poverty alleviation through livelihood opportunities for the marginalized sector especially small-hold farmers in the rural areas. Components Establishment of learning sites and improvement as nucleus farms of six (6) BAI Research and Development Centers (RDCs) Capacity building of government livestock technicians Transfer of technology and distribution of starter kits to small-hold farmers</p>', 184, '2021-06-09 11:41:30', '2021-07-13 10:13:54'),
(155, '<p>Rabies still continues to be a zoonotic disease with public health impact. At least 200 hundred Filipinos die yearly of Rabies infection. The only way to eliminate Rabies is by cutting the infection from its source, through mass dog vaccination. Mass dog vaccination is the most cost-effective way in eliminating disease and it only cost 10% of the total expenditure of eliminating rabies in humans. As stipulated in Republic Act 9482, DA-BAI is mandated to lead the elimination of the said disease. The national target, in line with the ASEAN target, is year 2020. The program will protect all Filipinos and other livestock animals from Rabies. The main activities stipulated in the Republic Act 9482 includes mass dog vaccination and registration, dog population management, control of stray dogs, enforcement of impounding activities and information dissemination campaign. This will ensure both food security and public health security, where farmers, fisher folks and their livestock animals may be affected. The implementers are currently giving its best effort to eliminate the said disease, but resources are still unsustainable since the disease directly affects the poorest of the poor areas, where there is limited access to human and animal health facilities.</p>', 185, '2021-06-09 11:41:30', '2021-06-09 14:38:07'),
(156, 'To support the activities of each division that are involved in the Food Safety Program of BAI:\r\n\r\n1. Animal Health and Welfare Division\r\n• GAHP\r\n• Validation of testing method for residue (vet drugs and pesticides) and other contaminants in eggs and honey\r\n• Conducts testing on residue (vet drugs and pesticides)\r\n\r\n2. Livestock Research and Development Division\r\n• Conducts residue and other contaminant (vet drugs and pesticides) testing in honey production\r\n3. Animal Feeds, Veterinary Drug, Biologics Control Division\r\n• Conducts testing in the implementation of RA 1556\r\n• Conducts testing in the implementation of Food Safety Act\r\n\r\n4. National Veterinary Quarantine Division\r\n• Detection of contaminants in honey and honey by-products\r\n• Validation of testing of honey parameters', 186, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(157, 'The program pursues to expand the government initiatives to further intensify the institutional capability of the Local Government Units (LGUs) by putting in place the AI infrastructure, a mechanism that would ensure sustainability by improving essential integrals to include development of human resources, provision of equipment, and strengthening the institutional linkages. The program also provides incentive to the AI technicians that have produced calves through the use of AI, to further motivate them work hard and disseminate the technology to the farmers to improve the lives of our animal farmers.\r\n\r\nTo provide better opportunities for livestock farming communities by enhancing productivity and competitiveness through institutionalized AI delivery systems at the village level.\r\n• Accelerate AI diffusion rate to 30% of breedable cattle and carabaos\r\n• Increase conception rate of cattle and carabaos at the field level to 65% and 45% respectively\r\nEffectively institutionalize the provision of AI services in at least 50% of the LGUs', 187, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(158, '<p>The Bureau of Animal Industry (BAI) - Veterinary Quarantine Stations (VQS) was created and placed under the supervision of NVQSD for flexibility in the deployment of personnel to have easier coordination of veterinary services and quarantine strategies especially in times of epidemic threats and emergencies. The VQS serves as the frontliners on border protection; implement quarantine functions and regulate the movement of animals, their products and by-products including documentation and issuance of permit and commodity clearance for international, inter-regional, intra-regional and inter-island transport. To carry out the mandated functions, VQS offices and strategic inspection posts are in place as follows: 16 Regional Veterinary Quarantine Stations, covering 133 terrestrial quarantine checkpoints, 128 domestic seaports, 9 international seaports, 25 domestic airports, 10 international airports and 4 satellite offices at NAIA, North Harbor, MICP and South Harbor. With the continuous threat of animal disease incursion from important notifiable diseases such as FMD and Avian Influenza amid continuing ASF disease challenge there is a need to strengthen border control strategies. To sustain the implementation of veterinary quarantine inspection procedures and regulations, adequate manpower, facilities and tools are critical. The NVQS aims to enhance the delivery of services and its implementation of regulatory functions by (1)improving its facilities and inspection methods; (2)automate applications for local movement clearance and export veterinary health certificates to enhance client services delivery; (3)adapt technology that will enable efficient collation of movement data for the ease of backtracking and forecasting, particularly in the event of disease emergencies; (4) training and employee development; and (5)incorporate epidemiological studies on the introduction and spread of ASF, review the effectiveness of national and local government for controlling the spread of disease and assess the National Zoning Plan for better management of the disease. To achieve the said objectives, the improvement program on the following areas are determined: 1. Veterinary Quarantine Stations border improvement 1.1 Installation of Mobile Vehicle Disinfection Machine in key interregional checkpoints 1.2 Institutionalization of foot mat in international and domestic ports 1.3 Institutionalization of K9 sniffing dogs in critical ports in collaboration with the Philippine Coast Guard. 1.4 Establishment of Ecologically, Economically acceptable and Sustainable Disposal system for confiscated commodities 1.5. Establishment of a veterinary quarantine isolation center in Tanay, Rizal 1.6 Veterinary Quarantine Policy Development 2. Upgrading, expansion and maintenance of NVQS website and Online clearance application system 2.1 Creation of Public Consultation online hub for new proposed policies/guidelines of the NVQS 3. Epidemiological Study on ASF and assessment of ASF disease control strategies to be done by 3rd party experts 3.1 Establishment of Risk Assessment Unit under NVQS 4. Personnel Enhancement Program &amp; Stakeholder Engagement 4.1 Retooling of NVQS Personnel 4.2 Updating/Orientation seminar for Clients 4.3 Specialized Training of Veterinarians and other technical personnel 4.4 Participation of employees to continuing education activities 4.5 Public Consultation 5. Hiring of additional Contract of Service Personnel to support NVQS &amp; VQS operations To enhance the delivery of quarantine services and efficient implementation of qurantine regulatory functions to prevent the entry/incursion of Transboundry animal diseases and control the spread of African Swine Fever disease in the country The effective control and prevention of ASF and other TADs cases will eventually lead to regaining the ASF country freedom status and maintain the country’s freedom status for TADs such as FMD and Avian Influenza.</p>', 188, '2021-06-09 11:41:30', '2021-06-09 17:22:27'),
(163, '\"Guided by its new vision, “Rice-Secure Philippines” under its new Strategic Plan for 2017-2022, PhilRice and its partners will propose and execute strategies on how to create significant impacts on the lives of all rice stakeholders.  \r\n\r\nWith its mission “To improve the competitiveness of the Filipino rice farmer and the Philippine rice industry and transform it to be more profitable, resilient, and sustainable through responsive, balanced, environmentally sound and partnership-based research, development, and extension.”  PhilRice will therefore pursue a balanced R4D programs and approach.', 193, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(165, 'The Department of Agriculture plays a principal role in ensuring safe and quality agricultural and fisheries products for consumers as well as facilitating trade of the same. This role calls for a farm-to-fork approach to ensuring quality and safety now being demanded by the local and foreign markets and consumers for the products they buy and consume. It also plays a critical role in protecting our borders from the entry of risks to human, plant, and animal health and life. It is imperative therefore that the regulatory offices of the DA must strengthen their delivery of services by recognizing and implementing reforms and practices aligned with the best international principles and practices.', 195, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(166, '<p>The Philippines has existing policies (Presidential Decree No. 1433) that would protect the export and import of agricultural products and commodities from harboring harmful pests and diseases. Consignments are subjected to quarantine inspection or verification to determine their phytosanitary condition. Importations that have been verified to be free from any of the quarantine pests and diseases shall be released to the importer upon the authorization of Plant Quarantine Officer. Similarly, domestic movement of agricultural products harboring insect pests and diseases are restricted unless freedom from pests is ensured or specific treatment is employed. Normally, quarantine inspection and laboratory examination typically lasts for 3-10 days depending on the type of test conducted. As a result, some products are hold in the port area that will cause a delay for their target date of shipment or release if found to contain damaging pest and diseases. It was reported that one of the goals of ASEAN is to expand the trading opportunities of its member countries. Although, it will help ASEAN member countries to fully enhance their products, be engaged to various trading opportunities and to become globally competitive, member countries acknowledge the risk of introduction of exotic pests and diseases into their respective countries due to increasing volume of traded commodities that poses a significant threat on the agricultural industry (Capistrano, 2017). In view of this, four (4) highly invasive insect pests and diseases which can pose a serious threat to agricultural industry in ASEAN member states have to be monitored to prevent its entry and spread in the entire region. These are Drosophila suzukii(spotted wing drosophila),Ceratitis capitate (Mediterranean fruit fly), Pseudomonas syringaepv. syringae (bacterial canker) and Cassava mosaic virus (CMV). If not regulated properly and detection protocol is inefficient, the risk of its introduction to the Philippines and to other ASEAN member countries is imminent and ultimately threatens food security. In addressing this pressing concern on invasive pests, BPI-NPQSD, with an established MBL that employs molecular techniques, realizes the importance of adoption of rapid detection protocol for the identified pests using available Loop-Mediated Isothermal Amplification (LAMP) Assay. LAMP is regarded as an innovative gene amplification technology as substitute to PCR-based methodologies. It has been applied for the detection and identification of plant pathogens and other microorganisms that showed significant advantage due to its high sensitivity, specificity and rapidity. The most promising feature of this technology is the rapid and robust detection of the target nucleic acid without requiring sophisticated equipment. Reactions can be performed with limited resources, using a water bath for incubation and detection of results by the naked eye (colorimetric method) wherein it can give results that is comparable to modern PCR-based techniques (Li et al., 2017). The said methods can be optimized and validated not only for the future use of the Bureau but also for the ASEAN member countries. Moreover, in pursuing an inclusive approach to accelerate the transformation towards a modern and industrialized Philippine agriculture, the Department of Agriculture (DA) is implementing critical strategies for 2021 (DA Communications Group, 2021a). One of the twelve (12) key strategies to firm up the ‘One DA’ framework is the “Intensification of Food Safety Protocols and Regulations’ (DA Communications Group, 2021b). As per this strategy, the DA will focus its funding and effort in mitigating the effects of plants and animal diseases through improvement of laboratory and research facilities, building traceability, and unifying control measures against plant and animal epidemics (DA Website). This project is highly supportive with this strategy through strengthening the regulatory capability of the division and improvement of effectivity and efficiency of detection of pest of quarantine significance.</p>', 196, '2021-06-09 11:41:30', '2021-06-23 15:51:31'),
(167, '<p>Maintenance of agromet stations, training on operation and maintenance of SSIPs, preparation of FS for SSIPs.</p>', 197, '2021-06-09 11:41:30', '2021-06-23 17:44:01'),
(168, '<p>The proposed project in Bulan, province of Sorsogon, involves the construction of an ice plant, cold storage, and processing plant that will allow the fisheries sector of the municipality to practice better preservation and processing of their commodities particulary those being shipped to other areas, and may bring about stable supply of ice and fish within the municipality. The proposed Construction of Ice Plant, Cold Storage, and Processing Plant aims to provide Bulan with adequate post harvest facilities that will meet the current requirements of the fisheries sector of the municipality for a more efficient handling and distribution of fish and fishery products, and effectively ensure food security and sustainability of incomes of fishery-based households and enterprices in the area.</p>', 200, '2021-06-09 11:41:30', '2021-06-10 09:00:16'),
(169, 'The proposed project in Biliran, province of Leyte, involves the construction of a fish port equipped with landing and trading, and other support facilities, that will cater to the unloading and trading activities of fishermen and fish traders in the locality generally serving as link between the fish production areas and the consumer/markets.\r\n\r\nThe proposed Fish Port is aimed to provide Biliran with adequate post harvest facility that will facilitate the handling and distribution of fish and fishery products efficiently and effectively ensuring food security and sustain incomes of fishery-based households and enterprises in the area.', 202, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(170, 'The proposed project in Sogod, province of Southern Leyte, involves the construction of a fish port equipped with landing and trading, and other support facilities, that will cater to the unloading and trading activities of fishermen and fish traders in the locality generally serving as link between the fish production areas and the consumer/markets.\r\n\r\nThe proposed Municipal Fish Port is aimed to provide Sogod with adequate post harvest facility that will facilitate the handling and distribution of fish and fishery products efficiently and effectively ensuring food security and sustain incomes of fishery-based households and enterprises in the area.', 203, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(171, 'The proposed project in Infanta, province of Quezon, involves the construction of a fish port equipped with landing and trading, and other support facilities, that will cater to the unloading and trading activities of fishermen and fish traders in the locality generally serving as link between the fish production areas and the consumer/markets.\r\n\r\nThe proposed Municipal Fish Port is aimed to provide Infanta with adequate post harvest facility that will facilitate the handling and distribution of fish and fishery products efficiently and effectively ensuring food security and sustain incomes of fishery-based households and enterprices in the area.', 204, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(172, 'Construction of a new fish port in Tagbilaran City, Bohol. It aims to increase the utilization of the port facilities and structures at the Regional Fish Port and establish HACCP compliant fish port facilities, thus, meeting the present and future needs of an efficient marketing system; and allow integration of fishery and fishery-related facilities.', 205, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(173, 'The program is aligned with the Dairy Roadmap 2020-2025 which was a result of series of consultations with the various stakeholders in the dairy sub-sector with the general consensus that dairy development in the Philippine context is more than milk, its more about people, improving their income and their general well being.\r\n\r\nThere are four major components of the program which are the Herd Build-Up, Productivity Improvement, Enterprise Development and Human Resource Capacitation.', 206, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(174, '<p>The two-year project shall involve the procurement and installation of sophisticated analytical equipment that will improve the analytical capability of the Pesticide Analytical Laboratory Section (PALS). The project shall also develop and validate methods in detecting more pesticide residues. Analytical equipment to be procured are the following: 1. LC-MS-MS - for screening and confirmation of almost all types of pesticides 2. GC-FPD - for analysis of low molecular weight organo-phosphorus containing pesticides 3. GC-ECD - for analysis of low molecular weight organo-chlorine containing pesticides and pyrethroids 4. Medical freezers – for storage of pesticide standards and samples 5. Computers – for preparation of reports and presentations The set of equipment will be installed in the PALs to basically meet the current requirement in the analysis of samples as mandated by the Food Safety Act and the Philippines’ commitment to non-tariff measures (NTM). Training on the basic knowledge and background of the instrument/equipment and the principles involved in the instrumental analysis shall also be provided. In addition, hands on training, maintenance and troubleshooting, evaluation and interpretation of the data obtained will also be conducted. These trainings are part of the package in the procurement of the equipment. Method development and validation of analytical methods will be conducted as soon as the equipment are installed. The method development will be done on a per instrument basis while validation will be on a crop / pesticide basis and will follow international protocol in order to produce reliable and accurate results. Actual implementation of the project will be conducted through the analysis of crops (300 samples for the whole project duration) both imported and local. Monitoring of imported commodities, particularly apples, pears, oranges and grapes, consumed fresh will be conducted in local markets and in borders through the National Plant Quarantine Services Division (NPQSD). Monitoring of commodities in the local markets will be enhanced. This enhanced monitoring will ensure safe food for the Filipinos as well ensure detection of pesticide residues prior to exportation of crops, thereby resulting to reduced detections and detentions of our commodities in importing countries.</p>', 213, '2021-06-09 11:41:30', '2021-06-24 07:24:36'),
(175, '<p>This project intends to document the best practices of the food safety laboratories among AMSs and China and through an international conference, each member state and China shall present/share their best laboratory practices, likewise have the opportunity to learn different practices that may be applicable in their respective countries. A compilation of best laboratory practices of AMS and China shall be generated and by the end of this project a journal article on the best laboratory practices of AMS and China shall be published.</p>', 214, '2021-06-09 11:41:30', '2021-07-05 10:40:28'),
(177, '<p>\"This project is a follow up of the past aid to the Philippines by the Korean government in 2013-2016 implemented through a project titled, “Enhancing the Capacity for Production and Distribution of High-Quality Rice Seeds”. As PhilRice CES expanded its area for seed production, from 34 hectares in 2016-2020 to 52 hectares, it will require additional facility to complement and sustain performance efficiency. Concerns on untagged seeds that are proliferating will partly be addressed by the rice seed information system (RSIS) which is a component of this project. With RSIS portal serving as repository of important data/information, the stakeholders will be guided as to the availability of high-quality seeds which can be accessed anytime. The NFA’s ICT-based buffer stock management system, on the other hand, will need the hardware and software to improve its operations. It will equip the personnel with gadget and in using the ICT software so they can provide the status of milled rice inventories in the regional warehouses at a given time. The stakeholders will be kept abreast of the situation of each of the NFA stations so augmentation of stocks from one place to another may be facilitated within reasonable period of time. Once these facilities, systems, and hardware are in place, the Philippine government will be kept informed for planning and decision making on matters pertaining to rice production and seed requirements and sources, palay procurement schedules, and milled rice stocking and distribution system. Hence, this project will provide great contribution and impact to achieving a seed-secure toward a food-secure Philippines.\"</p>', 216, '2021-06-09 11:41:30', '2021-06-09 19:26:29'),
(181, '<p>The project intends to conduct a nationwide surveillance of World Organization for Animal health listed diseases and priority animal diseases of the Philippines through an epidemiological and statistical sound surveillance program.</p>', 312, '2021-06-09 11:41:30', '2021-06-25 15:56:47'),
(182, '<p>The Community Rainwater Catchments proposes a sustainable solution to he country\'s long-standing severe flooding and drought issues. Infrastractures such as Small Farm Reservoir, Small Water Impounding Project, Sediment Filtration Structures, and Artificial Groundwater Recharge Structures will be constructed. There are four (4) components in this project namely Project Management, Construction of RWC Structures (SWIP, SFR, AGRS), RWC Watershed Management, and Agricultural Land Resources Management. Each of these has respective activities mapped out that will lead to the fulfilment of the projects goal &amp; objectives.</p>', 246, '2021-06-09 11:41:30', '2021-06-23 17:45:20'),
(183, '<p>This includes modernization of the research center through upgrading of facilities, equipment, farm machineries and laboratories; Implementation of soil, water, site specific and climate resilient strategies and practices; and capacity building</p>', 247, '2021-06-09 11:41:30', '2021-06-24 09:21:45'),
(184, '<p>Establishment of Trading Post in the Municipalities of Carlos P. Garcia, Sagbayan, San Miguel, Clarin, Getafe, Talibon, Bohol</p>', 249, '2021-06-09 11:41:30', '2021-06-24 09:44:39'),
(185, '<p>The activities that will be undertaken under the Project is divided into two phases, namely the Planning Phase and the Implementation Phase. The activities under the Planning Phase are the following: 1. Review of existing vegetable value chain analysis and roadmaps 2. Conduct market survey to identify target FVC 3. Formulate FVC stakeholder’s platform 4. Draft Enhanced Vegetable Value Chain Roadmap covering short, medium and long term measures 5. Plan of Pilot Activities to develop Inclusive Business model 6. Enhance knowledge through training program in Japan 7. Technical survey to confirm feasibility of Smart Food Chain (SFC) to target FVC For the Implementation Phase, specific activities will be identified based on the results of the planning phase. However, the main components of this Project phase include the following: 1. Development of Inclusive Business model 2. Promotion of Inclusive Business model The project\'s overall goal is \" Profitable vegetable value chain is expanded\" and it\'s purpose is \"Inclusive Business Model which can increase farm income is established\"</p>', 250, '2021-06-09 11:41:30', '2021-06-25 19:27:10'),
(186, '<p>The program, Kabuhayan At Kaunlaran ng Kababayang Katutubo or 4Ks, is mainly an agriculture program focused on the development of Ancestral Lands into Tree Farms with other profitable crops such as Cacao, Coffee, Abaca and Black Pepper as secondary products. The 4Ks is culture-sensitive program which will only be introduced to the IP Communities after exhaustive consultations. The Kabuhayan at Kaunlaran ng Kababayang Katutubo or 4Ks is a program inspired by the vision of President Rody Duterte to finally lift the Indigenous People of the country from poverty by developing their Ancestral Domain Claims through productive endeavours</p>', 251, '2021-06-09 11:41:30', '2021-07-05 10:43:50');
INSERT INTO `project_descriptions` (`id`, `description`, `project_id`, `created_at`, `updated_at`) VALUES
(187, 'The project involves the promotion of dairy herd build-up and enhancement of milk production through the infusion of purebred and crossbred dairy stocks, use of advanced breeding technologies and establishment/strengthening of community-based dairy enterprises within identified impact dairy zones. This is in support to the Department of Agriculture (DA)’s current development strategy of “New Thinking for Agriculture” and new vision of a “food secure Philippines with prosperous farmers and fishers”. Moreover, the farm consolidation or clustering approach will be done encouraging farmers to consolidate/cluster their dairy animal farming activities thereby enhancing access of these farmers to technologies, financing and markets. \r\n\r\nConsistent with the objectives of the agriculture sector in expanding economic opportunities in agriculture, the project aims to: 1) produce 27.70 Million Liters of milk throughout the project period; 2) increase dairy cattle inventory by 7,323 heads and dairy goat inventory by 9,611 heads through importation and expanded animal breeding programs; 3) increase dairy carabao inventory by 922 heads through importation and local procurement of purebred/crossbred buffaloes; 4) increase production of female calf by 8,562 heads annually through expanded AI services utilizing the semen sexing technology; 5) increase average family income of dairy farmers by 20% annually through the development of carabao-based dairy enterprises; and 6) increase the average income of dairy goat farmers by 18% and double the income of dairy cattle farmers throughout the project period with the establishment and enhancement of goat-based and cattle-based dairy enterprises.\r\n\r\nIn laying down the strategies to be implemented throughout its duration, the following are the major components of the project: a) Dairy Animal Procurement and Distribution; b) Expanded Artificial Insemination; c) Feed Production and Development; d) Dairy Enterprise Development; e) Capacity Building; and f) Project Management, Monitoring and Evaluation. The project will be implemented by the National Dairy Authority (NDA) and Philippine Carabao Center (PCC) with the DA-National Livestock Program (NLP) as the oversight office for four (4) years. It will be sustained and monitored through collaborations with various cooperating agencies.', 254, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(188, '<p>-The BAFE has developed an in-house Managemeny Information System known as ABEMIS or the Agricultural and Biosystems Engineering Management Information Sytstem. -This serves as tghe DA\'s repository of agricultural and fisheries related information that are essentials for effective plannig, implementation, monitoring, operationalization and regulations of mechanization, irrigation, farm-to-market roads and other infrastructure projects. -It is a decision support that generates information and geomapping from project implementation, procurement, construction, distribution, operation and maintenance audit and client feedback. -Its framework is anchored on Results-Based Monitoring and Evaluation (RBME) that identifies contribution of machinery and infrastructure project in DA development obejctives. It covers all commodity and identifies its contribution to Value Chain Analysis.</p>', 253, '2021-06-09 11:41:30', '2021-06-24 09:48:03'),
(189, '<p>The dairy industry is one of the components of the Philippine agriculture which is considered vital in the economic and nutritional development of the nation. In the past years, the government had initiated several interventions to support and boost the industry. However, these efforts are not enough to level up the production as the local dairy industry at present is just able to supply 1.3% of the total milk demand of the country. The current dairy animal inventory is insufficient to satisfy the dairy requirements of the consumers. The passage of Republic Act (R.A.) No. 11037, otherwise known as the “Masustansyang Pagkain para sa Batang Pilipino Act” and R.A. No. 11148 or the “Kalusugan at Nutrisyon ng Mag-Nanay Act” provided directions for the DA, particularly the NDA and the PCC, to encourage farmers to raise more dairy animals to supply the demand for locally produced milk through milk feeding programs for public kindergarten and elementary schools and public daycare as well as help boost livelihood opportunities for local dairy farmers, in particular, and the local dairy industry, in general. Of the 24.4 million liters of locally produced milk, 60% are sourced from cattle while 36% are sourced from buffaloes and 4% are sourced from goats. While cattle has the largest portion in herd inventory and local milk production, there is a rise in interest in dairy goat farming due to low cost of raising dairy goats. Likewise, carabao dairying continues to prove its potential with almost doubled nutrients of cow’s milk making it easier for carabao milk and milk products to enter the local market. With the abovementioned considerations, a restructuring of the US PL480-funded project entitled “Dairy Goat Farming: A Livelihood Opportunity for Rural Farm Families” which was approved by the US Government on October 11, 2018 is being proposed. The restructuring would include dairy buffalo and cattle, in addition to dairy goat, with the aim to accelerate the improvement of the entire industry through increased production and enhanced genetics of these animals leading to increase local milk production. Overall, the program will help in the national government’s efforts to address poverty, hunger and malnutrition. It will be entitled “Intensified Community-Based Dairy Enterprise Development” and will be implemented by the NDA and PCC. The project intends to create the aforementioned impacts through the infusion of purebred dairy stocks and the use of advanced breeding and reproduction technologies. Procurement of locally available purebred/crossbred buffaloes in addition to the importation of purebred dairy stocks will also be done due to limited stocks from Foot and Mouth Disease (FMD)-free countries. Likewise, the establishment and strengthening of additional dairy enterprises are deemed necessary. Overall, the above-mentioned initiatives are in line with DA’s current development strategy of “New Thinking for Agriculture” and new vision of a “food secure Philippines with prosperous farmers and fishers” supportive of the farm consolidation or clustering approach by encouraging farmers to consolidate/cluster their dairy animal farming activities through communal farms, thereby enhancing access of these farmers to technologies, financing and markets. With the directives to support the Philippine Dairy Industry and push for attaining higher sufficiency levels in terms of milk production, all efforts to increase local milk volumes and its sources are being exhausted, hence this project.</p>', 255, '2021-06-09 11:41:30', '2021-06-24 07:53:25'),
(190, 'The complete IMEMS system which comprises of Phases I, II & III will provide DA-BFAR with a powerful and fully integrated fisheries, marine environment & aquatic life management and monitoring system which covers the entire Philippine fishing industry. IMEMS III will extend the existing IMEMS system to include the monitoring of all commercial and municipal vessels operating in Philippine waters, and thus result in a single integrated system that manages and monitors all Philippine fishing vessels.\r\n\r\nThe project aims to significantly improve and extend the existing capabilities of the BFAR Vessel Monitoring System (VMS) and operationalize a Single Integrated National Marine Environment Monitoring System that is financially viable and scalable over the long term.', 258, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(191, 'The  Tiya Dairy\'s tiNDAhan will be situated in Brgy. Paraiso, Tarlac City, Tarlac, wherein government offices are also located. This project will be manned by NDA-North Luzon Department and milk products that will be sold here are coming from NDA assisted cooperatives and processors. Individual processors are also welcome provided that they comply with FSA/FDA requirements for milk and milk products. The project will earn by selling these products to local consumers thru retail by adding a 20% markup per product sold. To make the project sustainable, NDA-NLD will regularly provide product development trainings to processors to keep their products within the quality standards.', 264, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(192, 'This project will support the development of the dairy goat industry through expert assistance and capacity building of dairy goat farmers and processes in goat milk, milk products and by-product development. Value adding of products can increase product prices, uplifting the lives of small hold dairy goat farmers and processors.\n\nDevelopment Of Dairy Goat Products Processing Industry in the Philippines', 266, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(193, '(1) Establish 20-30 tons treatment facilities for biodegradable wastes each in Marinduque, Camarines Sur, Pangasinan and Quezon City; (2) Develop sustainable waste-reduction measures through gathering, treatment and processing into compost; (3) Generate livelihood and create employment; (4) Strengthen partnership with the local government units to increase its resources in providing food value chain support services; (5) Institutionalize long-lasting solution by capacitating the community to produce affordable and nutritious food for their families.', 267, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(194, '<p>The project, through the National Farmers and Fisherfolk Information System (NFFIS), covers the following components: updating of the Registry System for Basic Sectors in Agriculture (RSBSA); nationwide farm lot georeferencing; and development of Interventions Monitoring System. This project aims to create a centralized and nationwide farmers and database that would support vaious levels of planning, decision-making, and delivery of interventions for the Department of Agriculture. The database contains information on farmers, farm laborers, and fishermen and their farm parcels. The database can significantly improve the delivery of programs and services of the Department of Agriculture while making the data available to other agencies that share the same stakeholders as the DA. The activities include the conduct of nationwide validation and registration of farmers and updating of the existing farmers\' registry. The nationwide farm lot georeferencing will link the farmer profiles to farm lots. This will validate farm areas for intervention distribution and verify the total production areas. Farmer\'s ID card or Intervention Monitoring Card will serve as the standard identification system for all registered farmers. The intervention monitoring card can be used as a first-level validation and authentication of DA beneficiaries. The project will require technical assistance from a consultancy firm to hire, train and deploy staff that will conduct the farmer and fisherfolk updating, registration and profiling, and conduct farm parcel georeferencing. Given the scale of the project, it will be difficult for the DA to implement the project on its own. To ensure the alignment of the technical assistance to the intention of the project , the Secretary will issue guidelines for its implementation. Project Management teams shall be formed at the national level including a National Steering Committee, National Project Technical Working Groups, and National Project Management Office. The DA-RFOs will create their own project implementation offices to oversee and provide technical assistance at the regional level. The local government units, municipal agrarian offices, municipal agriculture, and fisheries council and punong barangays will be engaged as partners in verifying the legitimacy of farmers and fisherfolk as well as the information to provide.</p>', 275, '2021-06-09 11:41:30', '2021-06-16 16:03:07'),
(195, '<p>Construction of FPA Six-Storey Laboratory Building</p>', 276, '2021-06-09 11:41:30', '2021-06-11 12:04:28'),
(196, 'The proposed project intends to help increase the income of Halal food supply chain actors through the development of Halal livestock production in Mindanao.', 277, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(197, 'This project aims to provide technical assistance to give support to the development and protection of the Geographical Indications in the Philippines as instrument of sustainable rural development.  It also provides competitive edge to agricultural products with unique qualities and at the same time provides protection from competing products from other countries.', 278, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(198, '<p>Three (3) Dairy Training Centers will be established in Baguio Dairy Farm in Luzon, Ubay Bohol Dairy Farm in the Visayas and at the NDA-PCA Dairy Farm (Davao) in Mindanao. Each Training Center will be composed of dairy farm animals, dairy farm facilities (milking parlor, cow barn, milk processing unit, calf barn, forage and pasture areas, farm tools, equipment and machineries, vehicle training room, training dormitory/living quarters) and Technical and Skills Development Authority (TESDA) accredited/licensed trainers, TESDA Accreditation-NC II, Non-teaching staff and farm personnel.</p>', 279, '2021-06-09 11:41:30', '2021-06-10 12:23:59'),
(199, 'The project desires to prepare and ready the key players/actors namely, the farmers, processors and distributors, as well as the enablers (government service providers: NDA, BAI, PCC, FDA) in the whole dairy value chain through knowledge sharing/transfer in order to assist them on how to optimize, if not maximize, the use of inputs such as materials, money, machine, manpower and methods. Development Of Dairy Goat Products Processing Industry in the Philippines.', 280, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(200, 'Component 1: Joint Policy Study\n• Joint Policy Research in Philippine Dairy Development Policy and Regulation. Dairy experts from Korea and Philippines and if necessary, with possible involvement of other ASAN and Asia Pacific resource persons, who shall jointly collaborate to review existing Philippine dairy policies and issuances, and come up with recommended courses of actions.\n• The most critical areas which include dairy production, processing and marketing will be studied to find critical issues and problems and how to solve them. Results will be used as baseline data for further collaborative projects which may include infrastructure and technology development.\n\nComponent 2: Knowledge Sharing\n• Short-term Trainings on \n   a. Dairy Policy Analysis and Development in Korea and \n   b. Dairy Regulation Standard Settings & Review in the Philippines.\n   c. Dairy Extension and Dissemination Strategies on critical areas in production, processing and marketing.\n• Country-industry Mission/Visits on successful public and private dairy enterprises in Korea and Philippines.\n• Country-industry workshops on Dairy Development Policy and Review Collaboration.\n\nComponent 3: Dairy Project Identification and Development\n• Project shortlisting and conceptualization workshops.\n• Project proposal preparation.\n\nThrough this project, the dairy sector’s competiveness and capacities will also be fully strengthened in the country as extension services will continue to magnify its horizons by providing adequate and timely training and education. These are some of the areas that needs improvement in order to speed up, accelerate and increase dairy productivity and the number of farmers involved in the industry.\n\nSpecific Objectives:\n• To develop high impact and sustainable Country Dairy Policies;\n• To institutionalize the PHILKOR Dairy Development Cooperation; and,\n• To operationalize the priority projects listed in the Public Investment Program 2017-2022:\n1. Rural Dairy Industry development Project and\n2. Partnership Arrangement and Operation of a Dairy Cattle Production and Rearing Farm Business for Dairy Development\n3. Strengthening Capabilities on Philippine Dairy Development and Regulation Policy Analysis and Formulation (prioritizing the infrastructure component)', 281, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(201, 'To Increase income of Smallholder coffee farmers in selected areas in the Philippines have improved the economic viability of their farming system', 282, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(202, 'The National Dairy Authority (NDA) was established in 1995. It is the central policy determining and directing body tasked to ensure the accelerated development of the Philippine dairy industry through policy direction and program coordination and implementation. The main goal of the NDA is to establish a profitable, competitive and sustainable growing dairy industry built on financially viable business performance throughout the value chain, providing good quality of life for farmers and ensuring consumers safe and quality milk and milk products.Majority of the Philippines’s annual dairy requirement is supplied by importers and processors. Local production continues to increase annually but not enough to cover local demand. In 2017 it imported 417,07 million kilograms of milk by 185 importers, processors and traders. In same year local production was only 22,76 million kilograms of milk. Milk is third largest agri-import.Philippines’s dairy sector represents a big potential for an improvement of a quality of life in rural areas. Development of milk production will have positive effects on unemployment rate and socio-economic situation in rural areas.  The NDA is given very limited funds every year to capacitate a total of 2,418 dairy farmers in dairy production and management. The lack of funds contributed to the very limited technical assistance the NDA can provide to these dairy farmers resulting to wrong practices and not enough knowledge to run a dairy enterprise and make it profitable.\n\nThe NDA is focused on improvement of situation. In 2017, the NDA and Czech Republic’s Development Assistance (program Aid for Trade of the Ministry of Industry and Trade of the Czech Republic) have started a new project focused on situation of dairy sector in Philippines - “Assistance in analyzing and improving value chains in the dairy industry in Philippines”. In scope of the project, Czech dairy experts have visited Philippines’s farms. They have identified three main issues that are complicating development of dairy industry in Philippines:\ninsufficient capacities of extension workers\n- insufficient capacities of dairy farmers \n- insufficient promotion of local (Philippines’s) production and consumption\n\nThe proposed project is consistent with and directly supports the NDA Charter Statement and Strategy Map (Annex A) of improving the stakeholders’ welfare, ensuring the enforcement of dairy quality standards from production to post-harvest, advocate for the patronage of local milk and milk products and enhancing the competency of NDA manpower and farmer-clients.\nFinally, the proposed project will help realize the Philippine Agriculture’s goals of expanding opportunities for those engaged in agriculture production and increasing access of small and subsistence farmers to economic opportunities as stipulated in Chapter 8 of the Philippine Development Plan (PDP) 2017-2022.', 283, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(203, 'Dairy Farming has always been construed to be a prohibitive and labor-intensive farming activity unlike crop farming.  Government investments have always been hugely spent for rice and high value crops while dairy programs were minimally funded in comparison.  \r\n\r\nStatistics show that despite the lack of investments, the growth of the dairy sector has been at an average of 6.3% (2010-2015).  Small hold dairy farmers have considered dairy farming as their livelihood that can provide for their families needs.  The most compelling reason why dairy farmers continue to pursue dairying as a living is profit.\r\n\r\nThe government, the private sector and future dairy players need to be convinced that dairy farming and all of its related activities are profitable, hence, need investments.  The local dairy industry needs to be promoted as one of the agricultural commodity poverty reduction driver particularly in the rural areas.  Studies shall be documented and backed up by scientific evidence to firm up the cause, hence, this study.', 284, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(204, 'ICT Enhancement Program for dairy development', 285, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(205, 'The project shall acquire new technologies for precision agriculture in the form of an unmanned aerial system with mobile deployment is essential. This shall help in the preparedness and response planning activities to effectively set intervention measures to affected farmers and communities based on the four thematic areas stated in Republic Act 10121 namely; Prevention and Mitigation, Preparedness, Response and Rehabilitation and Recovery.', 286, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(206, '<p>In the early years of the century, two outbreaks of coronaviruses were observed. The two corona outbreaks were Severe acute respiratory syndrome (SARS-CoV) in 2003 (WHO, 2004) and Middle East Respiratory Syndrome (MERS-CoV) in 2012 (WHO, 2019). In December 2019, group of patients were hospitalized due to pneumonia with unknown cause. After thorough investigation, the unknown disease was linked epidemiologically from a seafood and wet animal wholesale market in Wuhan, Hubei Province, China. It was later found out that the mysterious disease is caused by a virus from the Betacoronavirus family that is related to SARS-CoV and MERS-CoV. It was later given the name COVID-19 as it stands for “COrona VIrus Disease 2019” (Rothan and Byrareddy, 2020). In some reports, it was observed that not only human can be infected or carry COVID-19, however, animals are suspected to carry asymptomatically the virus but animal to human transmission have not yet been demonstrated. However, screening of animals for COVID-19 has not yet been done (CDC, 2020). Although there are still no known reports of animal mortality due to COVID-19 and transmission between animals may still have no great impact on livestock trade and industry, that fact is that animal to human transmission is already existing. Humans working in the livestock trade are getting infected and their absence from overseeing the trade has crippled the industry and is a risk to food security. Current diagnostic test and protocols for COVID-19 included Real-time Polymerase Chain Reaction and Antibody test A.K.A “rapid test kits”. RT-PCR detects a specific gene or protein of the virus to confirm its presence in the host however, this test has disadvantage of needing meticulous steps to prepare the sample and a need of specialized equipment. On the other hand, rapid test kits can be brought to the field however the test may have false positives or still detect the disease even in recovered patients (CDC, 2020). With this, this project aims to develop a prototype nanotech-based test kit that can detect COVID-19 for livestock and companion animals. In addition, the project aims to augment the existing diagnostic options with a field molecular kit complexed with nanotechnology.</p>', 287, '2021-06-09 11:41:30', '2021-06-24 08:41:02'),
(207, 'The Dairy Industry Development Program aims to accelerate the development and growth of the Philippine dairy industry through policy direction, program coordination and implementation towards the enhanced growth and competitiveness of the industry with the end in view of achieving adequate supply of safe, quality milk and milk products  contributing  to food security, to provide livelihood opportunities and thereby increase incomes of small rural-based dairy farmers and proper nutrition for local consumers.\r\n\r\nAs the sole government agency that serves as the central policy determining and directing body mandated thru the National Dairy Development Act (RA7884) to carry out the Dairy Industry Development Program, the National Dairy Authority (NDA) possesses the power to formulate and execute dairy programs that will see the achievement of the purpose of the law.\r\n\r\nThe NDA has created programs and projects that will increase the base population of dairy animals to increase milk volumes, empower dairy farmers and other stakeholders, facilitate the provision of dairy facilities and equipment, provide access to market and promote the marketability of locally produced milk.  \r\n\r\nThe main programs that NDA pursues implementation include: \r\n  - Dairy Herd Build- Up Program;\r\n  - Dairy Enterprise Development Program\r\n  - Milk Feeding Program; and \r\n  - Dairy Regulatory Program', 288, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(208, 'Dairy farming today requires the use of farm machineries and equipment which are considered valuable inputs particularly in forage production and pasture development.  While such equipment offers a wide range of benefits in terms of developing and increasing production of forage for dairy animals, not all dairy farmers have the capacity to purchase their own equipment taking into account the financial obligations that they need to fulfil in managing their respective farms.\r\n\r\nAs the agency mandated to accelerate the development of the local dairy industry, the NDA is committed to providing the local dairy farmers the access to various dairy equipment and facilities that can be of great help in improving their dairy farm operations. It is in this light, that the NDA would like to propose the provision of one (1) agricultural tractor, one (1) forage chopper, one (1) truck, and one (1) warehouse to each of the six (6) Regional Departments of the NDA namely, Northern Luzon, Southern Luzon, Central Visayas, Western Visayas, Northern Mindanao and Southern Mindanao. \r\n\r\nThe NDA shall be the executing agency of the project whose major tasks include: formulating rules and guidelines as regards to the use of the tractor and forage chopper; deployment of the equipment to the requesting farmers/farmers\' groups; overall maintenance of the equipment; and conduct of regular monitoring of the project. \r\n\r\nThe NDA uses this proposed project as the vehicle to support local dairy farmers in their goal of further enhancing dairy farm operations to achieve better milk yield and ensuring the availability of feeds for dairy animals. In addition, the agency seeks to develop more contract growers to serve as feeds source of the local dairy farmers and contract growers for specialized skills in calf rearing and grow-out farming. \r\n\r\nThe tractors, trucks, and forage choppers would be provided on hire basis to the local dairy farmers through the NDA Regional Department assisting them. Each department shall be responsible in ensuring the equity in the distribution of assistance to the farmers.\r\n\r\nThe project will enhance farm operations and increase forage production of local dairy farmers. It also aims to develop more contract growers as feeds source.', 289, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(209, 'To promote and operationalize the Dairy Expert Exchange Program (DEEP) involving the participation of dairy experts from both countries.\r\n - To promote and institutionalize the adoption of good dairy practices using FRANCE-based technology.\r\n - To orient and familiarize participants on the unique features of FRANCE’s way of developing and managing dairy business, government or privately owned.\r\n - To educate participants on FRANCE’s proven and applied technologies on the areas of dairy production, processing, marketing, dairy products formulation/development and information/resource management.', 290, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(210, ' To provide financial assistance to the dairy development efforts in the country through the combined credit facilities of Spain and the Philippines.\r\n To finance the on-going business requirement of the dairy enterprise in the areas of dairy production, processing, marketing and management, which may be in the form of the following:\r\n Acquisition of Fixed Assets\r\n Working Capital\r\n Renovation or Expansion Purpose', 291, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(211, 'The main objective of the study is to benchmark and compare the dairy production and processing technologies in Spain and to prospect existing practical Spain dairy technologies/practices that can be suitable to Philippine condition.\nSpecific objectives are as follows:\n1. Study, observe, analyze and appreciate Spain’s small and medium farmers dairy management practices on farm and in plant; and\n2. Explore possible cooperation in improving dairy farming productivity and plant efficiency.', 292, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(212, 'A. Infrastructure\r\n\r\n1. Establishment of Dairy Marketing Centers \r\na. These marketing centers, equipped with chillers, shall be established within existing NDA-assisted dairy zones or dairy areas. It must be situated in strategic areas or commercial centers where local consumers can easily access the products. \r\nb. Dairy farmers can go to these dairy marketing centers to sell their products. Since smallhold dairy farmers will undergo capability training on home based processing, they will be able to process their own products, sell through these marketing centers and earn more income.  \r\nc.  The NDA will initially oversee the center under its Business Development Unit and eventually tap the NDA trained personnel of the Federation or dairy cooperatives to manage or run the centers. The dairy cooperatives/federations/private entities shall pay corresponding commissioned-based fees to NDA for every product sold in the center. The fees collected will go back to the marketing centers to cover the maintenance costs.\r\nd. NDA will continuously monitor the marketing centers.\r\n\r\n2. Establishment of Dairy Post-harvest facilities \r\na. Post-harvest facilities such as milk collection centers with cold storage equipment shall be established to ensure the quality of milk collected for processing plants. \r\nb. Farmers can go to these collection centers and sell their raw milk produce and the collection center will bring the milk to the milk processing plant.\r\nc. The NDA will establish these milk collection centers and shall be leased (Lease to own scheme) to cooperatives or federations.\r\nd. Through a partnership forged between the federation or cooperatives and the marketing center thru NDA, products from the milk processing plants will be supplied to the marketing centers.\r\n\r\nB. Capacity Building\r\n\r\nAs the country recognizes the need to develop its dairy industry, priority programs such as training programs for dairy farmers and cooperatives shall be enhanced. Dairy sector’s competiveness and capacities will be fully strengthened in the country as extension services will continue to magnify its horizons by providing adequate and timely training and education. The following trainings will be conducted:\r\na. Homebased Milk Processing\r\nb. Milk Quality Assurance\r\nc. Business Management (Accounting & Bookkeeping)\r\nd. Milk Marketing\r\ne. Trainings on other business opportunities (meat processing (for male calves), vermi-culture, biogas, forage production)\r\n\r\nThis project aims to enhance existing dairy-based livelihood particularly on milk collection, processing and marketing to make dairying a sustainable source of income for dairy farmers. It intends to promote the marketability of locally produced milk and milk products.', 293, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(213, 'The project aims to :\r\n1. To capacitate and empower Agrarian Reform Communities (ARCs) through the provision of farm based trainings in dairy farming and other related dairy enterprise;\r\n2. To provide ARCs with funding support and other logistics related to dairy farming\r\n3. To enhance agricultural productivity through mobilization of supplies and equipment to sustain livelihood of target beneficiaries;\r\n4. To provide better livelihood opportunities, thus increasing livelihood income and improvement of quality of life;', 294, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(214, '<p>The NDA and the partner shall enter into a Partnership Agreement for the Establishment and Operation of a Dairy Cattle Production and Rearing Farm Business for Dairy Development with the following features: 1. Dairy cattle production, upgrading, and rearing shall be undertaken in the farm. 2. The NDA shall provide dairy heifers/cows as its equity in the partnership including support systems for breeding such as dairy semen, breeding paraphernalia, liquid nitrogen, semen tank, and the like. 3. The partner shall provide the suitable farm for the equivalent number of cattle with grazing areas, feeds and forage, corresponding cattle sheds and milking parlor, and other farm infrastructure and utilities like electricity and water. 4. The sharing of profits/losses shall be proportionate to the respective project equity. 5. Joint project management shall be exercised by both parties through equal representation in the Project Management Group. Daily farm management shall be the partner\'s responsibility. The project aims to: 1) increase the number and quality of local dairy animals through the establishment and operation of dairy cattle production and rearing farm; and 2) improve dairy cattle production systems through the creation of local sources of dairy cattle in partnership with the private sector.</p>', 295, '2021-06-09 11:41:30', '2021-06-10 12:51:20'),
(215, '<p>Establishment of an agri-industrial complext in Mati City, Davao Oriental</p>', 296, '2021-06-09 11:41:30', '2021-06-23 09:24:36'),
(216, 'The project aims to improve the capacities of the agriculture sector on data collection and information management that would enable timely, critical and efficient decision-making and delivery of interventions to improve the management of crops and farm lots.', 297, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(217, 'The project will establish smart greenhouses and operating system in region VI and X', 298, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(218, '<p>The continuing development and commercialization of the other Industrial uses of tobacco to increase its utility, create new / expand demand and there augment farmers income, save and earn dollars create new business activities/employment, and increase revenue for the government and to serve as safety nets of any eventuality that may arise due to aggressive global anti-smoking campaign. Enhancement of technologies and profitability of the production of tobacco dust, tobacco handmade paper and tobacco extracts as pesticides for vegetables, fruits and ornamental.</p>', 299, '2021-06-09 11:41:30', '2021-06-25 14:46:17'),
(219, '<p>This program involves the exercise of regulatory authority of the NTA, to include the supervision of tobacco trading operations, monitoring, supervision and regulatory procedures on the redrying, preliminary processing of tobacco leaf; it also covers the setting up of floor prices for tobacco through the conduct of tripartite conference Effective Enforcement of regulatory measures</p>', 300, '2021-06-09 11:41:30', '2021-06-25 15:03:10'),
(220, '<p>The New NTA building will be built along Scout Reyes St. corner Panay avenue, Quezon City, it is a 15 storey office and commercial Facilities and Penthouse building that will be provided to cater its intended use. It is design not only profitable but also helps revitalize economic activities around the area. The structural design of the building shall meet the serviceability and strength requirements stipulated in the latest structural code of the Philippines, NSCP 2015. For structurarily unfit for Occupancy</p>', 301, '2021-06-09 11:41:30', '2021-06-25 13:55:56'),
(221, 'A continuing and top priority programof the Agency, the IFOIGAP-TCGS in line with Medium TermDevelopment Plan (MTDP) of the government geareds towards increased utilization, increased yield and improved quality leaf production and increased income capacities of tobacco farmers. It promotes a market-oriented approach of production by involving the tobacco buyer firms, local government units, government financial institutions, in the provision of credit/production assistance to tobacco farmer-cooperators\n\nTobacco farmers provided with technical and production assistance', 302, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(222, '<p>This is a joint venture of NTA, DENR, tobacco-based cooperatives and tobacco companies to provide ipil-ipil seedlings to Virginia tobacco farmers for their fuelwood requirements and restore the ecological integrity of tobacco-growing regions, to help mitigate climate change through tree planting. To provide ipil-ipil seedlings to Virginia tobacco farmers for their fuelwood requirements and restore the ecological integrity of tobacco-growing regions, to help mitigate climate change through tree planting.</p>', 303, '2021-06-09 11:41:30', '2021-06-25 15:45:51'),
(223, 'The establishment of a Tobacco Research and Grading Institute is timely and appropriate in response to the ever growing clamors of tobacco farmers against adoption by the tobacco companies of uninformed international grading system which deviated from the NTA grading and classification standards and resulted in the down grading of their tobacco produce, hence lesser income derived therefrom. \n\nTo establish a training institute for the company graders, TPROs/ Agriculturists, other NTA employees, student researchers, farmers/ farmer leaders. The project shall develop and deliver an optimum policy of training and education in the transfer of knowledge and skill of the trainees on the NTA harmonized system to become effective, efficient and globally competitive.', 304, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(224, '<p>This project include the continuing registration of farmers, strengthening farm clusters, organizational development and livelihood assistance, to enable the farmers to become self-reliant, food secured and become active partners of development Conducting FOD Strategic Planning and Workshop which aims at reinventing the FOD group and and identification of the actual needs and problems of one recepient coop/association per Branch Office and construct a socio-economic activity plan</p>', 305, '2021-06-09 11:41:30', '2021-06-25 16:07:50'),
(225, '<p>The TFMP is a three-year program to modernize the conduct of field activities on tobacco production and this done by applying new technologies to increase farmers\' efficiencies of labor utilization and increased productivity and income. The program provides assistance in the form of technology and financial support in acquiring farm machineries and equipment with minimal interest of 2% per annum and one-time service fee of 1% to tobacco-based cooperatives/associations which is payable in 3 to 10 years depending on the amount availed. The cooperatives in turn can generate income through the rentals on the use of these equipment.&nbsp;</p><p>Objectives:&nbsp;</p><p>1. Provide financial support to farmers organizations in acquiring tractors and its accessories;&nbsp;</p><p>2. Provide income generation project for associations and cooperatives;&nbsp;</p><p>3. Increase the yield and net income of farmers;&nbsp;</p><p>4. Generate data/information which are essential in formulating policies for future projects of the same nature;&nbsp;</p><p>5. Evaluate the technical and economic performance of the machineries.</p>', 306, '2021-06-09 11:41:30', '2021-06-24 11:18:56'),
(226, '<p>The project will concentrate in the provision of services that ensure the quality of land, water, fertilizer and leaf tobacco, including the continuing study and monitoring of physical and chemical quality of cigarette, as an input to continuing technology adjustments standards formulation and effective regulation enforcement and compliance. Strengthen research &amp; development &amp; technology transfer</p>', 307, '2021-06-09 11:41:30', '2021-06-25 16:39:50'),
(227, 'The National Veterinary Quarantine Services Division (NVQSD) under the Bureau of Animal Industry was institutionalized in 2014 pursuant to EO No.366. As a newly created division, the construction of buildings to house the main office of the National Veterinary Quarantine Services Division and the regional stations are necessary to provide a suitable and safe workplace and working environment for the Division to facilitate the delivery of regulatory services and for its efficient operations. \r\n\r\nThe Central office building design shall include the following features:  \r\n•	Information desk\r\n•	Online application services kiosk \r\n•	Offices (chief, regulatory section, policy section, administrative unit, VQS area for three (3) Regional Cluster of the Veterinary Quarantine Stations)\r\n•	seating requirements of 20 to 50 applicants\r\n•	Meeting room or Conference hall with capacity of atleast 250 persons\r\n•	One service elevator\r\n•	Animal examination room at the ground floor\r\n•	Clients room with separate area for breastfeeding and playroom for children\r\n•	Isolation and holding room for confiscated commodities\r\n•	Fitness room\r\n•	Shared accommodation area for 50 guests\r\n•	Access and toilets for PWD and Senior Citizen\r\n•	Hard and soft landscaping works\r\n•	Employee pantries with kitchen equipment for safe and hygienic food preparation\r\n\r\nFurther, a total of Nineteen (19) out of the twenty-one VQS were identified for the design and construction of BAI-VQS regional offices.  The design and costing that will be adopted will be based on the comprehensive and cost-efficient proposal of the VQS Region II.', 308, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(228, 'The establishment of the Mindanao Centre for Livestock Disease Control and Preparedness is therefore envisaged to serve as the central office for animal disease control, surveillance and monitoring in Mindanao. With the threat of infectious and notifiable diseases in the country such as HPAI, ASF, Food and Mouth Disease, Classical Swine Fever, among others, the industry will be faced continuously on potential risk for food security. This project will enhance the surveillance and monitoring of diseases with the improvement of facility, delivery of services and its implementation of regulatory functions with adequate manpower and tools to sustain its role.', 309, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(229, '\"The Automated Licensing System shall cover receiving application, processing and issuance of the LTO, CPR, CFPR, VBPR. This will be implemented by the Animal Feeds, Veterinary Drugs and Biologics Control Division (AFVDBCD) of the Bureau of Animal Industry. The system is accessible to all interested parties as regards the:\r\n1.	Requirements and procedures to all interested parties as regards the application;\r\n2.	Final decisions concerning license applications in a timely manner;\r\n3.	Penalties for failure to comply with license requirements as stipulated in the existing rules and regulations.\"', 310, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(230, '<p>\"The Animal Disease Diagnosis and Reference Laboratory (ADDRL) is preparing for an ISO 17025 accreditation. It is essential that the laboratory is equipped with a suitable LIMS. The existing server for ADDRL’s LIMS uses an ordinary desktop computer thus the internet connectivity is very slow and the in-house developed program is outdated and has a limited security feature. In addition, the ADDRL system is not compatible with the BAI-PhilAHIS server. Because of these limitations, the objective of having a good data management system cannot be fully implemented. \"</p>', 311, '2021-06-09 11:41:30', '2021-06-09 17:12:46'),
(233, '<p>The establishment of Organik Konek, also known as Organic Agriculture Hub, shall serve as a one-stop shop in a municipality or province that will address the challenges of organic farmers such as lack of organic inputs, marketing, high cost of organic products among others. It shall serve as a business integrator of organic farms, that is, producing and supplying organic inputs, providing farm services, as well as the consolidating and marketing of the produce of organic farms. Organik Konek may also function as an avenue for the implementation of Participatory Guarantee System (PGS).</p>', 315, '2021-06-09 22:03:05', '2021-06-09 22:03:05'),
(234, '<p>The AFMechERN Center will become a national premier repository of mechanization-related data and information that can be accessed by stakeholders either physically or via the world wide web The center, with the building and other IT infrastructure,, are necessary for handling additional staff, bigger databases and other information systems for the AFMechERN\'s nationwide data collection, maintenance and interconnectivities</p>', 316, '2021-06-09 23:20:04', '2021-06-09 23:35:40'),
(235, '<p>Republic Act 11524, otherwise known as the \"Coconut Farmers and Industry Trust Fund Act,\" mandates PHilMech to implement shared facilities for coconut processing (SFCP), wherein 10% of the annual allocation from the Trust Fund is provided. The beneficiaries of the SFCPs are coconut farmers &nbsp;cooperatives, in the absence of which are the local government units (LGUs) of identified coconut producing towns.<br>&nbsp;</p>', 317, '2021-06-10 00:28:11', '2021-09-01 13:12:33'),
(237, '<p>In support to agri-tourism, BPI-LBNCRDPSC proposed and established the S&amp;S Plaza which is strategically situated at the back of DOST-PCAARRD Technology Innovation Center (DPITC) building. The plaza generally aims to promote different technologies on planting material preparation as showcased in different edible landscape designs. This locally-funded project aims to transform the S&amp;S Plaza into a SciCAT Farm Enterprise that will serve as one of Laguna’s main tourist farm attraction showcasing BPI and PCAARRD developed technologies. To transform the S&amp;S Plaza into a SciCAT Farm Enterprise that will serve as one of Laguna’s main tourist farm attraction showcasing BPI and DOST-PCAARRD developed technologies. Specific: Phase 1: Planning To provide the necessary information to UP ISSI in their preparation of the farm profile of the S&amp;S Plaza To participate in the preparation of the Feasibility Study (FS) of Business Plan (BP) of UP ISSI for the S&amp;S Plaza Phase 2: Development To establish a showcase of selected POTs at the S&amp;S Plaza. To document experiences, best practices, and lessons learned during the alignment and or transformation of the farm into SciCAT. To contribute in the development and introduction of SciCAT as a new technology transfer modality. To participate in expanding linkages and networks of SciCAT sites in terms of production, postharvest, and marketing activities. To increase visibility and market awareness by introducing tourism services and recreational activities such as farm tour, basic farming, health and wellness etc. and; To comply with the requirements for the initial Department of Tourism (DOT) accreditation of the S&amp;S Plaza.</p>', 319, '2021-06-11 12:19:38', '2021-06-11 12:26:22'),
(238, '<p>The project aims to:&nbsp;</p><ol><li>To establish area for production of quality planting materials of vegetables, herbs and fruit trees;</li><li>To showcase nursery management on seedling production of vegetables, herbs and fruit trees; and</li></ol>', 320, '2021-06-11 12:40:05', '2021-06-11 12:40:05'),
(239, '<p>Provision of livelihood projects to the displaced families of APECO</p>', 321, '2021-06-11 12:52:53', '2021-06-11 12:52:53'),
(240, 'This project will cover three (3) sub-projects which include the following:\na. Total Mixed Ration Formulation and Production\nb. Dairy Machinery Standards Design and Development\nc. Farm and Plant Waste Management\n\nPromote total mixed ration (TMR) fro animal health inprovement, define standards for equipment as to the nature of materials including applicability and\nefficiency of the machineries commonly used in dairy farming operationsand, Benchmark and prospect technological practices of Japans Waste water treatment for\ndairy farms and processing plants for the development of  the Philippine dairy industry.', 322, '2021-06-14 08:38:14', '2021-06-14 08:38:14'),
(241, '<p>The proposed project in Labason, province of Zamboanga del Norte, involves the construction of a fish port equipped with landing and trading, and other support facilities, that will cater to the unloading and trading activities of fishermen and fish traders in the locality generally serving as link between the fish production areas and the consumer/markets. The proposed Municipal Fish Port is aimed to provide Labason with adequate post harvest facility that will facilitate the handling and distribution of fish and fishery products efficiently and effectively ensuring food security and sustain incomes of fishery-based households and enterprises in the area.</p><p><br>&nbsp;</p>', 323, '2021-06-14 13:55:35', '2021-06-14 13:55:35'),
(242, '<p>These are services for the provision of agricultural fishery inputs to the targeted beneficiaries and/ or partner entities with the aim of increasing the level of crops, fishery, and livestock and poultry procution</p>', 324, '2021-06-14 14:12:11', '2021-06-23 14:37:48');
INSERT INTO `project_descriptions` (`id`, `description`, `project_id`, `created_at`, `updated_at`) VALUES
(243, '<p>These are formal studies that are supported and conducted/funded for a particular duration to:&nbsp;<br>a) generate new knowledge, information, or innovation;&nbsp;<br>b) enhance or improve the existing scientific knowledge base; or&nbsp;<br>c) generate practical applications of the existing scientific knowledge base.<br>&nbsp;</p>', 325, '2021-06-14 15:50:44', '2021-06-25 16:01:50'),
(244, '<p>The project will work at the global, regional, and national level to strengthen and develop seaweed value chains. The project will work in the South China Sea, and will be aligned with the Strategic Action Plan. More specifically, the project will work in the coastal and marine ecosystems of Viet Nam and Philippines, where potential for the expansion of seaweed aquaculture and seaweed aquaculture value chains exists. Seaweed farming is growing as a lucrative business in coastal provinces - farmed as a foodstuff and in food processing, as well as cosmetics and medical industries. The livelihoods of the people who live in these coastal areas depend on the quality of water and habitat in these rich marine ecosystems.</p>', 326, '2021-06-18 10:12:38', '2021-06-21 14:13:14'),
(245, '<p>The expanded Tobacco Farmers\' Production Assistance through the Tobacco Contract Growing System (TCGS) will include the provision of production assistance, technical and marketing assistance, and subsidy on fertilizer/pesticides to tobacco farmer cooperators. &nbsp;It aims to expand to cover more registered tobacco farmers , to be able to address the quantity and quality demanded by domestic and export market.</p>', 327, '2021-06-24 09:54:11', '2021-06-24 10:07:00'),
(246, '<p>In light of the typhoon Vamco (Ulysess) in 2020, the DA has mobilized a Quick Response Fund to activate various interventions as an initial response to affected agricultural communities but has expressed the need for complementary support from FAO. According to DA, the priority would be to provide rice and corn seeds to as many farmers, thus allowing them to catch the December/January planting period. The project will contribute to and complement this effort by providing technically sound and compatible agriculture and fisheries inputs (e.g. fertilizers, vegetable seeds, and gill nets) that can help replenish lost resources and improve the productivity, particularly of corn farmers and fishers (inland aquaculture). At the same time, the project will also deliver cash transfers that give a purchasing power to vulnerable people to access food and basic needs while waiting for the next harvest&nbsp;season.</p><p>The project will also contribute to the broader efforts of World Food Programme (WFP) in supporting the Department of Social Welfare and Development’s (DSWD) disaster response and FAO in responding to the needs of Typhoon Vamco-affected agricultural areas, particularly through the restoration of agricultural livelihoods and improvement of food and nutrition security. The interventions of the other related FAO initiatives will complement this, wherein beneficiaries of this project may be included as participants in the capacity building activities supported by other projects.</p><p>This joint project is an integral component of the Food Security and Agriculture Cluster Operational Delivery Plan, which is part of the Philippines HCT’s Humanitarian Needs and Priorities (HNP) for typhoons Goni and Vamco, and the government’s efforts of restoring the agriculture-based livelihoods of affected farmers.</p>', 328, '2021-06-24 10:09:21', '2021-06-24 10:09:21'),
(247, '<p>Successful tobacco production depends on the availability of uniform, healthy and strong seedlings of the desired tobacco variety needed by the end users. &nbsp;Seedlings should be ready early, there is ease in handling and should have less damage while transplanting. &nbsp;Good seedlings have better root development, better field establishment and improved crop stand. &nbsp;Based on research studies, 40% of the problem in tobacco production is due to poor seedling production/ management. &nbsp;Th project will be implemented to provide free seedlings to tobacco farmers using three tobacco types namely: Virginia (Improved flavor), Burley Improved and Traditional and Native (LP2 and Batek) &nbsp; &nbsp;</p><p>To produce quallity seedlings with good root system and supply the needs with the advocacy of early planting of the tobacco farmers; To build a seedling production setting which is climate change resilient and can have substantial quantity of seeds; &nbsp;To evaluate the components of the seedling technology for further study and testing.<br>&nbsp;</p>', 329, '2021-06-24 11:39:02', '2021-06-24 11:39:02'),
(248, '<p>With the end view of improving the economic and living condition and raise the quality of life of tobacco farmers and other dependents of the local tobacco industry, &nbsp;the farmers\' organization, together with NTA, identifies a farm cluster of between 6 to 10 hectares, &nbsp;as an immediate adoption area, will be serviced by a &nbsp;solar powered irrigation powered irrigation system including installation to be implemented with registered tobacco farmers\' cooperatives/ associations/federations as a beneficiary/co-implementer.</p><p>a) to establish integrated farming system on block farms that will showcase an area-based, yield increasing, quality &nbsp;enhancing, income augmenting production using the SPIS; &nbsp;b) to validate/evaluate processes and results of implementation and come up with area-specific locally-fine tuned technology applications; &nbsp;c) to accelerate transfer/diffusion and eventual adoption of said NTA-recommended technological applications for the benefit of the tobacco-growing communities.</p><p>&nbsp;</p>', 330, '2021-06-24 12:14:33', '2021-06-24 12:14:33'),
(249, '<p>This will be funded under the FAO Technical Cooperation Programme (TCP) of FAO Regional Office for Asia and the Pacific and has considered the Philippines as one of the target countries.</p>', 331, '2021-06-24 13:14:12', '2021-06-24 13:18:09'),
(250, '<p>The project will target 1,850 severely affected abaca farmers (including agrarian reform beneficiaries) and fishers and their households, particularly women-headed households, and IPs in the province of Catanduanes, whose livelihoods have been severely affected.<br>The project will complement the Government’s Pantawid Pamilyang Pilipino Programme (4Ps) that provides shelter assistance to the typhoon affected population and considering waving the conditionality of its regular cash transfer to ensure that beneficiaries get the full grant (estimated at USD 28 (PhP 1,350)/month at least for the period August – September 2020).</p>', 332, '2021-06-24 14:06:56', '2021-06-25 15:06:02'),
(251, '<p>With the constantly increasing population in the Philippines that leads to the continuous struggle to meet the domestic demands of rice production, provision of farmer\'s need-based necessities are one of the key to maximized rice production. &nbsp;To address the need to increase rice yield in the MMIP area, the project will implement major interventions in rice areas in Region XII &amp; ARMM to toughen farmers\' food security, poverty alleviation, and climate risk resilient.<br>&nbsp;</p>', 333, '2021-06-24 14:37:16', '2021-06-24 14:37:16'),
(252, '<p>Infrastructure development &amp; equipment procurement, technical capability strengthening, rice biotechnology R&amp;D, and R&amp;D network/linkages.</p>', 334, '2021-06-25 10:21:30', '2021-06-25 10:21:30'),
(253, '<p>As part of the government’s efforts to support the agriculture sector and hasten its recovery from the effects of the COVID-19 pandemic, the Republic Act No. 11469 or the Bayanihan We Recover as One Act was signed into law by the President on September 11, 2020. The Department of Agriculture received Php 24 Billion under the said act. From that allocation, the National Livestock Program was allotted a total of Php 678 Million to implement two (2) flagship projects intended to aid and revitalize the local livestock and poultry sector- the (1) Nucleus and Multiplier Breeder Farms for Poultry, Swine, and Small Ruminants with a budget of Php 500 Million, and the (2) Cattle Feedlot Fattening Project with a budget of Php 178 Million. These projects will be implemented by the National Livestock Program (NLP) through its Operating Units (OUs) and in partnership with external stakeholders such as Local Government Units (LGUs), State Universities and Colleges (SUCs), Civil Society Organizations (CSO), and Farmer Cooperatives and Associations (FCAs). Major components of these projects involve the said external stakeholders as partner implementors, hence the involvement of fund transfers and other necessary coordination mechanisms.</p>', 335, '2021-06-25 11:07:28', '2021-06-25 11:18:49'),
(254, '<p>Increased production of high-quality F1 seed and increased productivity in hybrid rice in hybrid rice in Nueva Ecija, La Union, Pangasinan, and Iloilo</p>', 336, '2021-06-25 12:51:02', '2021-06-25 12:51:02'),
(255, '<p>Capacity-building for farmers, aggregators and establishment of value-chain and market &nbsp;linkages;<br>Improving access to agricultural financial services;<br>Development of digital monitoring and information sharing system for farmers; and<br>Documentation and sharing of lessons learnt.</p>', 337, '2021-06-25 14:57:00', '2021-06-25 15:05:24'),
(256, '<p>N/A</p>', 338, '2021-06-30 15:04:30', '2021-06-30 15:04:30'),
(257, '<p>Construction of Farm-to-Market Roads and Provision of Livelihood in various barangays of Quirino and Nueva Vizcaya</p>', 339, '2021-06-30 15:05:32', '2021-06-30 15:19:09'),
(258, '<p>N/A</p>', 340, '2021-06-30 15:07:50', '2021-06-30 15:07:50'),
(259, '<p>N/A</p>', 341, '2021-06-30 15:09:44', '2021-06-30 15:09:44'),
(260, '<p>The National Food Consumption Quantification Study is one of the 10 Priority Projects of the Department of Agriculture under the Basic Foundations of a sound agriculture and fisheries program. It aims to contribute to the discussion of how achieving food security might be attained, by looking into how specific critical factors of consumption and production of selected commodities must be managed, controlled, or provided by responsible agencies or groups.</p><p>&nbsp;</p><p>$1 = P50</p>', 342, '2021-06-30 15:16:47', '2021-06-30 15:16:47'),
