INSERT INTO `project_disbursements` (`id`, `uuid`, `project_id`, `y2016`, `y2017`, `y2018`, `y2019`, `y2020`, `y2021`, `y2022`, `y2023`, `y2024`, `y2025`, `created_at`, `updated_at`) VALUES
