INSERT INTO `project_expected_outputs` (`id`, `expected_outputs`, `project_id`, `created_at`, `updated_at`) VALUES
(1, '<p>Institutionalized National Soil Health Program Mobile soils Lab cum Community Farm Clinic Strengthened partnership of stakeholders (BSWM, Regional Soil Laboratories, Local Government Units, and Rural Based Institutions)</p>', 15, '2021-06-09 11:41:30', '2021-06-22 16:56:45'),
(2, '<p>Compliance to fisheries policies and regulations, traceability of catch, safety of fisherman at sea and curbing Illegal, Unreported and Unregulated fishing activities.</p>', 19, '2021-06-09 11:41:30', '2021-06-10 13:19:06'),
(3, '<p>1. Smart state-of-the-art multi-species hatchery facility (0.5ha) 2. Pilot culture facilities including marine fish cage for grouper and pompano rearing (1ha) and mud crab fattening facility (crab condominium) of 2,000 crab capacity (0.2ha) 3. Trained personnel including trained technicians, fishers, officials and other stakeholders in RO Korea on hatchery and aquaculture (100 pax for 5 years) and technicians taken intensive training course for hatchery (2 months in RO Korea x 10 pax) as well as on-site trainings (200 pax for 5 years) 4. Restored marine ecosystem through scientific research on habitat and species with a conservation plan developed 5. Institutionalized fisheries cooperative for operating KOICA supported facilities with proper mandates</p>', 16, '2021-06-09 11:41:30', '2021-06-11 12:03:00'),
(4, '<p>1. Upgraded fishport and landing center 2. Established post harvest facilities 3. Handliner boats &amp; payaos 4. Established ancillary industry (fishing supplies, fuel supply, boat maintenance/repair)</p>', 17, '2021-06-09 11:41:30', '2021-06-11 12:01:50'),
(6, '<p>1. 10 units of fish cages and 10-cell grid mooring system 2. 60 units of floating guard house 3. 60 units harvest platforms 4. 240 modules of shellfish or seaweeds 5. hatcheries 6. nurseries 7. Toll Processing Facility 8. IT equipment 9. capacity building 10. Environmental assessment, administration and monitoring</p>', 18, '2021-06-09 11:41:30', '2021-06-11 12:02:23'),
(7, '<p>• Conducted on-station trials of different leafy vegetables under protective structures (low-cost net-tunnel and greenhouse condition) and open field cultivation. • Economic analysis of using protective structures and conventional method in growing leafy vegetables. • Conducted on-farm planting of leafy vegetables under low-cost net-tunnel technology in the sites of 3 identified cooperators and adopters in Laguna. • Identified additional adopters of net-tunnel technology. • Assessed income of identified technology adopters. • Updated and distributed developed IEC materials • Conducted capacity building activities such as trainings/seminars and field days to showcase and disseminate generated technologies of the project. • Prepared posters and/or technical papers on the information and technology generated by the project for presentation/publication to local/international conferences.</p>', 42, '2021-06-09 11:41:30', '2021-06-24 08:27:41'),
(8, '<p>1. Provide the country with greater capabilities to properly implement ocean laws and regulations, thereby safeguarding the dwindling and fragile marine resources in some of the critical parts of the Philippine waters and its 200 miles Exclusive Economic Zone;<br>2. Provide deterrence against all forms of illegal, unreported and unregulated fishing activities;<br>3. Facilitate the collection of fisheries information, such as fishing effort, catches, and other pertinent data in the formulation of rational decisions, policies and laws regarding ocean planning, management and enforcement;<br>4. Provide the country floating platform to continuously conduct MCS activities both within the Philippine waters but also in the high seas of the Western and Central Pacific Ocean and;<br>5. Increase the capability of the country to provide safety at sea to the fisherman during emergencies and conduct search and rescue operation when needed; and<br>6. Provide immediate response during the conduct relief operations and transportation of essential food commodities in to various areas affected by calamities.</p>', 20, '2021-06-09 11:41:30', '2021-06-25 08:39:45'),
(9, '<p>Component 1: 1. FMA plans, support law enforcement, spatial planning for aquaculture and coastal resilience, harmonized national standards/guidelines for post-harvest and processing, and support co-management 2. (i) integrated monitoring control and surveillance (MCS) system with investments in equipment, facilities and human capacity including MCS control centers, technologies such as vessel monitoring systems (VMS), automatic identification systems (AIS), communications, remote sensing, and equipment for electronic catch documentation; (ii) protocols for dealing with offenders; regional collaboration on combatting IUU; and (iv) co-management processes, including community surveillance or volunteer groups. 3. technology, equipment and facilities for critical habitats management including MPAs; and (iii) rehabilitated fish sanctuaries, coral and artificial reefs, wetland, and mangroves. Component 2: 1. Modern and resilient livelihood investments for capture, aquaculture and post-harvest. 2. Enabling private sector access to financing</p>', 21, '2021-06-09 11:41:30', '2021-06-10 09:57:38'),
(10, '1. Purchased 17 units floating long reach excavator/back hoe. \r\n2. Purchased 3 units motorized barges \r\n3. Purchased 6 units suction pumps with 25 meters hose\r\n4. Purchased units dump trucks\r\n5. Excavated  1,275,500 cubic meter mud/silt deposit\r\n6. Increased productivity of aquaculture production area from current level of 1.61 mT/ha/yr to 5.485 mT/ha/yr', 22, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(11, '<p>agro-treatment facilities established Compost produced</p>', 23, '2021-06-09 11:41:30', '2021-06-22 16:58:42'),
(12, '<p>Increased capacities of key duty bearers to provide enabling environment for claim holders Improved access to an enhanced natural resource base, sustainable energy and cleaner environment.</p>', 24, '2021-06-09 11:41:30', '2021-06-10 15:06:24'),
(13, '<p>103 watch towers, 11 bay management buildings, 121 patrol boats, 11 fish landing facilities, fishery and coastal resource habitat rehabilitation, rehabilitation of 8 hatcheries, 2,586 livelihood projects, 515 solar driers with storage, 49 ice makers and 294 chest freezers</p>', 25, '2021-06-09 11:41:30', '2021-07-06 09:31:46'),
(14, '<p>rainwater harvesting structures constructed and rehabilitated</p>', 26, '2021-06-09 11:41:30', '2021-06-22 17:00:09'),
(15, '1. Capture:                                           \r\n   Fishing gear paraphernalia distributed\r\n2. Aquaculture\r\n   a. Fingerlings distributed\r\n   b. Seaweed propagule distributed\r\n   c. Seaweed farm implements distributed\r\n   d. Cages for livelihood distributed\r\n   e. Techno-demo established\r\n3. Post harvest equipment distributed\r\n4. Number of Trainings conducted', 27, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(16, '<p>1. 20% increase in annual farm yield, counting both coconut and other crops, by the end of 4 years;&nbsp;</p><p>2. 500 coconut farmers have increased net income by 15% in average, including the income from coconut as well as from other crops;&nbsp;</p><p>3. 75% of coconut farmers in the project are compliant with the Sustainable Agriculture Initiative - Farm Sustainability Assessment (SAI-FSA 8 ) standards;</p><p>&nbsp;4. 75% of coconut farmers in the project confirm at least two enhanced delivery of support services to farmers (e.g. market opportunities/linkages, demo sites).</p>', 261, '2021-06-09 11:41:30', '2021-06-24 08:03:35'),
(17, '<p>Upgraded regional fish port</p>', 114, '2021-06-09 11:41:30', '2021-06-10 14:01:41'),
(18, '<p>1. Beneficiaries were provided with technical assistance, trainings, and production and livelihood support/services in both aquaculture and capture fisheries; 2. Violations and applications for permits, licenses, etc. are acted upon; 3. Fishery facilities and products are monitored; 4. New fisheries policies are formulated and some of the existing ones are reviewed.</p>', 29, '2021-06-09 11:41:30', '2021-06-17 10:22:24'),
(19, '<p>market-related events conducted/funded/assisted, market-related infrastructure established</p>', 259, '2021-06-09 11:41:30', '2021-06-17 10:29:23'),
(20, '<p>- training activities conducted - IEC materials disseminated - technology demonstration established/maintained</p>', 260, '2021-06-09 11:41:30', '2021-07-05 10:45:40'),
(21, '<p>Agricultural Enterprises Development for Food Sustainability Project established</p>', 248, '2021-06-09 11:41:30', '2021-06-24 09:43:32'),
(22, '<p>1 or 2 varieties of garlic adapted to location trials for bulb production and 1 or 2 varities with potential to produce bulbils for bulbils production as source of clean planting materials</p>', 30, '2021-06-09 11:41:30', '2021-06-25 15:27:44'),
(23, 'Consistent with the aspirations of the DA Halal Program, the following are the specific objectives of the project:  \r\n\r\n1.        Establishment of DA Halal-related policies;\r\n2.        Development of Halal standards and enabling regulations;\r\n3.        Increased Halal agri-fishery production;\r\n4.        Establishment and upgrading of Halal infrastructure;\r\n5.        Capability building activities and develop IEC materials and quad-media promotions on Halal;\r\n6.        Establishment of Halal linkage and networking; and\r\n7.        Promotion of Halal food products;\r\n8.        Development of researches on Halal Food.', 274, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(24, '<p>• Establishment of five (5) mungbean technology demonstration areas for farmers\'s adoption • Cost - benefit analysis of the management strategies • Increase in mungbean yield from the cooperator\'s field by at least 5% by the end of the project • Training of 200 mungbean growers by the end of the project • Seed multiplication to about one thousand five hundred (1500) kilograms foundation seeds of mungbean for distribution to farmers • At least one (1) accredited mungbean seed growers by the end of the project • Production of one (1) IEC material for distribution to different stakeholders</p>', 32, '2021-06-09 11:41:30', '2021-06-25 16:02:54'),
(25, 'Volume of production increased', 268, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(26, '<p>By the end of the project period, the project would have: 1. Established a solar power generation system for: a. Five (5) existing Milk Collection Centers in Pilot Areas in Luzon, Visayas and Mindanao b. Five (5) existing Milking Parlors in Pilot Areas in Luzon, Visayas and Mindanao 2. Significant decrease in power expenses of the pilot dairy farms and milk collection centers 3. Promote use of renewable energy</p>', 269, '2021-06-09 11:41:30', '2021-06-24 14:47:06'),
(27, '<p>Identified 3 promising lines/ varieties for registration selected 3 disease resistant fixed line accomplished 1 scientific paper drafted 1 policy proposal conducted characteristic evaluation for breeding lines conducted 1 training for farmers prepared 1 IEC material accomplished 1 PR (radio, television, others).</p>', 35, '2021-06-09 11:41:30', '2021-06-23 15:35:05'),
(28, '<p>A rapid and cost-effective method in the identification/detection of insect pests will help in preventing further spread of pests subsequently preventing damages to Philippine Agriculture/farmers thereby increasing productivity – harvest and income. This project is expected to produce Plant Quarantine Officers which are equipped in the use of Remote Microscopy System at six (6) key quarantine stations where high volume of imported/exported agricultural commodities is being handled for inspection.</p>', 36, '2021-06-09 11:41:30', '2021-06-22 15:13:45'),
(29, 'Strengthened institutional and regulatory systems for climate-responsive planning and development for agrometeorological information systems and mainstreaming CRA in local plans and investments; \r\nIncreased generation and use of climate information in decision-making by support institutions and farming communities;\r\nStrengthened adaptive capacity and reduced exposure to climate risks of vulnerable farming households and communities.', 270, '2021-06-09 11:41:30', '2021-06-09 11:41:30'),
(30, '<p>Sustainable production of high quality seeds and planting materials and conservation of foundations stocks of different fruit trees and other crops.</p>', 39, '2021-06-09 11:41:30', '2021-06-22 14:29:08'),
(31, '<p>A vegetable edible Park within the Regional Government Center (RGC) will be developed and technologies on growing organic fruits and vegetables will be showcased/disseminated.</p>', 40, '2021-06-09 11:41:30', '2021-06-22 15:28:02'),
