(49, '<p>- Delivery of appropriate development support services - Facilitate and harmonize development interventions in the strategic production areas/zones - Facilitate and promote access to local and international market - Proactive management actions on demand and supply situation The Thrusts and Priorities include: - Advancement of efficiency level of farm operation and management - Enhance productivity and production of priority commodities - Advancement of efficiency level of farm operation and management - Compliance with export protocol and product standards - Support for the processing and value adding of high value crops - High value crops linked to local and international markets - Steady supply and prices of priority commodities - Promotion of food security in schools and communities by introducing the values of basic food production Strategic Directions: - Provide quality planting materials for priority commodities to enhance productivity and production - Improve commodity competitiveness in order to reduce importation of various vegetables - Employ value chain analysis approach as tool for value adding and product development - Productivity enhancement through the conduct of technology demonstration on the proper management of old trees (rejuvenation and rehabilitation program)</p>', 58, '2021-06-09 11:41:30', '2021-07-13 15:26:51'),
