(92, '<p>1. Key policy instruments favoring ABD conservation developed at national and local level; 2. Specific guidelines for the implementation of policies formulated for the three pilot project areas; 3. Strengthened capacities and mechanisms for addressing interdisciplinary aspects of ABD conservation; 4. Local government plans and programs in pilot municipalities providing for ABD conservation; 5. Community level planning and governance frameworks in pilot communities incorporating ABD considerations; 6. Community-based gene management systems and networks supported by ex-situ collections held by national institutions; 7. ABD resources, agroecosystens abd their management practices mapped, characterized and documented in the pilot areas; 8. Knowledge sharinf on ABD management and conservation practice for farmers in pilot and neighboring communities; 9. Inclusion of ABD issues in primary, secondary and tertiary education and IKSP programs in the pilot provinces; 10. Access to tools, equipment and facilities for improving productivity and sustainability, and reducing post-harvest losses; 11. Recognition of distinctive ABD and cultural importance of target sites and products, to support certification and marketing; 12. Detailed market-valuation analyses conducted to assess the specific marketability of indigenous varieties as premium market products; 13. Capacity development for business planning, product developmetn and marketing, to increase farmers\' abilities to se</p>', 107, '2021-06-09 11:41:30', '2021-06-23 10:23:03'),
