(108, '<figure class=\"table\"><table><tbody><tr><td>The RCEF-Seed and Extension Programs aim to increase the adoption of certified inbred rice seeds and, consequently, its corresponding ICM. Specifically, they aim to:<br>1) increase utilization of certified inbred rice seeds in provinces with high potential of increasing competitiveness;<br>2) improve quality, availability of and access to certified rice inbred seeds; and<br>3) increase the number of organized farmers engaged in seed production and trade.<br>&nbsp;</td></tr></tbody></table></figure>', 123, '2021-06-09 11:41:31', '2021-06-09 19:42:43'),
(109, '<p>\"The project aims at improving the local capacity of the participating countries to develop competitive, inclusive and gender-responsive rice value chains. The project outputs will include: ● Policy development processes and sharing of best practices on rice policies among the Republic of Korea and target countries supported; ● Training curriculum focusing on the rice value chain piloted in targeted countries; ● Rice research/training/extension institutions strengthened in targeted countries; and ● Trainers trained for disseminating knowledge and experience to stakeholders, including smallholder farmers, through designated institutions \"</p>', 124, '2021-06-09 11:41:31', '2021-06-25 16:02:18'),
(110, '<p>As per approved NMIS PREXC Organizational Outcome: Meat Safety and Quality Assured Outcome Indicator: 1. Percentage of existing meat establishments and transport vehicles conforming to national and international standards for handling safe and quality meat Output Indicators: 1. Percentage increase in number of meat establishments and transport vehicles monitored and/or inspected with reports issued 2. Number of Hazard Analysis and Critical Control Point (HACCP) certified meat monitored and/or inspected with reports issued 3. Percentage of certificates and licenses issued within the prescribed period 4. Percentage of exporter and importer MEs registered and licensed within the prescribed period from the date of application</p>', 125, '2021-06-09 11:41:31', '2021-06-25 16:04:56'),
