(115, '<p>1. Establishment of ACEA at the 4 major international container ports in the country. 2. Systematic inspection procedures of animal products from all incoming imported shipments at the 4 major international container ports. 3. Conduct of laboratory tests for different transboundary animal diseases (TAD) from the samples collected prior approving the release of containers at the ports.</p>', 130, '2021-06-09 11:41:31', '2021-06-09 17:23:25'),
