(119, '<p>Harmonization of the different regulatory systems.</p>', 134, '2021-06-09 11:41:31', '2021-06-09 17:21:11'),
(122, '<p>At the end of the 5 year-engagement of the project,the following are expected to have been accomplished: 1. Trained programming team and technical veterinary team on the creation and utilization of the PhilAHIS system; 2. Adequately improved and upgraded PhilAHIS data center infrastructure, facilities and equipment to run the system; 3. Functional information system and online registration system for animal facilities, animal transport vehicles, animal traders, meat establishments and meat transport vehicles, animal feeds, drugs and biologics establishment; 4. An online permitting system for animal movement management, including meat and meat products and by-products; 5. Disease reporting through online and mobile application means that are integrated with laboratory data and government animal disease investigators’ reports; 6. All data integrated into a system that will provide real time and pertinent livestock data to program implementers and decision makers in cases of disease emergency or in forecasting of outbreaks of disease; 7. A functional communication platform within the system that allows advance and proactive exchange of information between government and stakeholders; 8. Properly deployed system and installed equipment; 9. Trained animal industry stakeholders on the use of the PhilAHIS; and 10. An enabling legislation the will support use of PhilAHIS.</p>', 137, '2021-06-09 11:41:31', '2021-06-09 17:16:36'),
(123, '<p>As per approved NMIS PREXC Organizational Outcome: Meat Industry Developed Outcome Indicators: 1. Percentage increase in the number of LGU meat facilities that are compliant to standards and are properly operated 2. Percentage of highly urbanized LGUs performing meat inspection service Output Indicator: 1. Number of LGU Meat Inspectors trained to perform meat inspection service</p>', 138, '2021-06-09 11:41:31', '2021-06-25 16:08:19'),
(124, '<p>established optimal smart agriculture model</p>', 139, '2021-06-09 11:41:31', '2021-06-25 16:16:14'),
(126, '<p>Modernized BAI Laboratories</p>', 141, '2021-06-09 11:41:31', '2021-06-09 19:24:40'),
(129, '<p>To acquire additional / needed drying facility for the palay procurement and stocks maintenance of NFA.</p>', 144, '2021-06-09 11:41:31', '2021-07-06 14:49:04'),
(130, '<p>Mill the right quantity of rice buffer stocks, and in accordance with schedule</p>', 145, '2021-06-09 11:41:31', '2021-06-21 15:03:46'),
(133, 'Construction of integrated testing laboratories, procurement of updated laboratory tools and equipment, conduct/provision of training/s to technical personnel, conduct of product sampling/monitoring including crop and livestock production, conduct of testing services, program management and planning and reviews.', 169, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(134, '(a) 16 regions with subprojects under implementation\r\n(b) 81 provinces with PCIPs prepared\r\n(c) 2,114 km of roads and 1,895 linear meters of bridges  constructed/rehabilitated \r\n(d) 2,816 hectares of irrigation services areas generated from newly constructed rehabilitated CIS\r\n(e) 22,249 households provided with access to rehabilitated/constructed PWS\r\n(f) 109 units of various pre-and-post production and marketing facilities constructed/rehabilitated\r\n(g) 660 enterprise established along the priority value chain\r\n\r\n(Above listed items are outputs of the original loan and expansion of PRDP)', 149, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(135, '(a) 16 regions with subprojects under implementation\r\n(b) 81 provinces with PCIPs prepared\r\n(c) 2,114 km of farm-to-market roads and 1,895 linear meters of bridges  constructed/rehabilitated \r\n(d) 2,816 hectares of irrigation services areas generated from newly constructed rehabilitated CIS\r\n(e) 22,249 households provided with access to rehabilitated/constructed PWS\r\n(f) 109 units of various pre-and-post production and marketing facilities constructed/rehabilitated\r\n(g) 660 enterprise established along the priority value chain\r\n\r\n(Above listed items are outputs of the original loan and expansion of PRDP)', 150, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(136, '<p>Output 1: Training Programs, Communication Support and Enterprise Development Assistance Strengthening capacities of specialists and trainers 1. By 2021, at least 2 training curricula developed 2. By 2021, at least 7 batches of rice specialists training conducted 3. By 2021, at least 25 batches of mechanization specialists training conducted 4. By 2021, at least 135 batches of Training of Trainers conducted 5. By 2021, at least 360 batches of training for Farmer Cooperative Associations conducted 6. By 2021, at least 1,350 seed growers trained on certified seed production Strengthening capacities of specialists and trainers Access to information, education, and communication services 1. By 2021, at least 8,400,000 copies of KPs Disseminated 2. By 2021, at least 30 School on Air conducted 3. By 2021, at least 1143 Info Campaigns/Technical briefings Conducted Enterprise Development Assistance 1. By 2021, 1,200 FCAs developed their business plans 2. By 2021, 75% of 1,200 FCAs started their business operation Output 2: Establishment of Farm Schools Rice-based farm school 1. By 2021, at least 100 farm schools accredited Output 3: Scholarship Program Scholarship 1. By 2021, at least 1947 competency based trainings 2. By 2021, at least 150,000 farmers availed scholarship Output 4: Program Management (for extension component) Program Management Activities Conducted 1. By 2021, at least 6 progress review reports developed 2. At least 1 mid-term assessment conducted 3. At least 1 impact assessment conducted</p>', 151, '2021-06-09 11:41:31', '2021-06-11 12:00:55'),
(137, 'Annually, NDCBAIC will have the following deliverables:  \n1.	Produced 49,920 semen straws \n2.	Served 13,440 animals at 1.5 straws per cow;\n3.	Produced 8,300 calves in which 4,000 are potential dairy heifers;\n4.	Increased the national milk output by 5.7 million liters of milk;\n5.	Benefited 2,056 dairy farmers with animal holdings.\n6.	Trained 200 undergraduate and graduate agricultural and veterinary students annually.', 153, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(138, '<p>Concrete road/driveways connecting the buildings with each other and to and from the main driveway; rehabilitated power and electrical, and drainage systems; Material Recovery Facility; new transformer and fire hydrant; chemical storage facility; among others</p>', 154, '2021-06-09 11:41:31', '2021-06-23 15:54:06'),
(140, '<p>rice production and postharvest machinery and equipment provided through the farmer cooperatives, associations (FCA)</p>', 156, '2021-06-09 11:41:31', '2021-06-23 16:04:41'),
(141, '<p>updated/established postharvest losses for selected fruits and vegetables</p>', 157, '2021-06-09 11:41:31', '2021-06-23 17:40:03'),
(142, 'Production Support:\r\n1. Distribution of rice seeds and other inputs\r\n2. Maintenance of buffer seeds for rehabilitation of damaged areas\r\n3. Construction/rehabilitation of seed storages\r\n4. Support of the DA on agricultural machinery and quick response pool\r\n\r\nMarket Development:\r\nFacilitation of market linkages (from farm to market)\r\n\r\nExtension Services:\r\n1. Training and training events conducted\r\n2. Techno demo / Model farms conducted\r\n3. Dissemination of IEC materials\r\n4. Training of trainors conducted\r\n5. Farmer Field School conducted\r\n\r\nResearch and Development:\r\n1. Number of studies to be completed within the year\r\n2. Number of continuing studies conducted\r\n3. Number of new studies to be started within the year\r\n\r\nIrrigation:\r\n1.Construction and rehabilitation of Irrigation Systems (e.g. Small Scale Irrigation Project, Solar Powered Irrigation Project)\r\n\r\nPAEF:\r\n1.Distribution of production and postharvest machinery\r\n2.Construction of post-harvest facilities', 158, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(143, 'Production and distribution of seeds and planting materials;\r\nEstablishment and Maintenance of Seed Storage Facilities;\r\nProcurement of equipment and machinery in support to DA-Station;\r\nOrganize and strengthen clusters that will increase bargaining power for farmers and facilitate market linkages for their produce;\r\nEmpower corn and cassava farmers and LGU partners through recognitions, conduct of various trainings and demonstrations relative to Good Agricultural Practices (GAP), latest technologies on cost efficiency, and appropriate mechanization and postharvest technologies;\r\nConduct of other researches on corn and cassava aimed at increased productivity and cost efficiency, such as the Site Specific Nutrient Management;\r\nProvision of agricultural machinery and equipment and construction of postharvest facilities; and\r\nProvision and construction of STW, Open Source Pumps and other alternative irrigation system (e.g. Solar Powered Irrigation System).', 159, '2021-06-09 11:41:31', '2021-06-09 11:41:31');
INSERT INTO `project_expected_outputs` (`id`, `expected_outputs`, `project_id`, `created_at`, `updated_at`) VALUES
(144, '1. Conducted research project in line to the data on rubber which covers upstream and downstream sector \r\n2. Appropriate data on the total rubber planted areas and other related aspect on rubber upstream sector was collected;\r\n3. Potential area for the conduct of research, development and programs was identified;\r\n4. Key stakeholders of rubber industry in the Philippines was recorded', 164, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(145, 'The project will develop a highly prospective agri eco-tourism in rural scenario that well serve as an avenue for sharing cultural and economic activities. Promote the stations contribution to the agri-eco tourism program and its impact to the agricultural landscape program of the DA in general and Establishes relationship in production, processing and marketing activities among farmers, traders, researches and tourist.', 175, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(146, '<p>The Carabao Cassava Cluster and Calategas Farmers Marketing Cooperative will process the cassava and corn produced in the SAMARICA area in Occidental Mindoro and Southern municipalities of Palawan. The produced by product (starch) will be marketed/delivered to Nestle Food Corporation and other potential market in the localities.</p>', 176, '2021-06-09 11:41:31', '2021-06-09 15:38:54'),
(147, 'Established Smart Greenhouse to increase production of bell pepper, improved knowledge of farmers in bell pepper; enhance distribution channel of bell pepper.', 177, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(148, '<p>1. Established PNAC regional native animal breeder and multiplier farm. 2. Continuous supply of quality breeders of native animals 3. Increased income and ready foods for local farmers 4. Native animals conserved and utilized 5. Organized regional native animal producers.</p>', 178, '2021-06-09 11:41:31', '2021-06-09 15:01:32'),
(150, 'Increased number of researches conducted and increased number of animals for livelihood assistance and job generation.', 180, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(151, '<p>Maintain zero incidence of Transbaoundary Animal Diseases</p>', 181, '2021-06-09 11:41:31', '2021-06-09 19:30:29'),
(154, '<p>Improved production facilities, animal housing, forage and pasture crops, equipment and training facilities.</p>', 184, '2021-06-09 11:41:31', '2021-07-13 10:13:54'),
(155, '<p>The main activities stipulated in the Republic Act 9482 includes mass dog vaccination and registration, dog population management, control of stray dogs, enforcement of impounding activities and information dissemination campaign.</p>', 185, '2021-06-09 11:41:31', '2021-06-09 14:38:07'),
(156, 'Development and enforcement of food safety standards and regulations for food in the primary production and postharvest stages of the food supply chain and specifically BAI shall be responsible for food derived from animals including eggs and honey production', 186, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(157, '1. Distribution of mother tanks to RFOs\r\n2. Number of AI technicians to receive incentive thru AICCI\r\n3. Number of semen producer to be provided with supplies\r\n4. Number of region to be awarded with LN2 plant\r\n5. Number of consultataive meetings', 187, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(158, '<p>improved National Veterinary Quarantine Services for the control and prevention of African Swine Fever and other Transboundary Animal Diseases</p>', 188, '2021-06-09 11:41:31', '2021-06-09 17:22:27'),
(163, 'Increased yield by 1.0 t/ha in rainfed, Reduced palay production cost by 30%; Reduce PH losses to 12% by 2022 in the Project sites', 193, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(165, '1. Provide a strong and reliable pest and disease control method by the use of quarantine stations and checkpoints for the early detection and emergency response to local and exotic animal and plant diseases that may cause negative impact on production, international trade and public health.\r\n2. Provide an efficient web-based public service in the application and approval of permits\r\n3. Ease of Business permit processing which is favorable for more business undertakings to thrive \r\n4. Provide standard guidelines for Registration, Licensing and Accreditation of agribusiness enterprises and other related businesses, including import/export sanitary and phytosanitary permits/clearances \r\n5. Monitor and maintain records of Incidences. Cases and Outbreaks of major plant pests and animal diseases and design appropriate prevention and control measures\r\n6.Systematic and scientific prevention, control and eradication of economically significant plant pests and animal diseases. \r\n7. Quality and safety assurance of food of plant and animal origin \r\n8. Conduct periodic/regular inspection of food/feed products available in the market for quality and safety assurance \r\n9. Conduct periodic/regular inspection and monitoring of food/feed/veterinary drugs and products manufacturing establishments and facilities along with their counterpart animal feeds/diagnostic laboratories \r\n10. Develop Standards/Codes for Good Practices in Agriculture (GAP), Animal Husbandry (GAHP) and Aquatic Resources (GAqP)', 195, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(166, '<p>Optimized, verified and validated LAMP protocols for the rapid detection of selected economic pests and diseases.</p>', 196, '2021-06-09 11:41:31', '2021-06-23 15:51:31'),
(167, '<p>Agromet Stations maintained trained personnel/ farmers</p>', 197, '2021-06-09 11:41:31', '2021-06-23 17:44:01'),
(168, '<p>1 ice plant and cold storage constructed in Bulan.</p>', 200, '2021-06-09 11:41:31', '2021-06-10 09:00:16'),
(169, '1 municipal fish port constructed.', 202, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(170, '1 municipal fish port constructed.', 203, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(171, '1 municipal fish port constructed.', 204, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(172, '1 regional fish port constructed', 205, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(173, 'HERD BUILD-UP\r\n1. Stock Infusion\r\n-	Procurement of Dairy Cattle\r\n-	Procurement of Dairy Goats\r\n-	Upgrading of non-dairy cattle\r\n-	Dairy Cattle regular breeding using sexed semen with slick gene\r\n2. Internal Herd Build-up\r\n-	Buyback Program\r\n-	Establishment of Breeding Farm / Calf Rearing Farm (with machineries and equipment)\r\n\r\nPRODUCTIVITY IMPROVEMENT\r\n1.	Dairy Herd Improvement\r\n-	Establishment of Feed, animal and milk Laboratory\r\n2.	Feed Resource Development\r\n-	Establishment of Feed Center with Farm Machineries and Equipment (with tractors, truck, forage choppers and other forage farm implements)\r\n3.	Animal Health Assistance\r\n-	Improving and maintaining health of dairy animals\r\n\r\nENTERPRISE DEVELOPMENT\r\n1.	Support to Enterprise\r\n-	Establishment of Dairy Hubs / Dairy Zones\r\n-	Establishment of Milk Processing facilities with provision of milking equipment ( milking machine, milk can, milk pails and implements)\r\n2.	Milk Quality and Assurance Program\r\n-	Milk Quality and Assurance Program\r\n3.	Milk Promotion / advocacy\r\n-	Improving Consumption of locally produced milk\r\n4.	Research and Development\r\n-	Market Research, new product research and animal productivity research\r\n\r\nHUMAN RESOURCE CAPACITATION\r\n1.	Capability and Competency Improvement', 206, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(174, '<p>Procurement of additional equipment and validation of methods to cater for additional target analyses in the analysis of local and imported product and to comply food safety requirements of exported products.</p>', 213, '2021-06-09 11:41:31', '2021-06-24 07:24:36'),
(175, '<p>A. Online Survey on the Good Laboratory Practices of Department of Agriculture –DA-FSRAs - Review GLP requirements as well as preparation, approval and submission of survey questionnaire to the ASEAN Secretariat for distribution to focal persons of AMSs and China - Conduct of pre-survey orientation to focal persons from AMSs and China; - Conduct of online survey to all DA-FSRA laboratories (main and regional offices) B. International Conference on the best laboratory practices of the AMSs and China - Preparation, approval and submission of the sample presentation format (e.g., Powerpoint presentation) to the ASEAN Secretariat for approval and distribution to focal persons of AMSs and China, - Each member state and China to prepare and submit a copy of presentation based on the format prepared by the IA, which will be presented during the online conference - Sending of invites to ASEAN Secretariat for distribution to AMS and China focal and other participants; collation of presentations and confirmation of participants - Conduct of three-day conference C. Final Report on the best laboratory practices of the AMSs and China - Preparation, approval and submission of evaluation report format to the ASEAN Secretariat for distribution to focal persons of AMSs and China - Each member state and China to prepare an evaluation report on the results of survey conducted in their respective countries - IA (DA-FDC) to collate final evaluation report and action plans od AMS and China, prepare draft final report on the compilation of best laboratory practices for approval, revision, finalization and submission to ASEAN Secretariat for distribution D. Published journal article on best laboratory practices utilized by AMS to improve their own laboratory practices - Preparation and approval of the journal article - Submission of AMSs and China\'s Best Laboratory Practices to an international journal publication</p>', 214, '2021-06-09 11:41:31', '2021-07-05 10:40:28'),
(177, '<p>1. Inventory, storage, and distribution of rice seeds and milled rice modernized 2. Capacity of the Philippine Rice Research Institute (PhilRice) and National Food Authority (NFA) on inventory, storage, and distribution of rice seeds and milled rice enhanced 3. Linkage among implementers and partners in the rice supply chain strengthened</p>', 216, '2021-06-09 11:41:31', '2021-06-09 19:26:29'),
(181, '<p>The intended outcome of this project is to establish the PADPP manual that is ready for implementation and that contains a list of priority animal disease, a surveillance plan for each priority disease, the needed resources of each implementing stakeholder, and the roles and responsibilities of different stakeholders.</p>', 312, '2021-06-09 11:41:31', '2021-06-25 15:56:47'),
(182, '<p>Construction of RWC Structures (SWIP, SFR, AGRS); Agricultural Land Resources Management</p>', 246, '2021-06-09 11:41:31', '2021-06-23 17:45:20'),
(183, '<p>research facility upgraded and rehabilitated</p>', 247, '2021-06-09 11:41:31', '2021-06-24 09:21:45'),
(184, '<p>Trading Post established</p>', 249, '2021-06-09 11:41:31', '2021-06-24 09:44:39'),
(185, '<p>The expected outputs of the Project are the following: 1. At the Planning Phase: Output: Draft Enhanced Vegetable Value Chain Roadmap is developed and agreed upon by FVC stakeholders, and outline of the Project is set 2. At the Implementation Phase: Output 1: Inclusive Business Model suited for target FVC are developed through capacity enhancement of FVC stakeholders Output 2: Inclusive Business Model is reviewed, updated and promoted among other FVC stakeholders.</p>', 250, '2021-06-09 11:41:31', '2021-06-25 19:27:10'),
(186, '<p>&nbsp;1.1 AD Training (Orientation, Consultation &amp; Workshop)&nbsp;<br>1.2 &nbsp;Community Organizing (including IP farmers RSBSA/PCIC registration)&nbsp;<br>1.3 Capacity Building&nbsp;<br>&nbsp;2.1 Provision of agricultural inputs, livestock, tools, machineries &amp; equipment and facilities (group of IPOs / SPs related commodities) &nbsp; &nbsp;<br>2.2 Provision of value-adding processing equipment and packaging materials &nbsp; &nbsp;<br>&nbsp;3.1 Participation to Local Trade Fair &nbsp; &nbsp;<br>3.2 Provision of assistance in Product and Enterprise Development, Market Testing, Promotion and Linkage and other logistic support &nbsp; &nbsp;&nbsp;</p>', 251, '2021-06-09 11:41:31', '2021-07-05 10:43:50'),
(187, 'As envisioned, this program shall impact the local dairy industry and the lives of the direct and indirect beneficiaries. The following are the projected effects of the program after 3 years:\r\n\r\n1.        Directly benefit 750 family recipients by providing livelihood and training\r\n2.        Increase the dairy goat population up to 20% \r\n3.        Increase the local goatsâ€™ milk production by 2.75 million L \r\n4.        Increase the local milk supply by 1%\r\n5.        Generate Php 275 Million revenue to farmers \r\n6.        Improve the genetics of local dairy goat herd\r\n7.        Benefit a total of 2,250 children who are raised from malnutrition', 254, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(188, '<p>Developed Online Management Information System for DA\'s repository of agricultural and fisheries related information</p>', 253, '2021-06-09 11:41:31', '2021-06-24 09:48:03'),
(189, '<p>Procurement of Breeding Stocks Distribution of Breeding Stocks Procurement of Semen Sexing Machine Upgrade of Training Centers Distribution of Forage Choppers Training for Organized Groups (non commulative) Provision of Marketing Assistance to Product Outlets (non cummulative) Establishment of Milk Processing Plant</p>', 255, '2021-06-09 11:41:31', '2021-06-24 07:53:25'),
(190, 'Single Integrated National Marine Environment Monitoring System for both commercial and municipal vessels established and operationalized.', 258, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(191, 'Tiya Dairy\'s TiNDAhan established', 264, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(192, 'By the end of the project period, the project would have:\n1. Designed and developed a Manual for Goat Milk and Milk Products Processing including other dairy goat by-products for small hold dairy goat farmers and processors.\n2. Promote goat’s milk and its processed products.', 266, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(193, 'Agro-waste treatment/composting facility established', 267, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(194, '<p>- No. of farmers and fisherfolk registered in the RSBSA - No. of hectares georeferenced - No. of application systems developed</p>', 275, '2021-06-09 11:41:31', '2021-06-16 16:03:07'),
(195, '<p>FPA Six-Storey Laboratory Building</p>', 276, '2021-06-09 11:41:31', '2021-06-11 12:04:28'),
(196, '1. Capacitate Agricultural technicians and farmers on the use of developed Halal protocol and standards in the production of feeds/forage for small and large ruminants\r\n2. Enhanced knowledge and skills of agricultural technicians and farmers on good agricultural practices and technologies on Halal livestock production\r\n3. Pilot testing of Halal protocol and standards in the production of feeds/forage and livestock\r\n4. Establish demonstration farms as learning sites for Halal livestock production\r\n5. Promote and desseminate information on Halal agricultural production systems in farming communities in Mindanao', 277, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(197, '1. Communities/Organized Producers Group identified and capacitated\r\n2. Capacity of national institutions for GI development and implementation established\r\n3. Development of Codes of Practice (CoP) for potential GIs and documentation', 278, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(198, '<p>Establishment of three (3) Dairy Farm Training Center</p>', 279, '2021-06-09 11:41:31', '2021-06-10 12:23:59'),
(199, 'Six (6) Dairy Value Chain Maps', 280, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(200, '1. Policy Paper - Towards a more credible and sustainable Philippine Dairy Development\n2. Adoption of the PEAK Program to Identify/Develop more Implementable Projects for Possible funding under the overseas Development Assistance (ODA)\n3. Enhanced Project Documents: a) Rural Dairy Industry Development Project, b) Partnership Arrangement and Operation of a Dairy Cattle Production and Rearing Farm Business for Dairy Development', 281, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(201, '1.)  1500 smallholder coffee farmers have increased their net farm income by 30 %;  \r\n2.) ,500 smallholder coffee farmers have increased their coffee productivity (yield/ha) in average by 50%; \r\n3.) Profitable and best-integrated farming systems with coffee are adopted by 30 % of smallholder farmers; \r\n4.) Systems of or access to local service delivery by farmer groups/organizations for smallholder coffee farmers are improved; and \r\n5.) Developed training modules and good practices on production techniques and integrated farming options are used by local stakeholders and public partners.', 282, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(202, 'The project “Strengthening Capacities of Dairy Farmers & Extension Workers” has three main outputs.\n\nOUTPUT 1: Capacity of dairy extension workers have been increased\nFirst output will be achieved by training of 20 dairy extensions workers of NDA in 4 Philippines’s regions. It will be also achieved by creation of guidebook for dairy workers on animal welfare, animal nutrition, breeding, and dairy product processing. \n\nOUTPUT 2: Capacity of dairy farmers have been increased\nSecond output will be achieved by training of 80 to 200 dairy farmers in 4 Philippines’s regions. It will be also achieved by creation of guidebook for dairy workers on animal welfare, animal nutrition, breeding, and dairy product processing. \n\nOUTPUT 3: Philippines local milk consumption have been promoted\nThird output will be achieved by creation of a website for promotion of consumption of local milk products.', 283, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(203, '1. Scientific evidence on the benefits of dairy farming published\r\n2. Dairy farming as a viable enterprise alongside other agricultural commodities promoted\r\n3. Private and government sector investments on dairy programs encourage \r\n4. poverty reduction', 284, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(204, 'Improvement of the internet and development of online reporting system and  improvement in communications', 285, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(205, '1. Remotely piloted aircrafts deployed;  and\r\n2. DA personnel capacitated.', 286, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(206, '<p>- COVID19 Test Kits Prototypes developed - Publications drafted - Webinars conducted - Partnerships with parties from AMS and ROK established - Patents or Utility Model applied</p>', 287, '2021-06-09 11:41:31', '2021-06-24 08:41:02'),
(207, '1. Number of external stakeholders trained\r\n2. Volume of milk sold\r\n3. Number of children served in milk feeding activities\r\n4. Number of Milk laboratories established/enhanced. \r\n5. Dairy farms and milk facilities audited', 288, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(208, 'Dairy machineries will be leased dairy farmers. This is an income generating project of the NDA', 289, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(209, 'Trained NDA personnel, farmers, cooperativesand processors re: \r\no Module 1. Small and Medium Dairy Farm Operation to include techniques on animal health care, feeds sourcing, fabrication of on-farm tools and implements;\r\no Module 2. Small and Medium Milk Plant Management to include materials and inventory handling, production/process scheduling, quality and safety control and distribution planning.\r\no Module 3. Dairy Product Development and Marketing in commercial and social scale to include promotion, pricing strategy and how to improve customer relations;\r\no Module 4. Information Systems Development for traceability of dairy products and animals.', 290, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(210, 'Finance the on-going business requirement of the dairy enterprise in the areas of dairy production, processing, marketing and management.', 291, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(211, 'Benchmark Study on Spain\'s Dairy Industry', 292, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(212, '1. Some 4,000 dairy farmers all over the country will be trained\r\n2. Seven (7) dairy marketing centers will be established in selected areas\r\n3. Seven (7) milk collection centers will be established in selected areas', 293, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(213, 'Mindanao ARC Dairy Project\r\n1. Capacity building\r\n2. Logistic Support\r\n3. Provision of Dairy Goats\r\n\r\nNorth Luzon ARC Dairy Project\r\n1. Malaya Development Cooperative- equipment support and Pasture Establishment \r\n2. Epiphany Multi-purpose Cooperative - upgrading of native cows and equipment support\r\n3. Cutcut II Farmers Association - Dairy Equipment support', 294, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(214, '<p>1. Established a dairy cattle production and rearing farm that will supply dairy cattle as required by farmers in existing and new dairy areas. 2. The project will produce 1,901 heads of diry cattle out of the 200 foundation stocks provided 3. A total of 13.03 million liters will be produced by the dairy cows raised in the dairy farm. 4. The dairy farm is expected to earn income from sale of milk and dairy cows.</p>', 295, '2021-06-09 11:41:31', '2021-06-10 12:51:20'),
(215, '<p>1) To increase agricultural scope and productivity; 2) To empower marginal farmers in the City through provision of trainings and uplift their way of life; 3) To provide easy and affordable access to processing plants for rice, corn, coffee, cassava and banana</p>', 296, '2021-06-09 11:41:31', '2021-06-23 09:24:36'),
(216, '1) To develop a protocol to identify and map out farm lots;\n2) To develop methodologies and tools to improve the accuracy and efficiency of data collection at the field level;\n3) to develop an information system that will contain georeferenced information on farmers profile, planting and harvesting data, damage and losses and intervention/assistance received/provided by DA and other stakeholders', 297, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(217, '1. Established smart farm and operating System\n2. Enhance distribution System and Value-added Branding', 298, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(218, '<p>• For Tobacco Hand made paper, production of various paper and novelty items with the use of tobacco stalks. • For Tobacco Extracts, use for the control of Insect Pest for mango, vegetable, veterinary, pharmaceutical and pesticide.</p>', 299, '2021-06-09 11:41:31', '2021-06-25 14:46:17'),
(219, '<p>Various commodity clearances/import/export permits</p>', 300, '2021-06-09 11:41:31', '2021-06-25 15:03:10'),
(220, '<p>NTA Buidling Constructed</p>', 301, '2021-06-09 11:41:31', '2021-06-25 13:55:56'),
(221, 'Tobacco farmers provided with technical and production assistance', 302, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(222, '<p>To provide ipil-ipil seedlings to Virginia tobacco farmers for their fuelwood requirements and restore the ecological integrity of tobacco-growing regions, to help mitigate climate change through tree planting</p>', 303, '2021-06-09 11:41:31', '2021-06-25 15:45:51'),
(223, 'a total of 11,  340 will benefit the project. A total of eignt (8) training buildings will be constructed (1 per BO). The agency will be able to generate the income for this project', 304, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(224, '<p>Conducting FOD Strategic Planning and Workshop which aims at reinventing the FOD group and and identification of the actual needs and problems of one recepient coop/association per Branch Office and construct a socio-economic activity plan</p>', 305, '2021-06-09 11:41:31', '2021-06-25 16:07:50'),
(225, '<p>No. of tractors distributed - 502;&nbsp;</p><p>No.of power tillers - 2,357;&nbsp;</p><p>No. of tobacco transplanters - 728;&nbsp;</p><p>No. of SPIS - 2,455;&nbsp;</p><p>No. of waterpumps distributed - 9,580</p>', 306, '2021-06-09 11:41:31', '2021-06-24 11:18:56'),
(226, '<p>Established quality standards of tobacco leaf and tobacco products and a techno-physical facilities and reference materials for quality determination of tobacco leaf and manufactured tobacco products</p>', 307, '2021-06-09 11:41:31', '2021-06-25 16:39:50'),
(227, 'To enhance the delivery of quarantine services and efficient implementation of quarantine regulatory functions to prevent the entry/incursion of Transboundry animal diseases and control the spread of African Swine Fever disease in the country \r\n\r\nThe effective control and prevention of ASF and other TADs cases will eventually lead to regaining the ASF country freedom status and maintain the country’s freedom status for TADs such as FMD and Avian Influenza', 308, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(228, '1.	To improve the preparedness of the country in responding to economically important diseases which may pose a threat to the livestock industry;\r\n\r\n2.	To enhance the function of the livestock industry through improvement in disease prevention, control and surveillance of infectious diseases;\r\n\r\n3.	To improve the implementation of veterinary quarantine services through strengthening its capabilities on border control to prevent the entry and spread of livestock and poultry related diseases;\r\n\r\n4.	To promote environmentally and socially sustainable agricultural livestock development as a cornerstone for economic growth.', 309, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(229, 'Development of On-line Registration and Licensing System', 310, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(230, '<p>To upgrade the Desktop system unit to tower type server for more storage capacity and for a faster deployment of the system.</p>', 311, '2021-06-09 11:41:31', '2021-06-09 17:12:46'),
(233, '<p>Organic Hub established</p>', 315, '2021-06-09 22:03:05', '2021-06-09 22:03:05'),
(234, '<p>AFMechERN building and IT infrastructure established</p>', 316, '2021-06-09 23:20:04', '2021-06-09 23:35:40'),
(235, '<p>This proposed budget is intended for the establishment of shared coconut processing facilities and for funding activities to complement the establishment and operationalization of the SFCPs. RA 11524 only provides budget for the capital outlay requirement but does not provide for a specific budget for the administrative cost in establishing the facilities, hence, PHilMech is proposing a separate budget that will be used in implementing support projects and activities for general admistration, program management, validation and selection of beneficiaries, pre-, actual, and post-bidding activities, planning and programming, monitoring and evaluation, training, and research and development (R&amp;D) project/s, in addition to the CO requirement of the SFCPs. &nbsp;&nbsp;</p>', 317, '2021-06-10 00:28:11', '2021-09-01 13:12:33'),
(237, '<p>The expected outputs of the project are the following: Products: At least 4 POTs downloaded People and Services: At least 350 farmers/farming enthusiasts trained At least 20 identified POT adopter; At least 4 actual POT adopters At least 100 monthly average visitors/tourists Publications: At least 5 IEC materials 1 social media site 4 semi-annual progress reports 1 terminal report Patents: 5 copyrighted IEC materials 1 trademark filed for SciCAT Places and Partnerships 1 SciCAT site At least 2 MOA signed Policies 1 municipal resolution recognizing the SciCAT site as municipal tourist destination</p>', 319, '2021-06-11 12:19:38', '2021-06-11 12:26:22'),
(238, '<p>Quality planting materials of selected vegetables, legumes, herbs, and fruit trees produced</p>', 320, '2021-06-11 12:40:05', '2021-06-11 12:40:05'),
(239, '<p>Provided source of livelihood to the municipality of Casiguran</p>', 321, '2021-06-11 12:52:53', '2021-06-11 12:52:53'),
(240, '1. Establishment of a specialized large-scale and fully mechanized Total Mixed Ration (TMR) production plant and supply centers in various sites of the Philippines\n2. Dairy Machinery Standards Design and Development for dairy stakeholders\n3. Farm and Plant Waste Management system for dairy stakeholders', 322, '2021-06-14 08:38:14', '2021-06-14 08:38:14'),
(241, '<p>municipal fish port</p>', 323, '2021-06-14 13:55:35', '2021-06-14 13:55:35'),
(242, '<p>-seeds distributed<br>-planting materials distributed&nbsp;<br>-fingerlings and broodstock distributed&nbsp;<br>-animals distributed<br>-fertilizers and other soil ameloriants distributed&nbsp;</p>', 324, '2021-06-14 14:12:11', '2021-06-23 14:37:48'),
(243, '<p>-technologies commercialized<br>-research and development activities funded/ conducted<br>-researcgh facilities established/ maintained</p>', 325, '2021-06-14 15:50:44', '2021-06-25 16:01:50'),
(244, '<p>1. Strengthened capacity and uptake of best practices throughout seaweed value chains, and increased participation in global seaweed coalitions.<br>2. Enabling Environment for Seaweed Aquaculture in Philippines and Viet Nam<br>3. Seaweed Value Chains (production + processing)</p>', 326, '2021-06-18 10:12:38', '2021-06-21 14:13:14'),
(245, '<p>3,808 &nbsp;tobacco farmer-cooperators assisted, covering 2,285 hectares, from Regions 1, 2 and CAR</p>', 327, '2021-06-24 09:54:11', '2021-06-24 10:07:00'),
(246, '<p>Distribution of complementary agricultural inputs for corn&nbsp;farming</p><p>Distribution of assorted vegetable seeds for&nbsp;planting</p><p>Distribution of gill&nbsp;nets</p><p>Provision of food assistance through one off unconditional cash-based transfer (CBT) to affected farmers and fisherfolk to enable them to restart/rehabilitate their disrupted agricultural activities&nbsp;</p><p>Conduct of trainings and other capacity building support on humanitarian response, coordination and preparedness for future similar shocks</p>', 328, '2021-06-24 10:09:21', '2021-06-24 10:09:21'),
(247, '<p>330 Modules, 39.6 M Seedlings</p>', 329, '2021-06-24 11:39:02', '2021-06-24 11:39:02'),
(248, '<p>142 units constructed</p>', 330, '2021-06-24 12:14:33', '2021-06-24 12:14:33'),
(249, '<p>&nbsp;</p><p>1. Enabling policy for promoting the adoption and scaling of DSR drafted and refined.<br>2. Farmers/farmers’ cooperatives as mechanization service providers (MSPs) capacitated and strengthened.<br>3. Sustainable Rice Production (SRP) standard adopted and integrated in DSR.<br>4. Stakeholder’s awareness on DSR improved by undertaking project workshops and field exhibitions of successful cases within and among beneficiary countries.</p>', 331, '2021-06-24 13:14:12', '2021-06-24 13:18:09'),
(250, '<p>1. Guidelines and cash transfer modality plans are drafted<br>2. Technical support to local partners and humanitarian actors is provided<br>3. Coordination and liaise with key stakeholders from government, humanitarian actors and financial service providers is made<br>4. Organization and distribution of cash to qualified beneficiaries made&nbsp;<br>5. Capacity-building on cash transfer and social protection to partners and<br>beneficiaries conducted<br>6. Monitoring report for the utilization of cash assistance done<br>7. End-of-Assignment report</p>', 332, '2021-06-24 14:06:56', '2021-06-25 15:06:02'),
(251, '<p>&nbsp; &nbsp; 1. Agriculture and Fishery policy Services &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp; &nbsp; 2. Provision of training and training-related events &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>&nbsp; &nbsp; 3. Technology demonstration establishment.<br>&nbsp; &nbsp; 4. Provision of Farm Production Input Assistance (FPIA)</p>', 333, '2021-06-24 14:37:16', '2021-06-24 14:37:16'),
(252, '<p>A &nbsp;state-of-the-art genomics and biotechnology facilities and manpower for the crop/rice sector are to put in place at PhilRice; A focused, resource-efficient, globally competitive and market-driven biotechnology agenda for the country\'s most important crops developed for sustained implementation;; &nbsp;Regular training programs on molecular biology and bioinformatics are packaged for different groups in the crop sector; and Strong and beneficial collaborations forged with private sector and international organizations.</p>', 334, '2021-06-25 10:21:30', '2021-06-25 10:21:30'),
(253, '<p>1. NUCLEUS AND MULTIPLIER BREEDER FARMS FOR POULTRY, SWINE, AND SMALL RUMINANTS 2. CATTLE FEEDLOT FATTENING PROJECT</p>', 335, '2021-06-25 11:07:28', '2021-06-25 11:18:49'),
(254, '<p>1. 5-75 hybrid seed producers capacitated&nbsp;<br>2. 450-500 hybrid rice cultivators capacitated&nbsp;<br>3. 10-15 seed producers accredited by the end of the project</p>', 336, '2021-06-25 12:51:02', '2021-06-25 12:51:02'),
(255, '<p>1. Developed cacao-centric farming practices and training concepts<br>2. Capacitated farmers and organization/aggregators<br>3. Financial products developed<br>4. Digital Monitoring and information sharing system developed</p>', 337, '2021-06-25 14:57:00', '2021-06-25 15:05:24'),
(256, '<p>N/A</p>', 338, '2021-06-30 15:04:30', '2021-06-30 15:04:30'),
(257, '<p>Farm-to-Market Roads in various barangays of Quirino and Nueva Vizcaya</p>', 339, '2021-06-30 15:05:32', '2021-06-30 15:19:09'),
