INSERT INTO `project_risks` (`id`, `risk`, `project_id`, `created_at`, `updated_at`) VALUES
(1, 'Implementation Risk: Availability of funds\nMitigation Strategies: Always propose in the next fiscal year, or try to look for additional fund sources aside from GAA', 15, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(2, 'Implementation Risks:\n1. Tight Project implementation planning\n2. Stability of electric power source\n\nMitigation Strategies:\n1. Involve technology provider as soon as possible in discussions related to planning and roll-out of the project.\n2. BFAR to make sure that electric power supply is available on a permanent basis, using appropriate UPS, genset for the continuation of operations.', 19, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(3, 'Implementation risk:\n1. Sustainability of the project.\n\nMitigation strategy:\n1. Close coordination with the LGUs & target beneficiaries and put them on board and will have tight agreement with them.', 16, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(4, 'The project may experience delays in procurement of supplies and materials for the livelihood intervention including limitation on physical conduct of training programs in the areas of consideration. The enterprise mechanism will be a new strategy for implementing units in the operations of the regional offices. Another risk is the non-adoption of new normal situation caused by the pandemic .	\n\nEarly procurement program through various mode shall be implemented to avoid delays of delivery. Other modes of training methods including coordination with LGUs and private operators shall be undertaken to minimize the negative effects of the pandemic.', 17, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(6, 'The pandemic situation may limit the monitoring activities of the central agency due to access to field monitoring and cause delays in coordination with the funding agency.\n\nA project management office in the localized area in regional office can be established interim with staff to focus on the problems which may be brought about by the new normal due to pandemic. Virtual online communication may be undertaken while field monitoring is still a constraint.', 18, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(7, NULL, 42, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(8, 'Implementation Risks:\n1. Delay in the approval of the plans and drawings of the vessel\n2. Delayed delivery due to customs procedures\n\nMitigation Strategies:\n1. Bid out the plans and drawings approved by any IACS prior to the start of the vessel construction to avoid delays.\n2. Contractor needs to have experience in shipping materials and technology equipment worldwide and prepare the shipping contracts with expert freight companies.', 20, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(9, 'Not yet identified. Project still under concept note preparation.', 21, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(10, 'Implementation Risks: Effect of siltation to the cultured stocks during desiltation activities	\n\nMitigation Strategies: Scheduling of the desiltation so as not to affect production schedule/operation.', 22, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(11, 'IR: Availability of funds, peace and order, natural disaster, pandemic\r\nMS: Look for another fund source', 23, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(12, '0', 24, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(13, '1.  Land title or deed of donation for selected sites should be secured during validation activities.\n2.  LGU counterpart contributions should be secured before contracting.\n\nMitigation Strategy\n1. Regular and close coordination with the LGUs and beneficiaries.', 25, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(14, 'IR: availability of funds; natural calamities, peace and order, pandemic\r\nMS: source out other institutional funding', 26, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(15, 'Some of the areas where the project are implemented experiences peace and order concerns. The delay in delivery of livelihood programs may be a problem due to pandemic situation.\n\nConstant coordination with LGUs and concerned law enforcement agencies shall be enhanced to include provision of early transfer of goods to target beneficiaries.', 27, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(16, NULL, 261, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(17, 'Implementation Risks: Unavailability of funds for project implementation; delays in the procurement for project implementation due to inclement weather; failure in procurement; and slow mobilization of the contractor	\n\nMitigation Strategies: Contracting of third party project construction supervision (CS) to track the accomplishment of the project. PFDA Project Management Office to keenly oversee the performance of the third-party consultancy services and the contractor in the completion of the project.', 114, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(18, 'Implementation Risks: \n\n1. Limited support of some LGU partners in the implementation of Projects.\n2. Reorientation activities for new administration both from the national and local which may cause delay of project implementation.\n3. Limited qualified bidder/contractor which sometimes resulted to sub-standard goods delivered.\n4. The need to realign projects to prioritize the commitments of the Management.\n5. Disapproval of proposed establishment or rehabilitation of facilities/equipment to complement the implementation of existing projects such as fingerlings production and fish landing centers.\n6. Limited manpower in the Provincial Fisheries Offices to conduct monitoring and evaluation of project beneficiaries.\n\nMitigation Strategies:\n\n1. Encourage community participation in the fabrication of some projects such as fiberglass boats to avoid bulk procurement.\n2. Realign fund to cater the commitments of the Management.\n3. Strengthen the capacity of the Provincial Fisheries Offices personnel to conduct monitoring and evaluation and hire additional personnel in areas where lacking.\n4. Develop guidelines on the timeline of providing livelihood interventions for the beneficiaries.', 29, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
