(33, 'IMPLEMENTATION RISK\nThe Bureau\'s personnel complement for the development of standards is not sufficient since the coverage of \nthe program includes different disciplines on agriculture, fisheries, and machinery.\nMITIGATION STRATEGY\nThe Bureau resorts to hiring Contact of Service Personnel which are knowledgeable on the fields of \nexpertise required in the formulation of the standards.', 272, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(34, 'Implementation Risks: \n\nOperator Error - Negligence of an operator can make the response time longer resulting to a massive failure or abnormality, damage on the system components, and reduction of energy production\n\nLack of competent manpower - Skill and experience related to the operation of an SPFS is limited and has high demand in the labor market. \n\nLack of operating budget - Some solar-PV power plants may lack sufficient working capital during a specific period. This could affect the replacements of components that needs repair. Replacement and/or hiring of competent operators may also be needed. \n\nNatural Disaster - It is difficult to predict natural hazards especially earthquakes that may affect the areas where the SPFS are installed. Natural hazards likely disrupt the operation of SPFS. 	\n\n\nMitigation Strategies:\n\nOperator Error -Operators are required to have the skill and experience to operate a SPFS and are regularly trained and refreshed on the operational procedure of the different components. They should also be monitored regularly by the third-party auditor.\n\nLack of competent manpower - Training should be done for prospective inexperienced operators. They can be trained in expert organizations/institutes. SPFS can also be designed to use lower operator requirements as an alternative. \n\nLack of operating budget - Management should come up with a budget plan that coincides with the operation plan and provides enough resources for contingencies. \n\nNatural disaster - The design of the SPFS should be able to withstand the impact of natural hazards in order to minimize the disaster impacts. A disaster management plan should be in place in order for the operation to bounce back as soon as possible.', 44, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(36, 'Implementation of the project poses no risks. Instead, the project is designed to address needs and challenges expected to arise without the projects and/or the technologies that will be developed from the projects', 46, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
