(109, 'Implementation risks:\na. Lack of ownership and support by respective governments;\nb. Lack of lesson learnt and weak dissemination of good practices to a wider audience;\nc. The language barrier between the South-South experts and national stakeholders in the field; and\nd. Limited availability of relevant expertise.\n\nMitigation strategies:\na. Identify dynamic and influential country focal points at government level. Engage with government\npartner’s from the inception of the project, and keep them fully involved, and informed during the\nimplementation period;\nb. Design and implement a robust Monitoring and Evaluation framework, systematically document\ngood practices and design key messages for stakeholders;\nc. For the English speaking countries, special attention will be put on the language aspect during the\nselection of the SSTC experts and for the French speaking country, a mechanism will be put in place to\nmitigate the constraints such as the recruitment of interpreters in the field; and\nd. Provide intensive backstopping, training, and follow-up technical assistance by FAO and\ninternational consultants where needed.', 124, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(110, 'Implementation Risks:\n1. COVID-19 pandemic\n2. Non-compliance to food regulations\n\nMitigation Strategies:\n1.1 Development of an online application for licensing and registration\n1.2 Implementation of e-payment\n2.1 Coordination with foreign counterparts and vigilant inspection of NMIS personnel at MEs\n2.2 Laboratory surveillance of imported meat', 125, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(111, 'Implementation Risks:\n1. COVID-19 pandemic\n2. Non-compliance to food regulations\n\nMitigation Strategies:\n1.1 Development of an online application for licensing and registration Implementation of e-payment\n1.2 Conduct of remote audit\n2.1 Coordination with LGU and vigilant inspection of NMIS personnel at MEs\n2.2 Laboratory surveillance of local meat', 126, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(112, 'Implementation Risk:\n1. COVID-19 pandemic\n2. Non-compliance to food regulations\n\nMitigation Strategy:\n1. Strict implementation of prevention and control programs at the office and meat establishments\n2.1 Coordination with LGU and vigilant inspection of NMIS personnel at MEs\n2.2 Laboratory surveillance of local and imported meat', 127, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(113, 'Implementation Risks:\n1. COVID-19 pandemic\n2. Retiring workforce\n3. Low number of plantilla compared to the increase in the number of meat establishments\n\nMitigation Strategies:\n1. Strict implementation of prevention and control programs at the office and meat establishments\n2. Fast-track of hiring and promotion\n3.1 Submission of Re-Organization Plan\n3.2 Deputation of LGU Meat Inspectors', 128, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
