(133, 'Implementation Risks: \na)	Lack of budget for the implementation of the program\nb)	Delay in or unsuccessful procurement\nc)	Improper planning leading to inadequate facilities and supply of consumables or to inefficient use of resources\n\nMitigation: \na)	Formulation of the National Strategic Development Plan for the Strengthening of DA Laboratory Services\nb)	Development of an Integrated Laboratory Engineering Master Plan', 169, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(134, '(1) Project Stakeholders: The risks associated with resistance and/or slow uptake of the institutional reforms in the DA on which PRDP is built on appears to be diminishing as project implementation proceeds. The Project through the Local and National Level Planning Component will release a Harmonized Planning and Budgeting Manual. that will encompass planning & Budgeting, investment planning and monitoring and evaluation manuals. This will be distributed to all DA offices, agencies, bureau, corporation. others. (2) Governance of the Implementing Agency: The risk of governance issues within the DA and as they relate to LGUs in implementing the PRDP are increasingly diminishing as implementation of the Project gathers momentum. A high degree of staff, unit/bureau and attached agency support has been developed through active program of institutional and stakeholder assessments, workshop and briefings. (3) Social and Environmental: The MRDP 2 Environmental and Management Framework and Guidelines (EMFG) have been updated to ensure that PRDP  subprojects meet the requirements/compliance on Social and Environmental aspects.', 149, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
(135, '(1) Project Stakeholders: The risks associated with resistance and/or slow uptake of the institutional reforms in the DA on which PRDP is built on appears to be diminishing as project implementation proceeds. The Project through the Local and National Level Planning Component will release a Harmonized Planning and Budgeting Manual. that will encompass planning & Budgeting, investment planning and monitoring and evaluation manuals. This will be distributed to all DA offices, agencies, bureau, corporation. others. (2) Governance of the Implementing Agency: The risk of governance issues within the DA and as they relate to LGUs in implementing the PRDP are increasingly diminishing as implementation of the Project gathers momentum. A high degree of staff, unit/bureau and attached agency support has been developed through active program of institutional and stakeholder assessments, workshop and briefings. (3) Social and Environmental: The MRDP 2 Environmental and Management Framework and Guidelines (EMFG) have been updated to ensure that PRDP  subprojects meet the requirements/compliance on Social and Environmental aspects.', 150, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
