(137, 'Implementation Risk as follows:\n1. Technical, Financial & Institutional needs are not met\n2. Availability of required breed of dairy goats and other specifications are satisfied.\n3. Organizational Issues among members of communal farms\n4. Willingness of farmers  to participate and form a cooperative\n5. Availability of experts for technical assistance\n6. Work Plan is not strictly followed as scheduled\n7. Fund disbursements are not followed as scheduled\n\nFor Mitigation Strategies\nThe mitigation of all risk is the creation of an NDA Satellite Office in ISU, Isabela. The satellite office will be created to ensure the attainment of program goals and objectives.  It shall harmonize the activities/tasks of the different cooperating entities.  Key persons from the team shall represent the project in meetings, project progress reporting and evaluation by oversight agencies.', 153, '2021-06-09 11:41:33', '2021-06-09 11:41:33'),
