INSERT INTO `project_updates` (`id`, `updates`, `updates_date`, `project_id`, `created_at`, `updated_at`) VALUES
(1, '<p>FY2020 funds were just approved and released this May 2021</p>', '2021-06-04', 15, '2021-06-09 11:41:31', '2021-06-22 16:56:45'),
(2, '<p>1. SRT Marine Systems has set-up a demo unit which was used during the European Union (EU) Audit held last December 17-21, 2018 to showcase the capability of the IMEMS. 2. Temporary installation of transponder as part of the commitment to the European Union (EU) Commission during the audit held last December. 3. Capacity-building for the installation of A100 and orientation on the VMS 100. 4. Partial equipment delivery of the 5,000 units VMS100 ready for installation to fishing vessels. On-going accreditation from the Western and Central Pacific Fisheries Commission (WCPFC). 5. On-going site assessment of the eight (8) PFDA Regional Fishports and seven (7) LGU-managed fishports which will be installed with Port and Coastal Monitoring System (Type 1). 6. On-going site assessment of the 117 municipal fishports which will be installed with Port and Coastal Monitoring System (Type 2).</p>', '2021-06-05', 19, '2021-06-09 11:41:31', '2021-06-10 13:19:06'),
(3, '<p>Proposed</p>', '2021-06-05', 16, '2021-06-09 11:41:31', '2021-06-11 12:03:00'),
(4, '<p>Proposed</p>', '2021-06-05', 17, '2021-06-09 11:41:31', '2021-06-11 12:01:50'),
(6, '<p>Already submitted the project proposal to KOICA last July 2020.</p>', '2021-06-05', 18, '2021-06-09 11:41:31', '2021-06-11 12:02:23'),
(7, '<p>• Conducted 28 on-station techno-demonstration and yield trial of different leafy vegetables under open field and protective structures (net-tunnel and greenhouse) more than 200% increase in yield of leafy vegetables in using net-tunnel • Established 1 200 m2 greenhouse in BPI-LBNCRDPSC for the conduct of trials. • Collaborated with 3 cooperators to showcase and promote the use of net-tunnel technology in growing leafy vegetables. • Identified and monitored 7 adopters of net-tunnel technology, produce are being sold to neighborhood and nearby markets. • Conducted 6 capacity building activities • Developed 3 IEC Materials • Produced and distributed 6,456 seed packets of assorted leafy vegetables and 4, 777 potlets of assorted leafy vegetable seedlings from April 2020-May 2021 • Aided the establishment of 4 greenhouses</p>', '2021-06-04', 42, '2021-06-09 11:41:31', '2021-06-24 08:27:41'),
(8, '<p>With project proposal</p>', '2021-06-25', 20, '2021-06-09 11:41:31', '2021-06-25 08:39:45'),
(9, '<p>Project still under discussion with the funding agency and bidding for pre-feasibility study preparation. Thus, there is still no Investment Targets Breakdown yet.</p>', '2021-06-05', 21, '2021-06-09 11:41:31', '2021-06-10 09:57:38'),
(10, 'Proposed for funding', '2021-06-05', 22, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(11, '<p>Just received the SARO this November.</p>', '2020-11-18', 23, '2021-06-09 11:41:31', '2021-06-22 16:58:42'),
(12, '<p>This project will start this 2018 and end on 2021.</p>', '2019-10-21', 24, '2021-06-09 11:41:31', '2021-06-10 15:06:24'),
(13, '<p>As of September 30, 2020, the cumulative physical accomplishment is 74% vis-à-vis the cumulative physical targets (from 2016 to 2020) of 99%.</p>', '2020-09-30', 25, '2021-06-09 11:41:31', '2021-07-06 09:31:46'),
(14, '<p>FY2020 budget is classified as for Later Release of 2020 - still under OP</p>', '2021-06-06', 26, '2021-06-09 11:41:31', '2021-06-22 17:00:09'),
(15, 'Ongoing', '2021-06-05', 27, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(16, '<p>N/A</p>', '2021-06-05', 261, '2021-06-09 11:41:31', '2021-06-24 08:03:35'),
(17, '<p>Project construction is ongoing.</p>', '2020-10-31', 114, '2021-06-09 11:41:31', '2021-06-10 14:01:41'),
(18, '<p>This is an ongoing regular program of the Department</p>', '2021-06-05', 29, '2021-06-09 11:41:31', '2021-06-17 10:22:24'),
(19, '<p>This is an ongoing regular program of the Department.</p>', '2021-06-05', 259, '2021-06-09 11:41:31', '2021-06-17 10:29:23'),
(20, '<p>This is an ongoing program of the Department.</p>', '2020-11-26', 260, '2021-06-09 11:41:31', '2021-07-05 10:45:40'),
(21, '<p>For implementation this year, 2021</p>', '2021-06-24', 248, '2021-06-09 11:41:31', '2021-06-24 09:43:32'),
(22, '<p>On-going oordination with Region 6 City Agriculture in San Carlos City Negros Occidental; Pio Duran, Albay; Cabuyao, Laguna, Cavite and La Trinidad, Benguet was done. Planting materials were sent through a courier and were received by the cooperators. Garlic techno demo and trial, monitoring, field harvesting and storage monitoring will be done in Cabuyao, Laguna, Pio Duran Albay and in La trinidad on October, November and December, 2021, respectively. Monitoring of garlic storage in La Trinidad will be done this June 2021. Technology demonstration area for varietal adaptability was established at the BPI-LBNCRDPSC last April 2021. and experimental area in the greenhouse is still being maintained. Trial in Pio duran Albay. Atok La Trinidad and San Carlos city Negros Occidental, initial findings of 2 varieties such as Ilocos white and Batanes white showed adapted in terms of bulb production and potential for bulbils production.</p>', '2021-06-03', 30, '2021-06-09 11:41:31', '2021-06-25 15:27:44'),
(23, 'It is a regular program of the Department and being implemented regularly.', '2021-06-07', 274, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(24, '<p>Field Evaluation was conducted last September 2. BPI – Los Baños was able to identify the most preferred variety of SASAKAKA and PASAHAMA in Siniloan, Laguna. Out of the 15 participants who participated in each evaluation, seven (7) has chosen NSIC Mg 14 as their most preferred variety in SASAKAKA. In an approximately 800 square meter area in SASAKAKA, the preferred variety, NSIC Mg 14 was planted last October 6, 2020 for seed multiplication. Also, on October 20, 2020 the first spraying of Solubor borax will be done.</p>', '2020-10-15', 32, '2021-06-09 11:41:31', '2021-06-25 16:02:54'),
(25, 'Pre-feasibilty was done by DAP through PDS. No project funding yet', '2019-10-22', 268, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(26, '<p>Final project cost will be determined after discussion with Canadian sources.</p>', '2021-06-24', 269, '2021-06-09 11:41:31', '2021-06-24 14:47:06'),
(27, '<p>Done with the adaptability trial, evaluation and characterization of 40 tomato breeding lines from the World Vegetable Center, 4 NSIC-approved varieties from the Center and 6 local breeding lines from research institutions in the country. The Center has also accomplished attending 2 virtual trainings from the WorldVeg.</p>', '2021-06-02', 35, '2021-06-09 11:41:31', '2021-06-23 15:35:05'),
(28, '<p>\"Records of Discussion\" for signature</p>', '2021-06-04', 36, '2021-06-09 11:41:31', '2021-06-22 15:13:45'),
(29, 'Undergoing DA Project Clearinghouse process', '2021-06-07', 270, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(30, '<p>Approved RDC Endorsement</p>', '2021-02-16', 39, '2021-06-09 11:41:31', '2021-06-22 14:29:08'),
(31, '<p>N/A</p>', '2020-11-24', 40, '2021-06-09 11:41:31', '2021-06-22 15:28:02'),
(32, '<p>No investment targets breakdown yet</p>', '2021-06-07', 271, '2021-06-09 11:41:31', '2021-06-10 13:20:39'),
(33, '<p>Since 2003 up to present the Bureau has developed 297 Philippine National Standards which covers Food Safety Product Standards, Food Safety Codes of Practice, End Product Quality Standards, and Codes of Practice Quality Standards</p>', '2021-06-07', 272, '2021-06-09 11:41:31', '2021-06-23 09:51:47'),
(34, '<p>Ongoing coordination to concerned offices on the remaining ICC TB requisite documents Ongoing review of ICC Core Secretariat of the economic analysis on the three scenarios.</p>', '2021-05-31', 44, '2021-06-09 11:41:31', '2021-06-22 17:07:13'),
(36, '<p>On-going</p>', '2019-10-19', 46, '2021-06-09 11:41:31', '2021-06-22 17:06:27'),
(37, '<p>with completed concept note and project proposal</p>', '2021-06-22', 47, '2021-06-09 11:41:31', '2021-06-22 17:08:04'),
(38, '<p>Approved by KOICA, finalization of pertinent documents and other requirements of KOICA</p>', '2019-10-22', 48, '2021-06-09 11:41:31', '2021-06-22 17:08:55'),
(39, 'The Project is under the review of the NDA Board and KOICA.', '2021-06-03', 199, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(40, 'Ongoing implementation, will also seek project extension for 1 year.', '2021-06-03', 198, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(41, '<p>with completed project note and concept proposal</p>', '2021-06-22', 50, '2021-06-09 11:41:31', '2021-06-22 17:10:11'),
(42, '<p>The program consists of ongoing and continuing projects of which the activities targetted for each year of implementation will have been 100% completed at the end of the year</p>', '2020-11-25', 51, '2021-06-09 11:41:31', '2021-06-22 17:11:10'),
(43, '<p>Two (2) buri processing centers were constructed in Sariaya, Quezon and Torrijos, Marindque</p>', '2021-05-27', 52, '2021-06-09 11:41:31', '2021-06-22 17:12:23'),
(44, 'Three (3) cotton processing centers had been established in Pinili Ilocos Sur; Patnongon, Antique; and Dumingag, Zamboanga Del Sur. Established cotton plantations in Ilocos Region, Iloilo, Bayawan City, Zamboanga del Norte and Sarangani.', '2021-05-27', 53, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(45, '<p>Established two (2) processing centers in Camarines Norte and Ormoc City. Established extraction facility and red spanish pineapple plantation expansion in Aklan.</p>', '2021-06-22', 54, '2021-06-09 11:41:31', '2021-09-01 13:13:13'),
(46, 'One (1) abaca tuxy buying special project was funded and to be implemented in Catanduanes. About 145,000 hectares are currently planted with abaca nationwide. 17-hectare mother block nursery for seed-derived planting materials had been established in Oriental Mindoro, Sorsogon, Leyte, Northern Samar, Zamboanga del Norte, Davao City and bago Oshiro. Seven (7) seedbanks, five (5) tissue culture laboratories, 4 (diagnostic laboratories are maintained and operated by PhilFIDA.', '2021-06-01', 55, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(48, '<p>On-going</p>', '2020-11-13', 57, '2021-06-09 11:41:31', '2021-06-25 15:42:09'),
(49, '<p>N/A</p>', '2020-12-18', 58, '2021-06-09 11:41:31', '2021-07-13 15:26:51'),
(50, '<p>As of December 31, 2020: No. of trees fertilized: 4,408,950 No. of fertilizers distributed: 274,754</p>', '2020-12-31', 59, '2021-06-09 11:41:31', '2021-06-25 08:42:54'),
(51, 'Ongoing implementation.', '2021-06-04', 256, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(52, '<p>As of September 2020, a total of 498,648 good hybrids were produced and 264,622 were distributed.</p>', '2020-09-30', 60, '2021-06-09 11:41:31', '2021-06-25 08:26:38'),
(53, '<p>For CY 2020, two (2) identified sites located in Torrijos, Marinduque and Labo, Camarines Norte have procured the coconut seednuts/seedlings to be delivered from the PCA Operated Coconut Seed Production Centers. Further, the site in Calbiga Samar shall undergo a background check prior to the approval of the Memorandum of Agreement (MOA). The total aggregate area for the mentioned seed farm sites is 38 hectares.</p>', '2020-09-30', 61, '2021-06-09 11:41:31', '2021-06-22 15:56:06'),
(54, '<p>Target implemention this year, 2022</p>', '2021-06-05', 263, '2021-06-09 11:41:31', '2021-06-24 09:52:26'),
(55, '<p>As of December 31, 2020: 11,420,324 coconut seedlings were planted</p>', '2020-12-31', 62, '2021-06-09 11:41:31', '2021-06-22 16:15:01'),
(56, '<p>As of December 31, 2020: No. of hectares intercropped: 10,704.85 No. of heads distributed: 25 No. of enterprises established: 87 No. of machineries distributed: 535</p>', '2021-12-31', 63, '2021-06-09 11:41:31', '2021-06-21 20:48:42'),
(57, '<p>Pre-implementation activities such as coordination and planning with the field staff to be involved in the project implementation have already started. The target start of implementation is on December 2020.</p>', '2020-11-19', 64, '2021-06-09 11:41:31', '2021-06-21 21:10:15'),
(58, '<p>As of December 31, 2020: No. of hectares fertilized: 551 No. of hectares planted: 135</p>', '2020-12-31', 67, '2021-06-09 11:41:31', '2021-06-23 14:23:04'),
(59, 'Proposed in the FY 2022 Plan and Budget Proposal', '2021-06-05', 262, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(60, 'It is a regular program of DA-ICTS, it is being implemented annually.', '2021-06-06', 265, '2021-06-09 11:41:31', '2021-06-09 11:41:31'),
(61, '<p>Enhanced/Revised Administrative order No. 1 (Fiber Standards and Trade Rules and Regulations)</p>', '2021-05-28', 69, '2021-06-09 11:41:31', '2021-06-22 17:22:27'),
(62, '<p>Project is proposed for funding in 2021.</p>', '2020-11-18', 84, '2021-06-09 11:41:31', '2021-06-22 17:26:27'),
(63, '<p>N/A</p>', '2021-06-06', 70, '2021-06-09 11:41:31', '2021-06-24 07:34:54'),
(64, '<p>As of December 31, 2020: No. of food processing technologies developed: 2 No. of non-food processing technologies developed: 2 No. of new projects approved/funded/conducted: 7</p>', '2020-12-31', 71, '2021-06-09 11:41:31', '2021-06-25 15:18:29'),
(65, '<p>To be included in the budget proposal for 2022</p>', '2020-11-16', 73, '2021-06-09 11:41:31', '2021-06-18 11:01:10'),
(66, '<p>The project has been presented to the DA-wide Clearinghouse Committee and the NEDA has already endorsed project. Since the project will be funded by ODA-Grant, it is possible that the project will commence by 2021.</p>', '2020-11-15', 74, '2021-06-09 11:41:31', '2021-06-23 15:11:41'),
(67, '<p>Laboratory constructed at CLSU. Other laboratories are still proposed for funding. The laboratory in PCC at CLSU is already being used.</p>', '2019-09-27', 75, '2021-06-09 11:41:31', '2021-06-25 08:09:17'),
(68, '<p>To be proposed in 2022 budget proposal of PCC</p>', '2020-11-26', 76, '2021-06-09 11:41:32', '2021-06-18 09:24:58'),
(69, '<p>Approved for Implementation amounting to Php 13,800,000.00</p>', '2020-11-16', 77, '2021-06-09 11:41:32', '2021-06-18 10:42:01'),
(70, '<p>To be proposed under PCC\'s NEP in 2021</p>', '2019-10-15', 78, '2021-06-09 11:41:32', '2021-06-21 15:15:08'),
(71, '<p>Proposal as approved by the Advisory Board of PCC</p>', '2020-11-16', 83, '2021-06-09 11:41:32', '2021-06-21 15:00:35'),
(72, '<p>One (1) sisal processing center was constructed in Bohol. Existing sisal plantation in Bohol, Cebu, and Mt. Province. Three (3) sisal nurseries were established in Bohol, Zambales and Ilocos Sur.</p>', '2021-06-21', 85, '2021-06-09 11:41:32', '2021-06-22 17:29:05'),
(73, '<p>Provided 10 Million fund allocation to Sericulture Research and Development Institute at Don Mariano Marcos Memorial State University (SRDI-MMSU) for the establishment of rearing houses and procurement of sericulture equipment.</p>', '2021-06-01', 86, '2021-06-09 11:41:32', '2021-06-23 15:04:02'),
(75, '<p>Construction of Biotech Building was stopped due insufficient budget.</p>', '2021-06-05', 88, '2021-06-09 11:41:32', '2021-06-23 15:15:53'),
(76, '<p>Established three (3) cotton processing and ginning and spinning centers Established ten (10) other fibercrops processing centers Distributed various postharvest equipment</p>', '2021-06-05', 89, '2021-06-09 11:41:32', '2021-06-23 15:17:26'),
(77, '<p>PhilFIDA-FUTD had been conducted research to determine the viable of the project in the country.</p>', '2021-06-23', 92, '2021-06-09 11:41:32', '2021-06-23 15:18:11'),
(78, '<p>Existing kozo farms in San mateo, Isabela and Balamban, Cebu</p>', '2021-06-23', 93, '2021-06-09 11:41:32', '2021-06-23 15:37:31'),
(79, '<p>Existing tikog industry in Basey, Samar</p>', '2021-06-23', 94, '2021-06-09 11:41:32', '2021-06-23 15:43:48'),
(80, '<p>PhilFIDA-FUTD is already conducting research for the development of bamboo extraction machine</p>', '2021-05-28', 95, '2021-06-09 11:41:32', '2021-06-23 15:46:07'),
(82, '<p>Ongoing implementation</p>', '2021-06-23', 97, '2021-06-09 11:41:32', '2021-06-23 15:48:06'),
(83, '<p>As of October 2020, the program has already obligated 3.109 billion and accomplished the following activities: 374 Community Needs Assessment covering 27,732 individuals; 2,046 livelihood projects benefiting 99,782 individuals and 2,476 farmers organization/cooperative; and 1,390 technical trainings with 68,479 farmers trained</p>', '2021-06-23', 98, '2021-06-09 11:41:32', '2021-06-23 15:50:07'),
(84, '<p>Agreement between Philippines &amp; Japan has already been approved by the Office of the President.</p>', '2020-04-04', 99, '2021-06-09 11:41:32', '2021-06-24 08:53:03'),
(85, '<p>Since 2016, a total of 213 block farms has been organized and made operational with a total of 5,688 farmer enrollees and almost 8,500 hectares in coverage.</p>', '2020-09-19', 100, '2021-06-09 11:41:32', '2021-06-24 21:54:17'),
(86, '<p>Two bridge projects are on-going construction and one is in pre-implementation stage.</p>', '2018-09-30', 101, '2021-06-09 11:41:32', '2021-06-24 14:31:58'),
(87, '<p>Since the start of the implementation of SIDA programs in 2016, a total of 125 FMRs were already constructed with a total length of 146.84 kms. Five projects are on-going construction, while 37 are in the pre-implementation stage.</p>', '2018-09-30', 102, '2021-06-09 11:41:32', '2021-06-24 09:16:12'),
(88, '<p>12 out of 44 sub-projects have been completed, and the remaining are still on-going.</p>', '2021-06-25', 103, '2021-06-09 11:41:32', '2021-06-25 14:27:49'),
(89, '<p>There are 610 on-going scholars under the program being implemented by SRA &amp; CHED, while 165 already graduated.</p>', '2020-09-30', 104, '2021-06-09 11:41:32', '2021-06-24 22:12:29'),
(90, '<p>Out of the total program fund, 98.8% are already committed. Php408.39M worth of loans are already approved while Php208.52M are still in-process. Out of the approved loans, Php267.39M worth of loans were already released.</p>', '2020-09-30', 105, '2021-06-09 11:41:32', '2021-06-24 22:03:28'),
(91, '<p>15 February 2021: 4Ks submitted the revised FS Report to the Clearinghouse TECHSEC 24 March 2021: The FS Report was recommended for the Committee’s favorable action and endorsement to the Project Clearinghouse Executive Committee (EXECOM) 30 March 2021: The FS Report was deliberated by the EXECOM. For further enhancement. Ongoing revision/enhancement of the FS Report by the proponent with technical assistance of the Clearinghouse TECHSEC</p>', '2021-05-28', 106, '2021-06-09 11:41:32', '2021-06-10 11:42:36'),
