(216, '26 Oct 2019 - Project Proposal/Concept Note Endorsed to NEDA/DOF/DFA /PPP\n25 Oct 2018 - Being processed under the DA Wide Project Clearinghouse', '2019-10-26', 297, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(217, 'Being processed by DA Wide Clearinghouse', '2019-10-26', 298, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(218, '<p>Studies were conducted to find alternative uses of tobacco, one of which was the Scale Up Production and Demonstration Trials on the Use of Tobacco Leaf Extract Emulsion; Tobacco Handmade Paper Production: Technology enhancements and prototyping of novelty items; and Spent Tea Leaves and Tobacco Dust as additive to Plywood Adhesive.</p>', '2021-06-25', 299, '2021-06-09 11:41:32', '2021-06-25 14:46:17'),
(219, '<p>various commodity clearances/import/export permits issued to 57 Importers/Exporters/Manufactureres and Licenses were likewise issued to Trading Centers/Wholesale Tobacco Dealers/Redrying Plants</p>', '2021-06-25', 300, '2021-06-09 11:41:32', '2021-06-25 15:03:10'),
(220, '<p>No funding up to date.</p>', '2021-06-25', 301, '2021-06-09 11:41:32', '2021-06-25 13:55:56'),
(221, 'TCGS-5,838 tob. farmers w/ an area of 3,600 has. were extended production assistance; Seeds (80.24 kgs) were distributed to TCGS farmer-beneficiaries free of charge; Rice prod\'n. proj. 2,426 FCs & 1,897 has. Were granted prod\'n. assistance in the amount of 20M; Curing Barn Assistance proj. 3,336 tob. farmers were extended assistance for repair of their curing barns, PhP 50M was released.', '2019-10-21', 302, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(222, '<p>2,826,250 tree seedlings (ipil-ipil, gemelina, mahogany) were planted in anarea of 1,130 hectares in Region I and CAR; Bamboo component, 46,685 seedlings were planted in an area of 228 hectares in Region II; Farmer beneficiaries totaled to 1,177; Production assistanc, PhP28.46 M. Synchronized Tree Planting a tot. of 2,033,105 tree seedlings were planted with a budget of PhP2.76 M</p>', '2021-06-25', 303, '2021-06-09 11:41:32', '2021-06-25 15:45:51'),
(223, 'with project proposal, feasibility study and DED', '2019-10-19', 304, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(224, '<p>Initially trained a total of 1,060 tobacco farmers/dependents in the different provinces of Regions 1 and 2, and CAR</p>', '2021-06-25', 305, '2021-06-09 11:41:32', '2021-06-25 16:07:50'),
(225, '<p>Proposed under DBM Tier 2</p>', '2021-06-24', 306, '2021-06-09 11:41:32', '2021-06-24 11:18:56'),
(226, '<p>458 participants composed of TPROs, Agriculturist, Tobacco Company graders, and Farmer Leaders were trained on the Harmonized Grades of Tobacco.</p>', '2019-10-21', 307, '2021-06-09 11:41:32', '2021-06-25 16:39:50'),
(227, 'Included in FY 2022 Budget Proposal', '2021-06-08', 308, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(228, 'Included in FY 2022 Budget Proposal', '2021-06-08', 309, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(229, 'Included in FY 2022 Budget Proposal', '2021-06-08', 310, '2021-06-09 11:41:32', '2021-06-09 11:41:32'),
(230, '<p>Included in FY 2022 Budget Proposal</p>', '2021-06-08', 311, '2021-06-09 11:41:32', '2021-06-09 17:12:46'),
(233, '<p>included in the FY 2022 proposal&nbsp;</p>', '2021-06-09', 315, '2021-06-09 22:03:05', '2021-06-09 22:03:05'),
(234, '<p>The program consists of ongoing and continuing projects of which the activities targetted for each year of implementation will have been 100% completed at the end of the year</p>', '2021-06-10', 316, '2021-06-09 23:20:04', '2021-06-09 23:35:40'),
(235, '<p>ongoing discussions with PCA and regional offices</p>', '2021-06-10', 317, '2021-06-10 00:28:11', '2021-09-01 13:12:33'),
(237, '<p>The project is ongoing.&nbsp;</p>', '2019-10-10', 319, '2021-06-11 12:19:38', '2021-06-11 12:26:22'),
(238, '<p>Project was funded by PCAARRD and already completed. Following are the accomplishments:</p><ol><li>Established 1,500 sq. m. production area for selected vegetables, legumes, herbs and fruit tree seedlings;</li></ol>', '2018-12-31', 320, '2021-06-11 12:40:05', '2021-06-11 12:40:05'),
(239, '<p>Provided source of livelihood to the municipality of Casiguran:</p><ul><li>Distributed various live animals- 141 heads</li><li>Distributed Drugs &amp; Biologics (2 ltrs Dewormer, 11 Antibiotics, 11 bottles Vit ADE, 11 bottles Iron Dextran)</li><li>Distributed 1 drum Molasse, 72 kgs Vermiworms</li></ul>', '2019-10-19', 321, '2021-06-11 12:52:53', '2021-06-11 12:52:53'),
(240, 'No project funding to date, project was proposed to JAICA through DA- PDS', '2020-11-25', 322, '2021-06-14 08:38:14', '2021-06-14 08:38:14'),
(241, '<p>Dropped from PFDA\'s pipeline. Not included in the FY 2022 Plan and Budget Proposal</p>', '2021-06-14', 323, '2021-06-14 13:55:35', '2021-06-14 13:55:35'),
(242, '<p>Ongoing implementation</p>', '2021-06-14', 324, '2021-06-14 14:12:11', '2021-06-23 14:37:48'),
(243, '<p>This is an ongoing regular program of the department.</p>', '2021-06-14', 325, '2021-06-14 15:50:44', '2021-06-25 16:01:50'),
(244, '<p>No investment targets breakdown yet; subject to updating of BFAR, costs are in USD terms</p>', '2021-06-18', 326, '2021-06-18 10:12:38', '2021-06-21 14:13:14'),
(245, '<p>Proposed for Tier 2</p>', '2021-06-24', 327, '2021-06-24 09:54:11', '2021-06-24 10:07:00'),
(246, '<p>Conversion rate used is PhP48.84/$</p>', '2021-06-24', 328, '2021-06-24 10:09:21', '2021-06-24 10:09:21'),
(247, '<p>Proposed under DBM Tier 2</p>', '2021-06-24', 329, '2021-06-24 11:39:02', '2021-06-24 11:39:02'),
(248, '<p>Proposed under DBM Tier 2</p>', '2021-06-24', 330, '2021-06-24 12:14:33', '2021-06-24 12:14:33'),
(249, '<p>The project is undergoing the MC 16 process and project agreement has not been signed by the Secretary of DA. DA has allowed to conduct preparatory activities with the condition that the project agreement will be assigned within the project life.</p><p>It should also be noted that the total project cost is P2,966,650.00 spanning over three years of implementation (beginning 2021 until 2023), as there is no breakdown of the financial figures per year per PhilRice.</p>', '2021-06-24', 331, '2021-06-24 13:14:12', '2021-06-24 13:18:09'),
(250, '<p>Conversion rate used is PhP48.84/$</p>', '2021-06-24', 332, '2021-06-24 14:06:56', '2021-06-25 15:06:02'),
(251, '<p>Completed in 2020</p>', '2021-06-24', 333, '2021-06-24 14:37:16', '2021-06-24 14:37:16'),
(252, '<p>Overall, the project has a 97.2% Financial Accomplshment as of Sept 2020 &nbsp;and 94.85% Physical Accomplishment as of March 2021. Future activities of the project includes the continued construction of the CBC building, continuing capability enhancement activities for researchers from CBC, SUCs, and other DA-attached agencies, and the conduct and monitoring of R&amp;D activities.</p>', '2021-06-08', 334, '2021-06-25 10:21:30', '2021-06-25 10:21:30'),
(253, '<p>Ongoing implementation until June 30, 2021</p>', '2021-06-25', 335, '2021-06-25 11:07:28', '2021-06-25 11:18:49'),
(254, '<p>Ongoing processing of the Korean Government approval through the RDA.</p><p><br>&nbsp;</p>', '2021-06-25', 336, '2021-06-25 12:51:02', '2021-06-25 12:51:02'),
