(4, 'Constitutional Amendment', 'Increase competitiveness and the ease of doing business. This effort will draw upon successful models used to attract business to local cities (e.g., Davao), and pursue the relaxation of the Constitutional restrictions on foreign ownership, except as regards land ownership, in order to attract forei', 'constitutional-amendment', NULL, NULL, NULL),
