(7, 'Basic Education', 'Invest in human capital development, including health and education systems, and match skills and training to meet the demand of businesses and the private sector.', 'basic-education', NULL, NULL, NULL),
(8, 'Innovation in Science, Technology and the Arts', 'Promote science, technology, and the creative arts to enhance innovation and creative capacity towards self-sustaining, inclusive development.', 'innovation-in-science-technology-and-the-arts', NULL, NULL, NULL),
